oFF.XClipboard = function() {};
oFF.XClipboard.prototype = new oFF.XObject();
oFF.XClipboard.prototype._ff_c = "XClipboard";

oFF.XClipboard.CLIPBOARD_HISTORY_SIZE = 10;
oFF.XClipboard.create = function()
{
	let newInstance = new oFF.XClipboard();
	newInstance._setupClipboard();
	return newInstance;
};
oFF.XClipboard.prototype.m_clipboardChangedConsumers = null;
oFF.XClipboard.prototype.m_clipboardHistory = null;
oFF.XClipboard.prototype.m_currentData = null;
oFF.XClipboard.prototype._addClipboardHistoryEntry = function(data)
{
	if (oFF.notNull(data))
	{
		this.m_clipboardHistory.insert(0, data);
		if (this.m_clipboardHistory.size() > oFF.XClipboard.CLIPBOARD_HISTORY_SIZE)
		{
			this.m_clipboardHistory.removeAt(oFF.XClipboard.CLIPBOARD_HISTORY_SIZE);
		}
	}
};
oFF.XClipboard.prototype._notifyClipboardChangedConsumers = function(newData)
{
	this.m_clipboardChangedConsumers.accept(newData);
};
oFF.XClipboard.prototype._setupClipboard = function()
{
	this.m_clipboardHistory = oFF.XList.create();
	this.m_clipboardChangedConsumers = oFF.XConsumerCollection.create();
};
oFF.XClipboard.prototype.addClipboardChangedConsumer = function(consumer)
{
	return this.m_clipboardChangedConsumers.addConsumer(consumer);
};
oFF.XClipboard.prototype.clear = function()
{
	this.m_currentData = null;
};
oFF.XClipboard.prototype.getDataContentType = function()
{
	let contentType = null;
	if (oFF.notNull(this.m_currentData))
	{
		contentType = this.m_currentData.getContentType();
	}
	return contentType;
};
oFF.XClipboard.prototype.hasData = function()
{
	return oFF.notNull(this.m_currentData);
};
oFF.XClipboard.prototype.read = function()
{
	if (oFF.isNull(this.m_currentData))
	{
		return oFF.XPromise.resolve(null);
	}
	let copy = oFF.XContent.createContent();
	try
	{
		copy.setFromContent(this.m_currentData);
	}
	catch (err)
	{
		return oFF.XPromise.reject(oFF.XError.createWithThrowable(err));
	}
	return oFF.XPromise.resolve(copy);
};
oFF.XClipboard.prototype.readText = function()
{
	if (oFF.isNull(this.m_currentData))
	{
		return oFF.XPromise.resolve("");
	}
	if (this.m_currentData.getContentType().isTypeOf(oFF.ContentType.TEXT))
	{
		return oFF.XPromise.resolve(this.m_currentData.getString());
	}
	return oFF.XPromise.resolve("");
};
oFF.XClipboard.prototype.removeClipboardChangedConsumerByUuid = function(consumerUuid)
{
	this.m_clipboardChangedConsumers.removeConsumerByUuid(consumerUuid);
};
oFF.XClipboard.prototype.write = function(data)
{
	let newContent = oFF.XContent.createContent();
	newContent.setFromContent(data);
	this.m_currentData = newContent;
	this._addClipboardHistoryEntry(this.m_currentData);
	this._notifyClipboardChangedConsumers(this.m_currentData);
	return oFF.XPromise.resolve(oFF.XBooleanValue.create(true));
};
oFF.XClipboard.prototype.writeText = function(text)
{
	this.m_currentData = oFF.XContent.createStringContent(oFF.ContentType.TEXT_PLAIN, text);
	this._addClipboardHistoryEntry(this.m_currentData);
	this._notifyClipboardChangedConsumers(this.m_currentData);
	return oFF.XPromise.resolve(oFF.XBooleanValue.create(true));
};

