oFF.CoPropertyFactory = {

	s_propertyClasses:null,
	_newPropertyInstance:function(name, type, propertyMetadataStructure)
	{
			let newInstance = null;
		let propertyClass = oFF.CoPropertyFactory.s_propertyClasses.getByKey(type.getName());
		if (oFF.notNull(propertyClass))
		{
			newInstance = propertyClass.newInstance(null);
		}
		if (oFF.notNull(newInstance))
		{
			newInstance.initializePropertyFromStructure(name, type, propertyMetadataStructure);
		}
		else
		{
			throw oFF.XException.createRuntimeException("Failed to initialize property!");
		}
		return newInstance.isValid() ? newInstance : null;
	},
	_newPropertyInstanceSimple:function(name, alias, dataType)
	{
			let newInstance = null;
		let propertyClass = oFF.CoPropertyFactory.s_propertyClasses.getByKey(dataType.getName());
		if (oFF.notNull(propertyClass))
		{
			newInstance = propertyClass.newInstance(null);
		}
		if (oFF.notNull(newInstance))
		{
			newInstance.initializePropertySimple(name, alias, dataType);
		}
		else
		{
			throw oFF.XException.createRuntimeException("Failed to initialize property!");
		}
		return newInstance;
	},
	createPropertySimple:function(name, alias, dataType)
	{
			let newProperty = null;
		try
		{
			newProperty = oFF.CoPropertyFactory._newPropertyInstanceSimple(name, alias, dataType);
		}
		catch (err)
		{
			oFF.XLogger.println(oFF.XStringUtils.concatenate2("Failed to parse property! Reason: ", oFF.XException.getMessage(err)));
		}
		return newProperty;
	},
	processAllPropertiesFromList:function(propertiesList)
	{
			let propertyMap = oFF.XLinkedHashMapByString.create();
		if (!oFF.XCollectionUtils.hasElements(propertiesList) || !propertiesList.isList())
		{
			return propertyMap;
		}
		oFF.XCollectionUtils.forEach(propertiesList, (property) => {
			if (oFF.isNull(property) || !property.isStructure())
			{
				return;
			}
			let propertyStructure = property.asStructure();
			let name = propertyStructure.getStringByKey(oFF.CoPropertyMetadataConstants.NAME_KEY);
			oFF.CoPropertyFactory.tryProcessPropertyToMap(propertyMap, name, propertyStructure);
		});
		return propertyMap;
	},
	processAllPropertiesFromStructure:function(propertiesStruct)
	{
			let propertyMap = oFF.XLinkedHashMapByString.create();
		if (oFF.notNull(propertiesStruct) && propertiesStruct.isStructure() && propertiesStruct.hasElements())
		{
			let keysList = propertiesStruct.getKeysAsReadOnlyList();
			oFF.XCollectionUtils.forEach(keysList, (tmpKey) => {
				let propertyStructure = propertiesStruct.getStructureByKey(tmpKey);
				oFF.CoPropertyFactory.tryProcessPropertyToMap(propertyMap, tmpKey, propertyStructure);
			});
		}
		return propertyMap;
	},
	processPropertyStructure:function(key, propertyMetadataStructure)
	{
			let newProperty = null;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(key) && oFF.notNull(propertyMetadataStructure) && propertyMetadataStructure.isStructure() && propertyMetadataStructure.hasElements())
		{
			try
			{
				let propertyName = key;
				let propertyType = oFF.CoDataType.lookup(propertyMetadataStructure.getStringByKey(oFF.CoPropertyMetadataConstants.TYPE_KEY));
				newProperty = oFF.CoPropertyFactory._newPropertyInstance(propertyName, propertyType, propertyMetadataStructure);
			}
			catch (err)
			{
				oFF.XLogger.println(oFF.XStringUtils.concatenate2("Failed to parse property! Reason: ", oFF.XException.getMessage(err)));
			}
		}
		return newProperty;
	},
	registerPropertyTypeClass:function(type, clazz)
	{
			if (oFF.isNull(type))
		{
			oFF.XLogger.printError("property must have a type");
			return;
		}
		let typeName = type.getName();
		if (oFF.CoPropertyFactory.s_propertyClasses.containsKey(typeName))
		{
			oFF.XLogger.printError(oFF.XStringUtils.concatenate2("type already exists: ", typeName));
			return;
		}
		oFF.CoPropertyFactory.s_propertyClasses.put(type.getName(), clazz);
	},
	staticSetup:function()
	{
			oFF.CoPropertyFactory.s_propertyClasses = oFF.XHashMapByString.create();
		oFF.CoPropertyFactory.registerPropertyTypeClass(oFF.CoDataType.STRING, oFF.XClass.create(oFF.CoStringProperty));
		oFF.CoPropertyFactory.registerPropertyTypeClass(oFF.CoDataType.INTEGER, oFF.XClass.create(oFF.CoIntegerProperty));
		oFF.CoPropertyFactory.registerPropertyTypeClass(oFF.CoDataType.NUMBER, oFF.XClass.create(oFF.CoNumberProperty));
		oFF.CoPropertyFactory.registerPropertyTypeClass(oFF.CoDataType.BOOLEAN, oFF.XClass.create(oFF.CoBooleanProperty));
		oFF.CoPropertyFactory.registerPropertyTypeClass(oFF.CoDataType.ARRAY, oFF.XClass.create(oFF.CoArrayProperty));
		oFF.CoPropertyFactory.registerPropertyTypeClass(oFF.CoDataType.OBJECT, oFF.XClass.create(oFF.CoObjectProperty));
	},
	tryProcessPropertyToMap:function(propertyMap, propertyName, propertyStructure)
	{
			try
		{
			let newProperty = oFF.CoPropertyFactory.processPropertyStructure(propertyName, propertyStructure);
			if (oFF.notNull(newProperty))
			{
				propertyMap.put(propertyName, newProperty);
			}
			else
			{
				throw oFF.XException.createRuntimeException(oFF.XStringUtils.concatenate2("====== Could not process property -> ", propertyName));
			}
		}
		catch (err)
		{
			oFF.XLogger.println(oFF.XStringUtils.concatenate2("Failed to parse property! Reason: ", oFF.XException.getMessage(err)));
		}
	}
};

oFF.TokenUtils = function() {};
oFF.TokenUtils.prototype = new oFF.XObject();
oFF.TokenUtils.prototype._ff_c = "TokenUtils";

oFF.TokenUtils.create = function(systemDescription)
{
	let tokenUtils = new oFF.TokenUtils();
	tokenUtils.m_systemDescription = systemDescription;
	return tokenUtils;
};
oFF.TokenUtils.prototype.m_systemDescription = null;
oFF.TokenUtils.prototype.handleOAuthTokenLoaded = function(extResult)
{
	let ACCESS_TOKEN = "access_token";
	let EXPIRES_IN = "expires_in";
	let TOKEN_REFRESH_START_TIME_BUFFER_MS = 60000;
	let jsonContent = extResult.getData().getJsonContent();
	let responseJson = oFF.PrUtils.asStructure(jsonContent);
	if (oFF.isNull(responseJson))
	{
		throw oFF.XException.createIllegalArgumentException("Empty response");
	}
	let bearerToken = responseJson.getStringByKey(ACCESS_TOKEN);
	let expiresIn = responseJson.getIntegerByKeyExt(EXPIRES_IN, -1);
	if (oFF.notNull(bearerToken))
	{
		this.m_systemDescription.setAuthenticationType(oFF.AuthenticationType.BEARER);
		this.m_systemDescription.setAuthenticationToken(oFF.XAuthenticationToken.create(bearerToken));
		let expiresAt = null;
		if (expiresIn > 0)
		{
			let expiresAtMs = oFF.XDateTime.createCurrentLocalDateTime().getMilliseconds() + expiresIn * 1000 - TOKEN_REFRESH_START_TIME_BUFFER_MS;
			expiresAt = oFF.XDateTime.createWithMilliseconds(expiresAtMs);
			this.m_systemDescription.setAuthenticationTokenExpiresAt(expiresAt);
		}
	}
};
oFF.TokenUtils.prototype.isBearerTokenExpired = function()
{
	let expiresAt = this.m_systemDescription.getAuthenticationTokenExpiresAt();
	return oFF.notNull(expiresAt) && (expiresAt.getTimeInMilliseconds() - oFF.XDateTime.createCurrentLocalDateTime().getTimeInMilliseconds()) <= 0;
};
oFF.TokenUtils.prototype.isOAuthTokenExpired = function()
{
	return (this.m_systemDescription.getAuthenticationType().isEqualTo(oFF.AuthenticationType.BEARER) && oFF.XString.isEqual(this.m_systemDescription.getFPAAuthenticationMethod(), oFF.AuthenticationType.OAUTH.getName()) && this.isBearerTokenExpired());
};
oFF.TokenUtils.prototype.isTokenNeeded = function(evaluateBasicAuth)
{
	if (this.m_systemDescription.getAuthenticationType().isEqualTo(oFF.AuthenticationType.BEARER))
	{
		return this.isBearerTokenExpired();
	}
	if (!this.m_systemDescription.useLiveIntegrationConnectionManager())
	{
		return false;
	}
	if (evaluateBasicAuth && this.m_systemDescription.getAuthenticationType().isEqualTo(oFF.AuthenticationType.BASIC))
	{
		return true;
	}
	if (oFF.XString.isEqual(this.m_systemDescription.getFPAAuthenticationMethod(), oFF.AuthenticationType.OPENID.getName()))
	{
		return true;
	}
	return false;
};

