{
	oFF.ModuleLoaderFactory.register(new oFF.ModuleLoaderDummy());
};
oFF.ModuleLoaderDummy.prototype.processModuleLoad = function(syncType, listener, customIdentifier, process, moduleDef, cachebusterId)
{
	let messages = oFF.MessageManagerSimple.createMessageManager();
	let fullClazzName = moduleDef.getInitClazzNameCompatible();
	let clazz = oFF.XClass.createByName(fullClazzName);
	let didLoad = true;
	if (oFF.notNull(clazz))
	{
		clazz.newInstance(process);
		didLoad = true;
	}
	else
	{
		messages.addMessage(oFF.XMessage.createError(oFF.OriginLayer.KERNEL, oFF.XStringUtils.concatenate2("ModuleLoader: Could not load XCLass=", fullClazzName), null, false, null));
		didLoad = false;
	}
	listener.onModuleLoaded(messages, moduleDef.getName(), didLoad, customIdentifier);
};

