{
	return oFF.NestedBatchRequestDecorator.getBatchRequestDecorator(requestStructure);
};

oFF.KernelPlatformUtils = {

	_loadVfsEntiesByJsonStructureInternal:function(kernel, rootPath, preload)
	{
			if (preload.isStructure())
		{
			if (oFF.notNull(rootPath))
			{
				kernel.addVfsDirectory(rootPath, "rwx");
			}
			let keys = preload.asStructure().getKeysAsReadOnlyList();
			for (let i = 0; i < keys.size(); i++)
			{
				oFF.KernelPlatformUtils._loadVfsEntiesByJsonStructureInternal(kernel, oFF.XStringUtils.concatenate3(rootPath, "/", keys.get(i)), preload.asStructure().getByKey(keys.get(i)));
			}
		}
		else
		{
			let data = null;
			let rawContent = preload.asString().getString();
			let base64 = "base64:";
			let text = "text:";
			if (oFF.XString.startsWith(rawContent, base64))
			{
				data = oFF.XContent.createByteArrayContent(oFF.ContentType.APPLICATION_OCTETSTREAM, oFF.XBase64.getInstance().decodeToBytes(oFF.XString.substring(rawContent, oFF.XString.size(base64), -1)));
			}
			else
			{
				data = oFF.XContent.createStringContent(oFF.ContentType.TEXT, oFF.XString.startsWith(rawContent, text) ? oFF.XString.substring(rawContent, oFF.XString.size(text), -1) : rawContent);
			}
			kernel.addVfsFile(rootPath, data, "rw");
		}
	},
	_splitStringByNewLine:function(value)
	{
			if (oFF.isNull(value))
		{
			return null;
		}
		let listOfString = null;
		if (oFF.XString.containsString(value, "\r\n"))
		{
			listOfString = oFF.XStringTokenizer.splitString(value, "\r\n");
		}
		else if (oFF.XString.containsString(value, "\r"))
		{
			listOfString = oFF.XStringTokenizer.splitString(value, "\r");
		}
		else if (oFF.XString.containsString(value, "\n"))
		{
			listOfString = oFF.XStringTokenizer.splitString(value, "\n");
		}
		return listOfString;
	},
	loadPlatformManifests:function(kernelProcess)
	{
			let manifestLoadPromises = oFF.XPromiseList.create();
		manifestLoadPromises.add(oFF.ProgramManifestLoader.loadProgramManifests(kernelProcess));
		manifestLoadPromises.add(oFF.CoConfigurationManifestLoader.loadGenericConfigurationManifests(kernelProcess));
		let allManifestLoadPromise = oFF.XPromise.allSettled(manifestLoadPromises);
		return allManifestLoadPromise.onThenExt((res) => {
			return oFF.XBooleanValue.create(true);
		});
	},
	loadPlatformMountFile:function(sdkDir, environment)
	{
			let mountExpList = oFF.XList.create();
		if (oFF.notNull(sdkDir) && sdkDir.isValid())
		{
			let mountFile = sdkDir.newChild(environment.getVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_VFS_MOUNT_FILE));
			return oFF.XFilePromise.loadContent(mountFile).onThenExt((content) => {
				if (oFF.notNull(content))
				{
					let mountList = oFF.KernelPlatformUtils._splitStringByNewLine(content.getString());
					oFF.XCollectionUtils.forEach(mountList, (mountExp) => {
						if (oFF.XStringUtils.isNotNullAndNotEmpty(mountExp))
						{
							mountExpList.add(mountExp);
						}
					});
				}
				return mountExpList.getValuesAsReadOnlyList();
			}).onCatchExt((err) => {
				return mountExpList;
			});
		}
		return oFF.XPromise.resolve(mountExpList);
	},
	loadVfsEntiedByNativeJson:function(kernel, nativeJson)
	{
			try
		{
			let jsonParser = oFF.JsonParserFactory.newInstance();
			let output = jsonParser.convertFromNative(nativeJson);
			oFF.XObjectExt.release(jsonParser);
			oFF.KernelPlatformUtils.loadVfsEntiresByJsonStructure(kernel, output);
		}
		catch (err)
		{
			oFF.XLogger.printError(oFF.XStringUtils.concatenate2("Failed to parse vfs json! Error: ", oFF.XException.getMessage(err)));
		}
	},
	loadVfsEntiresByJsonStructure:function(kernel, element)
	{
			oFF.KernelPlatformUtils._loadVfsEntiesByJsonStructureInternal(kernel, null, element);
	},
	preloadConfigurations:function(kernelProcess)
	{
			let configurationPreloadPromises = oFF.XPromiseList.create();
		configurationPreloadPromises.add(oFF.CoChartDefaultConfigurationUtils.getInstance().loadChartDefaultConfiguration(kernelProcess));
		let allConfigurationPreloadPromise = oFF.XPromise.allSettled(configurationPreloadPromises);
		return allConfigurationPreloadPromise.onThenExt((res) => {
			return oFF.XBooleanValue.create(true);
		});
	},
	processPlatformExportFile:function(sdkDir, environment)
	{
			if (oFF.notNull(sdkDir) && sdkDir.isValid())
		{
			let exportFile = sdkDir.newChild(environment.getVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_EXPORT_FILE));
			return oFF.XFilePromise.loadContent(exportFile).onThenExt((content) => {
				if (oFF.notNull(content))
				{
					let exportList = oFF.KernelPlatformUtils._splitStringByNewLine(content.getString());
					oFF.XCollectionUtils.forEach(exportList, (exportExp) => {
						environment._export(exportExp);
					});
				}
				return oFF.XBooleanValue.create(true);
			}).onCatchExt((err) => {
				return oFF.XBooleanValue.create(true);
			});
		}
		return oFF.XPromise.resolve(oFF.XBooleanValue.create(true));
	}
};

