oFF.ProgramManifestLoader = {

	MANIFESTS_RESOURCE_LOCATION:"/manifests/programs/",
	s_processedResourceManifests:null,
	_loadProgramManifestsInternal:function(process, forceReload)
	{
			if (oFF.notNull(process))
		{
			return oFF.XFilePromise.fetchChildren(oFF.XFile.create(process, oFF.KernelConstants.DEFAULT_PROGRAM_MANIFEST_LOCATION)).onThenPromise((children) => {
				let promiseList = oFF.XPromiseList.create();
				oFF.XCollectionUtils.forEach(children, (child) => {
					promiseList.add(oFF.ProgramManifestLoader._registerProgramByFileInternal(child, forceReload));
				});
				let allFilesLoadingPromise = oFF.XPromise.allSettled(promiseList);
				return allFilesLoadingPromise.onThenExt((result) => {
					return oFF.XBooleanValue.create(true);
				});
			});
		}
		return oFF.XPromise.reject(oFF.XError.create("Missing process!"));
	},
	_registerProgramByFileInternal:function(programManifestFile, forceReload)
	{
			if (oFF.notNull(programManifestFile))
		{
			return oFF.XFilePromise.loadJsonStructure(programManifestFile).onThenExt((jsonContent) => {
				if (forceReload)
				{
					oFF.ProgramRegistry.forceRegisterProgramByStructure(jsonContent);
				}
				else
				{
					oFF.ProgramRegistry.registerProgramByStructure(jsonContent);
				}
				return oFF.XBooleanValue.create(true);
			});
		}
		return oFF.XPromise.reject(oFF.XError.create("Missing program manifest file!"));
	},
	loadProgramManifests:function(process)
	{
			return oFF.ProgramManifestLoader._loadProgramManifestsInternal(process, false);
	},
	loadProgramManifestsFromResources:function()
	{
			if (oFF.isNull(oFF.ProgramManifestLoader.s_processedResourceManifests))
		{
			oFF.ProgramManifestLoader.s_processedResourceManifests = oFF.XList.create();
		}
		let resourceManifests = oFF.XResourcesExt.list(oFF.ProgramManifestLoader.MANIFESTS_RESOURCE_LOCATION);
		oFF.XCollectionUtils.forEach(resourceManifests, (resource) => {
			if (!oFF.ProgramManifestLoader.s_processedResourceManifests.contains(resource))
			{
				oFF.ProgramRegistry.registerProgramByResource(oFF.XStringUtils.concatenate2(oFF.ProgramManifestLoader.MANIFESTS_RESOURCE_LOCATION, resource));
				oFF.ProgramManifestLoader.s_processedResourceManifests.add(resource);
			}
		});
	},
	registerProgramByManifestFile:function(programManifestFile)
	{
			return oFF.ProgramManifestLoader._registerProgramByFileInternal(programManifestFile, false);
	},
	reloadProgramManifests:function(process)
	{
			return oFF.ProgramManifestLoader._loadProgramManifestsInternal(process, true);
	}
};

