				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.MOBILE, userProfile.isMobilePhoneNumberDefault(), userProfile.getMobilePhoneNumber());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.DESCRIPTION, userProfile.isDescriptionDefault(), userProfile.getDescription());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.DEPARTMENT, userProfile.isDepartmentDefault(), userProfile.getDepartment());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.COMPANY, userProfile.isCompanyDefault(), userProfile.getCompany());
