				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.ROOM_NUMBER, userProfile.isRoomNumberDefault(), userProfile.getRoomNumber());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.REGION, userProfile.isRegionDefault(), userProfile.getRegion());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.DATA_ACCESS_LANGUAGE, userProfile.isLanguageDefault(), userProfile.getLanguage());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.LANGUAGE, userProfile.isLanguageDefault(), userProfile.getLanguage());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.ACCOUNT_TYPE, userProfile.isSamaAccountTypeDefault(), userProfile.getSamaAccountType());
				oFF.UserProfileDefaultAdapter.update(headerStructure, oFF.UserProfileDefaultAdapter.HOME_DIR, userProfile.isUnixHomeDirectoryDefault(), userProfile.getUnixHomeDirectory());
				let value = userProfile.getUserEnabled() ? "TRUE" : "FALSE";
