oFF.CoFormulaEditorConfigurationBuilder.create = function()
{
	let instance = new oFF.CoFormulaEditorConfigurationBuilder();
	instance.m_configuration = oFF.PrFactory.createStructure();
	instance.m_featureTogglesStructure = instance.m_configuration.putNewStructure(oFF.CoFormulaEditorConfigurationUtils.FEATURE_TOGGLES);
	return instance;
};
oFF.CoFormulaEditorConfigurationBuilder.prototype.m_configuration = null;
oFF.CoFormulaEditorConfigurationBuilder.prototype.m_featureTogglesStructure = null;
oFF.CoFormulaEditorConfigurationBuilder.prototype.build = function()
{
	return this.m_configuration;
};
oFF.CoFormulaEditorConfigurationBuilder.prototype.setFeatureToggle = function(featureToggleName, value)
{
	this.m_featureTogglesStructure.putBoolean(featureToggleName, value);
};
oFF.CoFormulaEditorConfigurationBuilder.prototype.setFeatureToggles = function(featureToggleNames, value)
{
	let jsonParser = oFF.JsonParserFactory.newInstance();
	let keysJson = jsonParser.convertFromNative(featureToggleNames);
	oFF.XObjectExt.release(jsonParser);
	if (oFF.notNull(keysJson) && keysJson.isList())
	{
		let keyList = keysJson.asList();
		for (let i = 0; i < keyList.size(); i++)
		{
			let key = keyList.getStringAt(i);
			if (oFF.notNull(key))
			{
				this.setFeatureToggle(key, value);
			}
		}
	}
};

oFF.CoFormulaEditorConfigurationUtils = {

	CONFIGURATION_NAME:"FormulaEditorConfiguration",
	FEATURE_TOGGLES:"featureToggles",
	loadFeatureConfiguration:function(process)
	{
			return process.getConfigurationManager().getResolvedConfigurationForName(oFF.CoFormulaEditorConfigurationUtils.CONFIGURATION_NAME).onCatchExt((err) => {
			return oFF.CoConfiguration.create(null, null, process);
		});
	},
	overrideFeatureConfiguration:function(process, overrideConfig)
	{
			return oFF.CoFormulaEditorConfigurationUtils.loadFeatureConfiguration(process).onThenPromise((config) => {
			let newConfigJson = oFF.isNull(config) ? oFF.PrFactory.createStructure() : config.getConfigurationStructure();
			oFF.PrUtils.mergeStructuresExt(newConfigJson, overrideConfig, true);
			return process.getConfigurationManager().writePlatformConfigurationForName(oFF.CoFormulaEditorConfigurationUtils.CONFIGURATION_NAME, newConfigJson);
		});
	},
	resetFeatureConfiguration:function(process)
	{
			return process.getConfigurationManager().writePlatformConfigurationForName(oFF.CoFormulaEditorConfigurationUtils.CONFIGURATION_NAME, oFF.PrFactory.createStructure());
	}
};

