oFF.IcInterceptorTool.prototype.m_isKernelIdEnabled = false;
oFF.IcInterceptorTool.prototype.m_isLogWriterEnabled = false;
oFF.IcInterceptorTool.prototype.m_isProcessEventEnabled = false;
oFF.IcInterceptorTool.prototype.m_isProcessIdEnabled = false;
oFF.IcInterceptorTool.prototype.m_isProfileWriterEnabled = false;
oFF.IcInterceptorTool.prototype.m_isTimestampEnabled = false;
oFF.IcInterceptorTool.prototype.m_isUserActivityEnabled = false;
oFF.IcInterceptorTool.prototype.m_kernel = null;
oFF.IcInterceptorTool.prototype.configureWithCmdLine = function(cmd)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(cmd))
	{
		let parameterBlocks = oFF.XStringTokenizer.splitString(cmd, ";");
		let parameters = oFF.XHashMapByString.create();
		for (let i = 0; i < parameterBlocks.size(); i++)
		{
			let expression = parameterBlocks.get(i);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(expression))
			{
				let index = oFF.XString.indexOf(expression, ":");
				let name;
				let value = null;
				if (index !== -1)
				{
					name = oFF.XString.substring(expression, 0, index);
					value = oFF.XString.substring(expression, index + 1, -1);
				}
				else
				{
					name = expression;
				}
				parameters.put(name, value);
			}
		}
		let modeValue = parameters.getByKey("mode");
		if (oFF.XStringUtils.isNotNullAndNotEmpty(modeValue))
		{
			let modeEntries = oFF.XStringTokenizer.splitString(modeValue, ",");
			if (modeEntries.contains("all"))
			{
				this.enableHttp(true);
				this.enableLogWriter(true);
				this.enableProcessEvent(true);
				this.enableProfileWriter(true);
				this.enableUserActivity(true);
				this.enableKernel(true);
				this.enableCall(true);
			}
			else if (modeEntries.contains("none"))
			{
				this.enableHttp(false);
				this.enableLogWriter(false);
				this.enableProcessEvent(false);
				this.enableProfileWriter(false);
				this.enableUserActivity(false);
				this.enableKernel(false);
				this.enableCall(false);
			}
			else if (modeEntries.contains("default"))
			{
				this.enableHttp(true);
				this.enableProcessEvent(true);
				this.enableProfileWriter(true);
				this.enableUserActivity(true);
			}
			if (modeEntries.contains("http"))
			{
				this.enableHttp(true);
			}
			if (modeEntries.contains("log"))
			{
				this.enableLogWriter(true);
			}
			if (modeEntries.contains("event"))
			{
				this.enableProcessEvent(true);
			}
			if (modeEntries.contains("profile"))
			{
				this.enableProfileWriter(true);
			}
			if (modeEntries.contains("user"))
			{
				this.enableUserActivity(true);
			}
			if (modeEntries.contains("kernel"))
			{
				this.enableKernel(true);
			}
			if (modeEntries.contains("call"))
			{
				this.enableCall(true);
			}
		}
		else
		{
			this.enableHttp(true);
			this.enableProcessEvent(true);
			this.enableProfileWriter(true);
			this.enableUserActivity(true);
		}
		let prefixValue = parameters.getByKey("prefix");
		if (oFF.XStringUtils.isNotNullAndNotEmpty(prefixValue))
		{
			let prefixEntries = oFF.XStringTokenizer.splitString(prefixValue, ",");
			if (prefixEntries.contains("all"))
			{
				this.enablePrefixTime(true);
				this.enablePrefixKernel(true);
				this.enablePrefixProcessId(true);
			}
			else if (prefixEntries.contains("none"))
			{
				this.enablePrefixTime(false);
				this.enablePrefixKernel(false);
				this.enablePrefixProcessId(false);
			}
			else if (prefixEntries.contains("default"))
			{
				this.enablePrefixTime(true);
				this.enablePrefixProcessId(true);
			}
			if (prefixEntries.contains("time"))
			{
				this.enablePrefixTime(true);
			}
			if (prefixEntries.contains("kernel"))
			{
				this.enablePrefixKernel(true);
			}
			if (prefixEntries.contains("processid"))
			{
				this.enablePrefixProcessId(true);
			}
		}
		else
		{
			this.enablePrefixTime(true);
			this.enablePrefixProcessId(true);
		}
	}
};
