oFF.IcInterceptorTool.prototype.print = function(kernel, session, name, output)
{
	let buffer = oFF.XStringBuffer.create();
	buffer.append("(\u2022\u0300\u1D17\u2022\u0301)");
	if (this.m_isTimestampEnabled)
	{
		buffer.append("[");
		let localTime = oFF.XTime.createLocalTime();
		buffer.append(localTime.toIsoFormat());
		buffer.append("]");
	}
	if (this.m_isKernelIdEnabled)
	{
		buffer.append("[kernelid]");
	}
	if (oFF.notNull(session) && session.isProcess() && this.m_isProcessIdEnabled)
	{
		let process = session;
		buffer.append("[");
		buffer.append(process.getProcessId());
		buffer.append("]");
	}
	buffer.append("[");
	buffer.append(name);
	buffer.append("] ");
	buffer.append(output);
	let toDisplay = buffer.toString();
	let stdioContext = this.m_kernel.getStdioContext();
	let stdout = stdioContext.getStdout();
	stdout.println(toDisplay);
};
