{
	return this.getTextWithPlaceholders(key, null);
};
oFF.DfXLocalizationProvider.prototype.getTextOrNull = function(key, replacementList)
{
	let text = null;
	if (this.isProductive() && oFF.XLocalizationCenter.getExternalAdapter() !== null)
	{
		let isWithPlaceholder = false;
		if (oFF.notNull(replacementList))
		{
			for (let i = 0; i < replacementList.size(); i++)
			{
				let replacement = replacementList.get(i);
				if (oFF.XStringUtils.isNotNullAndNotEmpty(replacement))
				{
					isWithPlaceholder = true;
				}
			}
		}
		if (isWithPlaceholder)
		{
			text = oFF.XLocalizationCenter.getExternalAdapter().getTextWithPlaceholders(key, replacementList);
		}
		else
		{
			text = oFF.XLocalizationCenter.getExternalAdapter().getText(key);
		}
	}
	let commons = oFF.XLocalizationCenter.getCenter().getCommonsProviders();
	for (let i = 0; i < commons.size() && oFF.isNull(text); i++)
	{
		text = commons.get(i).getRawLocalizationTexts().getByKey(key);
	}
	return oFF.isNull(text) ? this.m_localizationTexts.getByKey(key) : text;
};
oFF.DfXLocalizationProvider.prototype.getTextWithPlaceholder = function(key, replacement)
{
	let replacementList = oFF.XList.create();
	replacementList.add(replacement);
	return this.getTextWithPlaceholders(key, replacementList);
};
oFF.DfXLocalizationProvider.prototype.getTextWithPlaceholder2 = function(key, replacement1, replacement2)
{
	let replacementList = oFF.XList.create();
	replacementList.add(replacement1);
	replacementList.add(replacement2);
	return this.getTextWithPlaceholders(key, replacementList);
};
oFF.DfXLocalizationProvider.prototype.getTextWithPlaceholders = function(key, replacementList)
{
	let text = this.getTextOrNull(key, replacementList);
	if (oFF.isNull(text))
	{
		return key;
	}
	if (oFF.notNull(replacementList))
	{
		for (let i = 0; i < replacementList.size(); i++)
		{
			let placeholder = oFF.XStringUtils.concatenate3("{", oFF.XInteger.convertToString(i), "}");
			let replacement = replacementList.get(i);
			if (oFF.notNull(replacement) && oFF.XString.containsString(text, placeholder))
			{
				text = oFF.XString.replace(text, placeholder, replacement);
			}
		}
	}
	return text;
};
oFF.DfXLocalizationProvider.prototype.getTranslatedMap = function()
{
	if (oFF.XLocalizationCenter.getExternalAdapter() !== null)
	{
		let localizedMap = oFF.XHashMapByString.create();
		oFF.XCollectionUtils.forEach(this.getLocalizationKeys(), (key) => {
			localizedMap.put(key, this.getText(key));
		});
		return localizedMap;
	}
	return this.getRawLocalizationTexts();
};
oFF.DfXLocalizationProvider.prototype.isProductive = function()
{
	return this.m_isProductive;
};
oFF.DfXLocalizationProvider.prototype.releaseObject = function()
{
	this.m_localizationTexts = oFF.XObjectExt.release(this.m_localizationTexts);
	this.m_localizationComments = oFF.XObjectExt.release(this.m_localizationComments);
	oFF.XObject.prototype.releaseObject.call( this );
};
