oFF.ResourceDef.prototype.getLoadStatus = function()
{
	if (this.m_loadStatus === oFF.ResourceStatus.INITIAL || this.m_loadStatus === oFF.ResourceStatus.LOADING)
	{
		if (this.m_type === oFF.ResourceType.CONTAINER)
		{
			let allContainerResources = this.getAllContainerResources();
			let isLoaded = true;
			for (let i = 0; i < allContainerResources.size(); i++)
			{
				let def = allContainerResources.get(i);
				let name = def.getName();
				let moduleDef = oFF.ModuleManager.getModuleDef(name);
				let refLoadStatus = moduleDef.getLoadStatus();
				if (refLoadStatus !== oFF.ResourceStatus.SUCCESS)
				{
					isLoaded = false;
				}
			}
			if (isLoaded === true)
			{
				this.m_loadStatus = oFF.ResourceStatus.SUCCESS;
			}
		}
		else
		{
			let loadedModuleNames = oFF.DfModule.getLoadedModuleNames();
			let moduleList = oFF.XStringTokenizer.splitString(loadedModuleNames, ",");
			let myName = this.getName();
			if (moduleList.contains(myName) === true)
			{
				this.m_loadStatus = oFF.ResourceStatus.SUCCESS;
			}
		}
	}
	return this.m_loadStatus;
};
