oFF.SystemConnect.prototype.updateConnectionWithServerMetadata = function(connection)
{
	if (oFF.notNull(this.m_serverMetadata))
	{
		connection.setReentranceTicket(this.m_serverMetadata.getReentranceTicket());
		let inaMetadata = this.m_serverMetadata.getMetadataForService(oFF.ServerService.INA);
		if (oFF.notNull(inaMetadata))
		{
			let batchCapability = inaMetadata.getByKey(oFF.ConnectionConstants.INA_CAPABILITY_SUPPORTS_BATCH);
			if (oFF.notNull(batchCapability))
			{
				let analyticsMetadata = this.m_serverMetadata.getMetadataForService(oFF.ServerService.ANALYTIC);
				let batchRsStreaming = oFF.notNull(analyticsMetadata) && analyticsMetadata.containsKey(oFF.ConnectionConstants.INA_CAPABILITY_SUPPORTS_BATCH_RS_STREAMING);
				connection.setSupportsBatchMode(true, batchRsStreaming, batchCapability.getValue());
				let xxlWSCapability = oFF.isNull(analyticsMetadata) ? null : analyticsMetadata.getByKey(oFF.ConnectionConstants.INA_FASTPATH_XXL_WS);
				if (oFF.notNull(xxlWSCapability))
				{
					connection.setWebServicePathForBLOBs(xxlWSCapability.getValue());
				}
			}
		}
		let session = this.getConnectionPoolBase().getProcess();
		let personalizationForSystem = session.getUserManager().getConnectionPersonalization(connection.getSystemName());
		personalizationForSystem.setTenantId(this.m_serverMetadata.getTenantId());
		personalizationForSystem.setInternalUser(this.m_serverMetadata.getOrcaUserName());
	}
};

