	metadata.addOption(oFF.DfProgram.PARAM_CONFIG_FILE, "The configuration file to be used", "A path to the configuration file", oFF.XValueType.STRING);
	metadata.addOption(oFF.DfProgram.PARAM_CONFIG_LAYER, "The configuration layer to be used", "User|Admin|Platform", oFF.XValueType.STRING);
	metadata.addOption(oFF.DfProgram.PARAM_RUN_BELOW_PROCESS, "The id of the process to use as a parent of this program", "...", oFF.XValueType.STRING);
