oFF.DfProgram.prototype._getProgramStorageDirCreateIfNeeded = function()
{
	if (oFF.isNull(this.m_programStorageDirPromise) && this.getProcess() !== null)
	{
		let storageDirPath = this.getProcess().getEnvironment().getStringByKey(oFF.XEnvironmentConstants.FIREFLY_PROGRAM_STORAGE_DIR);
		if (oFF.XStringUtils.isNullOrEmpty(storageDirPath))
		{
			storageDirPath = oFF.DfProgram.DEFAULT_PROGRAM_STORAGE_DIR;
		}
		if (!oFF.XString.endsWith(storageDirPath, "/"))
		{
			storageDirPath = oFF.XStringUtils.concatenate2(storageDirPath, "/");
		}
		storageDirPath = oFF.XStringUtils.concatenate2(storageDirPath, this.getProgramName());
		let programStorageDirFile = oFF.XFile.create(this.getProcess(), storageDirPath);
		this.m_programStorageDirPromise = oFF.XFilePromise.isExisting(programStorageDirFile).onThenPromise((isExisting) => {
			if (isExisting.getBoolean())
			{
				return oFF.XPromise.resolve(programStorageDirFile);
			}
			else
			{
				return oFF.XFilePromise.mkdir(programStorageDirFile, true);
			}
		});
	}
	return this.m_programStorageDirPromise;
};
