oFF.DfProgram.prototype._prepareConfiguration = function()
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_argConfig))
	{
		let tmpElement = oFF.PrUtils.deserialize(this.m_argConfig);
		let parsedJson = null;
		if (oFF.notNull(tmpElement) && tmpElement.isStructure())
		{
			parsedJson = tmpElement.asStructure();
		}
		return oFF.XPromise.resolve(oFF.CoConfigurationUtils.createConfiguration(this._getProgramManifest(), parsedJson, this.getProcess()));
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_argConfigFile))
	{
		return oFF.CoConfigurationUtils.getConfigurationFromFile(this._getProgramManifest(), oFF.XFile.create(this.getProcess(), this.m_argConfigFile));
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_argConfigLayer))
	{
		let tmpLayer = oFF.CoConfigurationLayer.lookup(this.m_argConfigLayer);
		if (oFF.notNull(tmpLayer) && this._getProgramManifest() !== null && this._getProgramManifest().hasConfigurationMetadata())
		{
			let manifest = this._getProgramManifest();
			let tmpMetadata = oFF.CoConfigurationUtils.mapMetadataPropertiesFromParentProcesses(manifest.getName(), manifest.getConfigurationMetadata(), this.getProcess());
			return oFF.CoConfigurationUtils.getConfigurationForLayer(this.getProcess(), tmpMetadata, tmpLayer);
		}
	}
	return oFF.CoConfigurationUtils.getResolvedConfigurationForProvider(this.getProcess(), this._getProgramManifest()).onThenExt((config) => {
		return config;
	});
};
oFF.DfProgram.prototype._prepareDefaultArguments = function()
{
	let session = this.getSession();
	if (oFF.isNull(session))
	{
		throw oFF.XException.createIllegalStateException("No session given at startup time");
	}
	let prgArgs = this.getArguments();
	let argumentDefinitions = prgArgs.getArgumentDefinitions();
	for (let i = 0; i < argumentDefinitions.size(); i++)
	{
		let argDef = argumentDefinitions.get(i);
		if (argDef.isMandatory())
		{
			if (prgArgs.containsKey(argDef.getName()) === false)
			{
				this.println(oFF.XStringUtils.concatenate2("Argument not given: ", argDef.getName()));
				this.setShowHelp(true);
			}
			else if (prgArgs.hasNullByKey(argDef.getName()))
			{
				this.println(oFF.XStringUtils.concatenate4("Argument \"", argDef.getName(), "\" should have one of these values: ", argDef.getPossibleValues()));
				this.setShowHelp(true);
			}
		}
	}
	let syncParam = prgArgs.getStringByKeyExt(oFF.DfProgram.PARAM_SYNC_TYPE, null);
	if (oFF.notNull(syncParam))
	{
		if (oFF.XString.isEqual(syncParam, oFF.DfProgram.PARAM_VALUE_BLOCKING))
		{
			session.setDefaultSyncType(oFF.SyncType.BLOCKING);
		}
		else
		{
			session.setDefaultSyncType(oFF.SyncType.NON_BLOCKING);
		}
	}
	let logLevel = prgArgs.getIntegerByKeyExt(oFF.DfProgram.PARAM_LOG_LEVEL, -1);
	if (logLevel !== -1)
	{
		let logWriterWithFilter = session.getLogWriterBase();
		logWriterWithFilter.setLogFilterLevel(logLevel);
	}
	let logLayerName = prgArgs.getStringByKeyExt(oFF.DfProgram.PARAM_LOG_LAYER, null);
	if (oFF.notNull(logLayerName))
	{
		let logWriterWithFilter2 = session.getLogWriterBase();
		logWriterWithFilter2.addLogLayer(logLayerName);
	}
	let xVersionValue = prgArgs.getIntegerByKeyExt(oFF.DfProgram.PARAM_XVERSION, -3);
	if (xVersionValue !== -3)
	{
		session.setXVersion(xVersionValue);
	}
	let features = prgArgs.getStringByKey(oFF.DfProgram.PARAM_FEATURES);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(features))
	{
		let featureValues = oFF.XStringTokenizer.splitString(features, ",");
		for (let k = 0; k < featureValues.size(); k++)
		{
			let featureToggle = oFF.FeatureToggle.lookup(featureValues.get(k));
			if (oFF.notNull(featureToggle))
			{
				session.activateFeatureToggle(featureToggle);
			}
		}
	}
	this.setShowHelp(prgArgs.getBooleanByKeyExt(oFF.DfProgram.PARAM_SHOW_HELP, this.m_showHelp));
	let initialSystemTypeValue = prgArgs.getStringByKey(oFF.DfProgram.PARAM_INITIAL_SYS_TYPE);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(initialSystemTypeValue))
	{
		let initialSystemType = oFF.SystemType.lookup(initialSystemTypeValue);
		this.setInitialSystemType(initialSystemType);
	}
	this.m_argConfig = prgArgs.getStringByKey(oFF.DfProgram.PARAM_CONFIG);
	this.m_argConfigFile = prgArgs.getStringByKey(oFF.DfProgram.PARAM_CONFIG_FILE);
	this.m_argConfigLayer = prgArgs.getStringByKey(oFF.DfProgram.PARAM_CONFIG_LAYER);
};
oFF.DfProgram.prototype._registerGlobalNotificationObservers = function()
{
	if (this.getProcess() !== null)
	{
		this.m_configChangedNotificationObserverUuid = this.getProcess().getNotificationCenter().addObserverForName(oFF.CoConfigurationConstants.NOTIFICATION_CONFIGURATION_CHANGED, (payload) => {
			let configurationName = payload.getStringByKey(oFF.CoConfigurationConstants.NOTIFICATION_DATA_CONFIGURATION_NAME);
			if (oFF.XString.isEqual(configurationName, this.getProgramName()))
			{
				this._reloadConfiguration();
			}
		});
	}
};
oFF.DfProgram.prototype._reloadConfiguration = function()
{
	return this._prepareConfiguration().onThenPromise((config) => {
		this.m_configuration = oFF.CoConfigurationUtils.mapConfigurationPropertiesFromParentProcesses(config, this.getProcess());
		this.resolveMappedProperties();
		this.writeBackArgumentsToConfig();
		return this._applyConfigLookupProcessEntity();
	}).onFinally(() => {
		this.onConfigurationChanged(this.getConfiguration());
	});
};
oFF.DfProgram.prototype._startProcessInternal = function()
{
	let setupProcessPromise = this.setupProcess();
	if (oFF.isNull(setupProcessPromise))
	{
		this.runProcess();
		return oFF.XPromise.resolve(oFF.XBooleanValue.create(true));
	}
	setupProcessPromise = setupProcessPromise.onThen((boolVal) => {
		if (!this.isReleased() && (oFF.isNull(boolVal) || boolVal.getBoolean()))
		{
			this.runProcess();
		}
		else
		{
			this.logWarning3("The ", this.getProgramName(), " program execution was explicitly cancelled!");
			this.kill();
		}
	});
	setupProcessPromise.onCatch((error) => {
		oFF.XLogger.printError(oFF.XStringUtils.concatenate2("Program startup failed! Error during process setup: ", error.getText()));
		this.kill();
	});
	return setupProcessPromise;
};
oFF.DfProgram.prototype._terminateProgramInternal = function(code, kill)
{
	let process = this.getProcess();
	if (oFF.notNull(process))
	{
		this._appendExitCodeInExitDataIfNeccessary(code);
		let processId = process.getProcessId();
		let kernel = process.getKernel();
		kernel.processTerminateProcess(null, null, null, processId, code, kill);
	}
};
oFF.DfProgram.prototype._unregisterConfigLookupProcessEntity = function()
{
	if (oFF.notNull(this.m_process))
	{
		this.m_process.setEntity(oFF.ProcessEntity.CONFIGURATION_MAPPING, null);
	}
};
oFF.DfProgram.prototype.addParametersForConfigOverwrite = function(metadata)
{
	let manifest = this._getProgramManifest();
	let configMetadataRaw = oFF.isNull(manifest) ? null : oFF.CoConfigurationUtils.mapMetadataPropertiesFromParentProcesses(manifest.getName(), manifest.getConfigurationMetadata(), this.getProcess());
	let configMetadata = oFF.isNull(configMetadataRaw) ? null : configMetadataRaw.getAllProperties();
	if (oFF.notNull(configMetadata))
	{
		let argDefinitions = metadata.getArgDefinitions();
		oFF.XCollectionUtils.forEach(configMetadata.getKeysAsReadOnlyList(), (key) => {
			let argument = configMetadata.getByKey(key);
			if (!argDefinitions.containsKey(key))
			{
				let type = argument.getType();
				let valueType = oFF.XValueType.STRING;
				if (type === oFF.CoDataType.BOOLEAN)
				{
					valueType = oFF.XValueType.BOOLEAN;
				}
				else if (type === oFF.CoDataType.INTEGER)
				{
					valueType = oFF.XValueType.INTEGER;
				}
				else if (type === oFF.CoDataType.NUMBER)
				{
					valueType = oFF.XValueType.NUMBER;
				}
				else if (type === oFF.CoDataType.ARRAY)
				{
					valueType = oFF.XValueType.ARRAY;
				}
				else if (type === oFF.CoDataType.OBJECT)
				{
					valueType = oFF.XValueType.OBJECT;
				}
				let choices = oFF.XStream.of(argument.getChoices()).collect(oFF.XStreamCollector.toListOfString((el) => {
					return oFF.XValueUtil.getString(el.copyAsPrimitiveXValue());
				}));
				let choicesString = oFF.XCollectionUtils.join(choices, "|");
				let text = argument.getDescription();
				metadata.addOption(key, text, choicesString, valueType);
			}
		});
	}
};
