oFF.DfProgram.prototype.updateFileParam = function(file)
{
	let prgArgs = this.getArguments();
	if (oFF.notNull(file))
	{
		let filePath = file.getUri().getPath();
		prgArgs.putString(oFF.DfProgram.PARAM_FILE, filePath);
	}
	else
	{
		prgArgs.remove(oFF.DfProgram.PARAM_FILE);
	}
	this.getProcess().notifyProcessEvent(oFF.ProcessEventType.START_CFG_CHANGED);
};
oFF.DfProgram.prototype.writeBackArgumentsToConfig = function()
{
	let argStructure = this.getArgumentStructure();
	let configurationStructure = oFF.isNull(this.m_configuration) ? null : this.m_configuration.getConfigurationStructure();
	if (oFF.XCollectionUtils.hasElements(argStructure) && oFF.notNull(configurationStructure))
	{
		oFF.XCollectionUtils.forEach(argStructure.getKeysAsReadOnlyList(), (key) => {
			let propMetadata = this.m_configuration.getPropertyMetadataByName(key);
			let value = argStructure.getByKey(key);
			if (oFF.notNull(propMetadata) && propMetadata.validate(value).isEmpty())
			{
				configurationStructure.put(key, value);
			}
		});
		let allProperties = this.m_configuration.getAllProperties();
		let missingProperties = oFF.isNull(allProperties) ? null : oFF.XStream.ofString(allProperties.getKeysAsReadOnlyList()).filter((name) => {
			return allProperties.getByKey(name.getString()).isRequired() && !configurationStructure.containsKey(name.getString());
		}).collect(oFF.XStreamCollector.toListOfString((el) => {
			return el.getString();
		}));
		if (oFF.XCollectionUtils.hasElements(missingProperties))
		{
			this.println(oFF.XStringUtils.concatenate2("Mandatory arguments/config properties not given: ", oFF.XCollectionUtils.join(missingProperties, ", ")));
			this.setShowHelp(true);
		}
	}
};

