oFF.CoIntegerProperty.prototype.m_minimum = 0;
oFF.CoIntegerProperty.prototype.m_multipleOf = 0;
oFF.CoIntegerProperty.prototype._validateExclusiveRange = function(intVal, errorList)
{
	let valueOutOfRangeError = null;
	if (this.m_hasExclusiveMinimumSet && this.m_hasExclusiveMaximumSet)
	{
		if (intVal <= this.m_exclusiveMinimum || intVal >= this.m_exclusiveMaximum)
		{
			valueOutOfRangeError = oFF.XError.create(oFF.XStringUtils.concatenate4("Value out of range! Exclusive Min: ", oFF.XInteger.convertToString(this.m_exclusiveMinimum), " Exclusive Max: ", oFF.XInteger.convertToString(this.m_exclusiveMaximum)));
		}
	}
	else if (this.m_hasExclusiveMinimumSet)
	{
		if (intVal <= this.m_exclusiveMinimum)
		{
			valueOutOfRangeError = oFF.XError.create(oFF.XStringUtils.concatenate2("Value out of range! Exclusive Min: ", oFF.XInteger.convertToString(this.m_exclusiveMinimum)));
		}
	}
	else if (this.m_hasExclusiveMaximumSet)
	{
		if (intVal >= this.m_exclusiveMaximum)
		{
			valueOutOfRangeError = oFF.XError.create(oFF.XStringUtils.concatenate2("Value out of range! Exclusive Max: ", oFF.XInteger.convertToString(this.m_exclusiveMaximum)));
		}
	}
	if (oFF.notNull(valueOutOfRangeError))
	{
		valueOutOfRangeError.setErrorType(oFF.CoPropertyValidationErrorType.VALUE_OUT_OF_RANGE);
		errorList.add(valueOutOfRangeError);
	}
};
oFF.CoIntegerProperty.prototype._validateMultipleOf = function(intVal, errorList)
{
	if (this.m_multipleOf >= 0)
	{
		if (oFF.XMath.mod(intVal, this.m_multipleOf) !== 0)
		{
			errorList.add(oFF.XError.create(oFF.XStringUtils.concatenate2("Value is not a multiple of ", oFF.XInteger.convertToString(this.m_multipleOf))).setErrorType(oFF.CoPropertyValidationErrorType.VALUE_NOT_MULTIPLE_OF));
		}
	}
};
oFF.CoIntegerProperty.prototype._validateRange = function(intVal, errorList)
{
	let valueOutOfRangeError = null;
	if (this.m_hasMinimumSet && this.m_hasMaximumSet)
	{
		if (intVal < this.m_minimum || intVal > this.m_maximum)
		{
			valueOutOfRangeError = oFF.XError.create(oFF.XStringUtils.concatenate4("Value out of range! Min: ", oFF.XInteger.convertToString(this.m_minimum), " Max: ", oFF.XInteger.convertToString(this.m_maximum)));
		}
	}
	else if (this.m_hasMinimumSet)
	{
		if (intVal < this.m_minimum)
		{
			valueOutOfRangeError = oFF.XError.create(oFF.XStringUtils.concatenate2("Value out of range! Min: ", oFF.XInteger.convertToString(this.m_minimum)));
		}
	}
	else if (this.m_hasMaximumSet)
	{
		if (intVal > this.m_maximum)
		{
			valueOutOfRangeError = oFF.XError.create(oFF.XStringUtils.concatenate2("Value out of range! Max: ", oFF.XInteger.convertToString(this.m_maximum)));
		}
	}
	if (oFF.notNull(valueOutOfRangeError))
	{
		valueOutOfRangeError.setErrorType(oFF.CoPropertyValidationErrorType.VALUE_OUT_OF_RANGE);
		errorList.add(valueOutOfRangeError);
	}
};
