	oFF.DfCoProperty.prototype.copyFrom.call( this , other, flags);
	let orig = other;
	this.m_minimum = orig.getMinimum();
	this.m_maximum = orig.getMaximum();
	this.m_exclusiveMinimum = orig.getExclusiveMinimum();
	this.m_exclusiveMaximum = orig.getExclusiveMaximum();
	this.m_multipleOf = orig.getMultipleOf();
	this.m_hasMinimumSet = orig.m_hasMinimumSet;
	this.m_hasMaximumSet = orig.m_hasMaximumSet;
