{
	this.m_hasMinimumSet = propertyMetadataStructure.containsKey(oFF.CoPropertyMetadataConstants.MINIMUM_KEY);
	this.m_minimum = propertyMetadataStructure.getIntegerByKeyExt(oFF.CoPropertyMetadataConstants.MINIMUM_KEY, this.m_minimum);
	this.m_hasMaximumSet = propertyMetadataStructure.containsKey(oFF.CoPropertyMetadataConstants.MAXIMUM_KEY);
	this.m_maximum = propertyMetadataStructure.getIntegerByKeyExt(oFF.CoPropertyMetadataConstants.MAXIMUM_KEY, this.m_maximum);
	this.m_hasExclusiveMinimumSet = propertyMetadataStructure.containsKey(oFF.CoPropertyMetadataConstants.EXCLUSIVE_MINIMUM_KEY);
	this.m_exclusiveMinimum = propertyMetadataStructure.getIntegerByKeyExt(oFF.CoPropertyMetadataConstants.EXCLUSIVE_MINIMUM_KEY, this.m_exclusiveMinimum);
	this.m_hasExclusiveMaximumSet = propertyMetadataStructure.containsKey(oFF.CoPropertyMetadataConstants.EXCLUSIVE_MAXIMUM_KEY);
	this.m_exclusiveMaximum = propertyMetadataStructure.getIntegerByKeyExt(oFF.CoPropertyMetadataConstants.EXCLUSIVE_MAXIMUM_KEY, this.m_exclusiveMaximum);
	this.m_multipleOf = propertyMetadataStructure.getIntegerByKeyExt(oFF.CoPropertyMetadataConstants.MULTIPLE_OF_KEY, this.m_multipleOf);
};
