	{
		vfs.addDirectory("/etc", this._prepareFileMetadata("etc", "Configuration Files", "r-x"));
		vfs.addDirectory("/home", this._prepareFileMetadata("home", "User Home Directories", "rwx"));
		vfs.addDirectory("/prg", this._prepareFileMetadata("prg", "System Programs", "r-x"));
		vfs.addDirectory("/sdk", this._prepareFileMetadata("sdk", "Firefly SDK", "rwx"));
		vfs.addDirectory("/sys", this._prepareFileMetadata("sys", "System Folder", "r-x"));
		vfs.addDirectory("/tmp", this._prepareFileMetadata("tmp", "Temporary Files", "rwx"));
		vfs.addDirectory("/var", this._prepareFileMetadata("var", "Variable Data Files", "rwx"));
		vfs.addDirectory(oFF.KernelConstants.DEFAULT_WIDGET_VFS_LOCATION, this._prepareFileMetadata("widgets", "Widgets Folder", "rwx"));
	}
