oFF.Kernel.prototype._prepareFileMetadata = function(name, description, permissionsStr)
{
	let tmpPermStr = permissionsStr;
	if (oFF.XStringUtils.isNullOrEmpty(tmpPermStr))
	{
		tmpPermStr = "rwx";
	}
	let canRead = oFF.XFileUtils.hasReadPermission(tmpPermStr);
	let canWrite = oFF.XFileUtils.hasWritePermission(tmpPermStr);
	let canExecute = oFF.XFileUtils.hasExecutePermission(tmpPermStr);
	let fileMetadata = oFF.PrFactory.createStructure();
	fileMetadata.putStringNotNullAndNotEmpty(oFF.XFileAttribute.NAME, name);
	fileMetadata.putStringNotNullAndNotEmpty(oFF.XFileAttribute.DISPLAY_NAME, name);
	fileMetadata.putStringNotNullAndNotEmpty(oFF.XFileAttribute.DESCRIPTION, description);
	fileMetadata.putBoolean(oFF.XFileAttribute.IS_EXISTING, true);
	fileMetadata.putBoolean(oFF.XFileAttribute.IS_HIDDEN, false);
	fileMetadata.putBoolean(oFF.XFileAttribute.IS_READABLE, canRead);
	fileMetadata.putBoolean(oFF.XFileAttribute.IS_WRITEABLE, canWrite);
	fileMetadata.putBoolean(oFF.XFileAttribute.IS_EXECUTABLE, canExecute);
	return fileMetadata;
};
oFF.Kernel.prototype._processMountPoint = function(mountExpression)
{
	let fileSystemManager = this.m_kernelProcess.getFileSystemManager();
	let vfs = fileSystemManager.getFileSystem(oFF.ProtocolType.VFS);
	let success = false;
	let index = oFF.XString.indexOf(mountExpression, ":");
	if (index !== -1)
	{
		let mountPath = oFF.XString.substring(mountExpression, 0, index);
		if (oFF.XString.startsWith(mountPath, oFF.XFile.SLASH) === false)
		{
			this.logError2("Mounting vfs. Not a valid path expression: ", mountPath);
		}
		else
		{
			let mountFsUrl = oFF.XString.substring(mountExpression, index + 1, -1);
			let mountFsUri = oFF.XUri.createFromFilePath(this.m_kernelProcess, mountFsUrl, oFF.PathFormat.AUTO_DETECT, oFF.VarResolveMode.DOLLAR, oFF.ProtocolType.FILE);
			if (mountFsUri.getProtocolType() === null)
			{
				this.logExt(this.getLogLayer(), oFF.Severity.INFO, 0, oFF.XStringUtils.concatenate4("Mounting vfs. Not (yet) a valid url expression: ", mountFsUrl, " ==> ", mountFsUri.toString()));
			}
			else
			{
				try
				{
					vfs.addMountPointByUri(mountPath, mountFsUri);
				}
				catch (e)
				{
					this.logExt(this.getLogLayer(), oFF.Severity.ERROR, 0, "Error adding mount point");
				}
				success = true;
			}
		}
	}
	else
	{
		this.logError2("Mounting vfs. Not a valid expression, missing ':' : ", mountExpression);
	}
	return success;
};
oFF.Kernel.prototype._processPlatformFiles = function()
{
	if (this._isVfsEnabled())
	{
		let sdkDir = oFF.XFile.createFromEnvVar(this.m_kernelProcess, oFF.XEnvironmentConstants.FIREFLY_SDK, null);
		let environment = this.m_kernelProcess.getEnvironment();
		return oFF.KernelPlatformUtils.processPlatformExportFile(sdkDir, environment).onThenPromise((res) => {
			this.log("Done processing export file!");
			return oFF.KernelPlatformUtils.loadPlatformMountFile(sdkDir, environment).onThenPromise((mountExpList) => {
				this.log("Done processing mount file!");
				oFF.XCollectionUtils.forEach(mountExpList, (mountExp) => {
					this._processMountPoint(mountExp);
				});
				return oFF.KernelPlatformUtils.loadPlatformManifests(this.m_kernelProcess).onThenPromise((res2) => {
					this.log("Finished processing program and generic configuration manifests!");
					return oFF.KernelPlatformUtils.preloadConfigurations(this.m_kernelProcess).onThen((res3) => {
						this.log("Finished preloading configurations!");
					});
				});
			});
		});
	}
	return oFF.XPromise.resolve(oFF.XBooleanValue.create(false));
};
