oFF.Kernel.prototype.getAllSubSystemSelectors = function(type)
{
	let selectors = oFF.XList.create();
	let allManifests = oFF.ProgramRegistry.getOrderedAllEntries();
	let prefix = oFF.XStringUtils.concatenate3(oFF.ProgramRegistry.SUBSYS_PREFIX, type.getName(), ".");
	let index = oFF.XString.size(prefix);
	for (let i = 0; i < allManifests.size(); i++)
	{
		let currentManifest = allManifests.get(i);
		let name = currentManifest.getName();
		if (oFF.XString.startsWith(name, prefix))
		{
			let selectorName = oFF.XString.substring(name, index, -1);
			selectors.add(selectorName);
		}
	}
	return selectors;
};
oFF.Kernel.prototype.getAllSubSystemTypes = function()
{
	let types = oFF.XListOfNameObject.create();
	let allManifests = oFF.ProgramRegistry.getOrderedAllEntries();
	let index = oFF.XString.size(oFF.ProgramRegistry.SUBSYS_PREFIX);
	for (let i = 0; i < allManifests.size(); i++)
	{
		let currentManifest = allManifests.get(i);
		let name = currentManifest.getName();
		if (oFF.XString.startsWith(name, oFF.ProgramRegistry.SUBSYS_PREFIX))
		{
			let subsystemName = oFF.XString.substring(name, index, -1);
			if (oFF.XString.containsString(subsystemName, "."))
			{
				let delimiter = oFF.XString.indexOf(subsystemName, ".");
				subsystemName = oFF.XString.substring(subsystemName, 0, delimiter);
			}
			let type = oFF.SubSystemType.lookup(subsystemName);
			if (oFF.notNull(type))
			{
				types.add(type);
			}
		}
	}
	return types;
};
