oFF.Kernel.prototype.isExecutable = function(manifest)
{
	let run = true;
	let prgProfiles = manifest.getProfiles();
	if (oFF.notNull(prgProfiles) && prgProfiles.size() > 0)
	{
		run = false;
		let prgProfileValues = prgProfiles.getValuesAsReadOnlyList();
		let environment = this.getSession().getEnvironment();
		let sysProfiles = environment.getStringByKey(oFF.XEnvironmentConstants.FIREFLY_PROFILES);
		let sysProfileList = oFF.XStringTokenizer.splitString(sysProfiles, ",");
		let magicName = oFF.XStringUtils.concatenate2("~", manifest.getName());
		if (sysProfileList.contains(oFF.XEnvironmentConstants.FIREFLY_PROFILE_DEV) === true || sysProfileList.contains(magicName))
		{
			run = true;
		}
		else
		{
			for (let i = 0; i < prgProfileValues.size(); i++)
			{
				let value = prgProfileValues.get(i);
				if (oFF.XString.isEqual(value, "*") || sysProfileList.contains(value))
				{
					run = true;
					break;
				}
			}
		}
	}
	return run;
};
