oFF.Kernel.prototype.prepareEnvVariables = function(envExtParameters)
{
	let env = oFF.MicroKernel.prototype.prepareEnvVariables.call( this , envExtParameters);
	let sdkVar = env.getVariable(oFF.XEnvironmentConstants.FIREFLY_SDK);
	if (oFF.notNull(sdkVar))
	{
		let production = oFF.XStringUtils.concatenate3("${", oFF.XEnvironmentConstants.FIREFLY_SDK, "}production/");
		let tempPath = env.getVariable(oFF.XEnvironmentConstants.FIREFLY_TMP);
		if (oFF.isNull(tempPath))
		{
			tempPath = oFF.XStringUtils.concatenate2(production, "tmp/");
			env.setVariable(oFF.XEnvironmentConstants.FIREFLY_TMP, tempPath);
		}
		let cachePath = env.getVariable(oFF.XEnvironmentConstants.FIREFLY_CACHE);
		if (oFF.isNull(cachePath) && oFF.notNull(tempPath))
		{
			cachePath = oFF.XStringUtils.concatenate3("${", oFF.XEnvironmentConstants.FIREFLY_TMP, "}cache/");
			env.setVariable(oFF.XEnvironmentConstants.FIREFLY_CACHE, cachePath);
		}
		let resourcesPath = env.getVariable(oFF.XEnvironmentConstants.FIREFLY_RESOURCES);
		if (oFF.isNull(resourcesPath))
		{
			resourcesPath = oFF.XStringUtils.concatenate2(production, "resources/");
			env.setVariable(oFF.XEnvironmentConstants.FIREFLY_RESOURCES, resourcesPath);
		}
		let mimesPath = env.getVariable(oFF.XEnvironmentConstants.FIREFLY_MIMES);
		if (oFF.isNull(mimesPath))
		{
			mimesPath = oFF.XStringUtils.concatenate2(production, "resources/");
			env.setVariable(oFF.XEnvironmentConstants.FIREFLY_MIMES, mimesPath);
		}
		let userProfile = env.getVariable(oFF.XEnvironmentConstants.FIREFLY_USER_PROFILE);
		if (oFF.isNull(userProfile))
		{
			userProfile = oFF.XStringUtils.concatenate2(production, "user/userprofile.json");
			env.setVariable(oFF.XEnvironmentConstants.FIREFLY_USER_PROFILE, userProfile);
		}
		let systemLandscape = env.getVariable(oFF.XEnvironmentConstants.SYSTEM_LANDSCAPE_URI);
		if (oFF.isNull(systemLandscape))
		{
			systemLandscape = oFF.XStringUtils.concatenate2(production, "systems/SystemLandscapeAllWithPwds.json");
			env.setVariable(oFF.XEnvironmentConstants.SYSTEM_LANDSCAPE_URI, systemLandscape);
		}
		if (!env.hasVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_VFS_MOUNT_FILE))
		{
			env.setVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_VFS_MOUNT_FILE, "/production/platform/mount");
		}
		if (!env.hasVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_EXPORT_FILE))
		{
			env.setVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_EXPORT_FILE, "/production/platform/export");
		}
	}
	if (!env.hasVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_CFG_DIR))
	{
		env.setVariable(oFF.XEnvironmentConstants.FIREFLY_PLATFORM_CFG_DIR, oFF.CoConfigurationLayer.PLATFORM.getDefaultConfigDirPath());
	}
	if (!env.hasVariable(oFF.XEnvironmentConstants.FIREFLY_ADMIN_CFG_DIR))
	{
		env.setVariable(oFF.XEnvironmentConstants.FIREFLY_ADMIN_CFG_DIR, oFF.CoConfigurationLayer.ADMIN.getDefaultConfigDirPath());
	}
	if (!env.hasVariable(oFF.XEnvironmentConstants.FIREFLY_USER_CFG_DIR))
	{
		env.setVariable(oFF.XEnvironmentConstants.FIREFLY_USER_CFG_DIR, oFF.CoConfigurationLayer.USER.getDefaultConfigDirPath());
	}
	if (!env.hasVariable(oFF.XEnvironmentConstants.FIREFLY_PROGRAM_STORAGE_DIR))
	{
		env.setVariable(oFF.XEnvironmentConstants.FIREFLY_PROGRAM_STORAGE_DIR, oFF.DfProgram.DEFAULT_PROGRAM_STORAGE_DIR);
	}
	let prgReplace = env.getStringByKey(oFF.XEnvironmentConstants.FIREFLY_PRG_REPLACE);
	if (oFF.notNull(prgReplace))
	{
		let values = oFF.XStringTokenizer.splitString(prgReplace, ",");
		for (let i = 0; i < values.size(); i++)
		{
			let statement = values.get(i);
			let delim = oFF.XString.indexOf(statement, "~");
			if (delim !== -1)
			{
				let source = oFF.XString.substring(statement, 0, delim);
				let target = oFF.XString.substring(statement, delim + 1, -1);
				this.registerProgramTarget(source, target);
			}
		}
	}
	let enableVfs = env.getBooleanByKeyExt(oFF.XEnvironmentConstants.ENABLE_VFS, true);
	if (enableVfs)
	{
		env.setVariable("ff_mount_01", "/prg:prg:///");
		let originSdk = env.getVariable(oFF.XEnvironmentConstants.FIREFLY_SDK);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(originSdk))
		{
			let uri = oFF.XUri.createFromFilePathExt(env, null, originSdk, oFF.PathFormat.AUTO_DETECT, oFF.VarResolveMode.DOLLAR, oFF.ProtocolType.FILE);
			if (uri.isUriResolved())
			{
				env.setVariable(oFF.XEnvironmentConstants.FIREFLY_SDK_ORIGIN, originSdk);
				env.setVariable(oFF.XEnvironmentConstants.FIREFLY_SDK, "vfs:///sdk/");
				env.setVariable("ff_mount_02", oFF.XStringUtils.concatenate2("/sdk:", originSdk));
				env.setVariable("ff_mount_03_platform", oFF.XStringUtils.concatenate2("/etc/platform:", oFF.XStringUtils.concatenate2(originSdk, "/production/platform")));
				env.setVariable("ff_mount_04_orca_delivery", oFF.XStringUtils.concatenate2("/etc/orca_delivery:", oFF.XStringUtils.concatenate2(originSdk, "/projects/orca_delivery/assets")));
				env.setVariable("ff_mount_05_manifests", oFF.XStringUtils.concatenate2("/etc/manifests:", oFF.XStringUtils.concatenate2(originSdk, "/production/manifests")));
				env.setVariable("ff_mount_06_horizon", oFF.XStringUtils.concatenate2("/etc/horizon:", oFF.XStringUtils.concatenate2(originSdk, "/production/horizon")));
				env.setVariable("ff_mount_07_cypress", oFF.XStringUtils.concatenate2("/etc/cypress:", oFF.XStringUtils.concatenate2(originSdk, "/production/cypress")));
			}
		}
	}
	if (env.getBooleanByKeyExt(oFF.XEnvironmentConstants.FIREFLY_LOCKING, false))
	{
		env.enableLocking();
	}
	return env;
};
