oFF.Kernel.prototype.recursiveSelect = function(list, process, entity, processId)
{
	let isEntitySelected = oFF.isNull(entity) || process.getEntity(entity) !== null;
	let isIdSelected = oFF.isNull(processId) || oFF.XString.isEqual(process.getProcessId(), processId);
	if (isEntitySelected && isIdSelected)
	{
		list.add(process);
	}
	let childProcesses = process.getChildProcesses();
	for (let i = 0; i < childProcesses.size(); i++)
	{
		let childProcess = childProcesses.get(i);
		this.recursiveSelect(list, childProcess, entity, processId);
	}
};
