oFF.Kernel.prototype.startPrg = function(startCfg, syncType, listener)
{
	if (oFF.notNull(startCfg))
	{
		if (startCfg.getParentProcess() === null)
		{
			startCfg.setParentProcess(this.m_kernelProcess);
		}
		let activeSyncType = oFF.notNull(syncType) ? syncType : oFF.SyncType.NON_BLOCKING;
		return startCfg.processExecution(activeSyncType, listener, startCfg);
	}
	return null;
};
oFF.Kernel.prototype.startProcessEntities = function(process, entityNames)
{
	let promises = oFF.XPromiseList.create();
	for (let i = 0; i < entityNames.size(); i++)
	{
		let entityName = entityNames.get(i);
		if (process.findEntity(entityName) !== null)
		{
			continue;
		}
		let promise = oFF.ProcessEntityRegistry.createProcessEntity(process, entityName);
		promise.onCatch((err) => {
			this.logError4("Error loading process entity: ", entityName, " - ", err.getText());
		});
		promises.add(promise);
	}
	return oFF.XPromise.allSettled(promises);
};
oFF.Kernel.prototype.startSubSystemIfNecessary = function(subSysType)
{
	if (oFF.isNull(subSysType))
	{
		return oFF.XPromise.reject(oFF.XError.create("Mising sub system type!"));
	}
	let subSysContainer = this.getSubSystemContainer(subSysType);
	if (oFF.isNull(subSysContainer))
	{
		return oFF.XPromise.reject(oFF.XError.create("Invalid sub system type!"));
	}
	if (subSysContainer.getStatus() === oFF.SubSystemStatus.ACTIVE || subSysContainer.getStatus() === oFF.SubSystemStatus.INACTIVE)
	{
		return oFF.XPromise.resolve(oFF.XBooleanValue.create(false));
	}
	let subSysStartPromise = oFF.XPromise.create((resolve, reject) => {
		subSysContainer.processSubSystemLoad(oFF.SyncType.NON_BLOCKING, oFF.XLambdaSubSystemLoadedListener.create((extResult, subSys) => {
			if (extResult.isValid())
			{
				resolve(oFF.XBooleanValue.create(true));
			}
			else
			{
				reject(oFF.XError.createWithMessage(extResult.getFirstError()));
			}
		}), subSysType);
	});
	return subSysStartPromise;
};
oFF.Kernel.prototype.unregisterOnEvent = function(listener)
{
	for (let i = 0; i < this.m_processEventListeners.size(); )
	{
		let currentListener = this.m_processEventListeners.get(i);
		if (currentListener === listener)
		{
			this.m_processEventListeners.removeAt(i);
		}
		else
		{
			i++;
		}
	}
};

