oFF.KernelBoot.prototype.m_persistentState = null;
oFF.KernelBoot.prototype.m_prgStartListeners = null;
oFF.KernelBoot.prototype.m_processEventInterceptor = null;
oFF.KernelBoot.prototype.m_profileWriterInterceptor = null;
oFF.KernelBoot.prototype.m_proxySettings = null;
oFF.KernelBoot.prototype.m_startConfigs = null;
oFF.KernelBoot.prototype.m_useSingletonIfPossible = false;
oFF.KernelBoot.prototype.m_userActivityInterceptor = null;
oFF.KernelBoot.prototype._callKernelReadyConsumer = function()
{
	if (oFF.notNull(this.m_kernelReadyConsumer) && oFF.notNull(this.m_kernel))
	{
		this.interceptKernelEvent(null, "Notify kernel consumers", null, null);
		this.m_kernelReadyConsumer(this.m_kernel);
	}
};
oFF.KernelBoot.prototype._initializeKernel = function()
{
	if (oFF.isNull(this.m_kernel))
	{
		if (this.m_useSingletonIfPossible && oFF.Kernel.getInstance() !== null)
		{
			this.m_kernel = oFF.Kernel.getInstance();
			this.m_kernelProcess = this.m_kernel.getKernelProcessBase();
			this.interceptKernelEvent(null, "Kernel boot sequence initialized: Existing singleton kernel is used", null, null);
			return oFF.XPromise.resolve(oFF.XBooleanValue.create(true));
		}
		else
		{
			this.m_kernel = oFF.Kernel.create(this, this.m_environmentConfig);
			this.m_kernel.setDefaultSyncType(this.m_defaultSyncType);
			this.prepareInterceptorTool();
			this.registerInterceptorsAtKernel();
			this.m_kernel.setModuleLoader(this.m_moduleLoader);
			this.interceptKernelEvent(null, "Kernel boot sequence initialized: New kernel created", null, null);
			return this.m_kernel.initialize().onThenExt((res) => {
				this.m_kernelProcess = this.m_kernel.getKernelProcessBase();
				if (oFF.notNull(this.m_proxySettings))
				{
					this.m_kernelProcess.setProxySettings(this.m_proxySettings);
				}
				if (this.m_doMaxDomainRelaxation)
				{
					let location = oFF.NetworkEnv.getLocation();
					let host = location.getHost();
					let lastDotIndex = oFF.XString.lastIndexOf(host, ".");
					if (lastDotIndex !== -1)
					{
						let secondLastDotIndex = oFF.XString.lastIndexOfFrom(host, ".", lastDotIndex - 1);
						if (secondLastDotIndex !== -1)
						{
							let reducedHost = oFF.XString.substring(host, secondLastDotIndex + 1, -1);
							oFF.NetworkEnv.setDomain(reducedHost);
							let exclude = oFF.XStringUtils.concatenate2("*.", reducedHost);
							this.m_kernelProcess.getProxySettings().getProxyExcludesBase().add(exclude);
						}
					}
				}
				this.interceptKernelEvent(null, "Kernel core ready", null, null);
				this.m_kernel.notifyReady();
				return res;
			});
		}
	}
	return oFF.XPromise.resolve(oFF.XBooleanValue.create(false));
};
oFF.KernelBoot.prototype._loadAdditionalModulesIfNeeded = function()
{
	if (oFF.isNull(this.m_kernel) || !oFF.XCollectionUtils.hasElements(this.m_additionalModulesToLoad))
	{
		return oFF.XPromise.resolve(null);
	}
	this.interceptKernelEvent(null, "Load additional predefined modules", this.m_additionalModulesToLoad.toString(), null);
	this.log(oFF.XStringUtils.concatenate3("ADDITIONAL MODULES: Loading modules '", this.m_additionalModulesToLoad.toString(), "'"));
	return oFF.XPromise.create((resolve, reject) => {
		let listener = oFF.LambdaModuleLoadedMultiListener.create((result, list) => {
			this.onModuleLoadedMulti(result, list, null);
			resolve(null);
		});
		this.m_kernel.processMultiModulesLoad(this.m_defaultSyncType, listener, null, this.m_additionalModulesToLoad);
	});
};
oFF.KernelBoot.prototype._processFragmentIfNeeded = function()
{
	if (oFF.notNull(this.m_persistentState))
	{
		let cfgList = this.m_persistentState.getInitialCfgs();
		if (oFF.notNull(cfgList))
		{
			for (let k = 0; k < cfgList.size(); k++)
			{
				let startCfg = cfgList.get(k);
				this._startPrg(startCfg);
			}
		}
	}
};
oFF.KernelBoot.prototype._runAllStartPrograms = function()
{
	let programStartPromiseList = oFF.XPromiseList.create();
	for (let i = 0; i < this.m_startConfigs.size(); i++)
	{
		let startCfg = this.m_startConfigs.get(i);
		programStartPromiseList.add(this._startPrg(startCfg));
	}
	let allPrgStartPromise = oFF.XPromise.allSettled(programStartPromiseList);
	return allPrgStartPromise.onThenExt((res) => {
		return oFF.XCollectionUtils.map(res, (value) => {
			if (value.isReject())
			{
				throw oFF.XException.createException(value.getReason().getText());
			}
			return value.getValue();
		});
	});
};
oFF.KernelBoot.prototype._startPrg = function(startCfg)
{
	let prgStartPromise = oFF.XPromise.create((resolve, reject) => {
		let action = this.m_kernel.startPrg(startCfg, oFF.SyncType.DELAYED, null);
		if (oFF.notNull(action))
		{
			if (oFF.XCollectionUtils.hasElements(this.m_prgStartListeners))
			{
				oFF.XCollectionUtils.forEach(this.m_prgStartListeners, (listener) => {
					action.attachListener(listener, oFF.ListenerType.SPECIFIC, startCfg);
				});
			}
			action.attachListener(oFF.ProgramStartedLambdaListener.create((extResult, program) => {
				if (extResult.isValid())
				{
					this.log(oFF.XStringUtils.concatenate3("SUCCESS: Program '", startCfg.getName(), "' started"));
					resolve(program);
				}
				else
				{
					this.log(oFF.XStringUtils.concatenate3("ERROR: Program '", startCfg.getName(), "' cannot be started"));
					this.log(extResult.getSummary());
					reject(oFF.XError.createWithMessage(extResult.getFirstError()));
				}
			}), oFF.ListenerType.SPECIFIC, startCfg);
			action.setActiveSyncType(this.m_defaultSyncType);
			action.process();
		}
		else
		{
			reject(oFF.XError.create("Missing program start action!"));
		}
	});
	return prgStartPromise;
};
