oFF.KernelBoot.prototype.registerInterceptorsAtKernel = function()
{
	let hub = this.m_kernel.getInterceptorHubBase();
	for (let i = 0; i < this.m_logWriterInterceptor.size(); i++)
	{
		hub.registerLogWriterInterceptor(this.m_logWriterInterceptor.get(i));
	}
	for (let j = 0; j < this.m_profileWriterInterceptor.size(); j++)
	{
		hub.registerProfileWriterInterceptor(this.m_profileWriterInterceptor.get(j));
	}
	for (let k = 0; k < this.m_httpExchangeInterceptor.size(); k++)
	{
		hub.registerHttpExchangeInterceptor(this.m_httpExchangeInterceptor.get(k));
	}
	for (let l = 0; l < this.m_processEventInterceptor.size(); l++)
	{
		hub.registerProcessEventInterceptor(this.m_processEventInterceptor.get(l), null);
	}
	for (let m = 0; m < this.m_userActivityInterceptor.size(); m++)
	{
		hub.registerUserActivityInterceptor(this.m_userActivityInterceptor.get(m));
	}
	for (let o = 0; o < this.m_kernelEventInterceptor.size(); o++)
	{
		hub.registerKernelEventInterceptor(this.m_kernelEventInterceptor.get(o));
	}
	for (let p = 0; p < this.m_callInterceptor.size(); p++)
	{
		hub.registerCallInterceptor(this.m_callInterceptor.get(p));
	}
};
