oFF.KernelBoot.prototype.setConfigJson = function(natveJson)
{
	try
	{
		let jsonParser = oFF.JsonParserFactory.newInstance();
		let output = jsonParser.convertFromNative(natveJson);
		oFF.XObjectExt.release(jsonParser);
		if (oFF.notNull(output) && output.isStructure())
		{
			this.setConfigStructure(output.asStructure());
		}
	}
	catch (err)
	{
		this.log2("Failed to set config json configuration! Error: ", oFF.XException.getMessage(err));
	}
};
