oFF.ProgramManifest.createByJsonStructure = function(jsonStruct)
{
	let newObj = new oFF.ProgramManifest();
	if (oFF.notNull(jsonStruct) && jsonStruct.isStructure())
	{
		let name = jsonStruct.getStringByKey(oFF.ProgramManifestConstants.NAME_KEY);
		newObj.setupManifest(name, null, null, null, null, null, null);
		let stringifiedLayoutData = oFF.PrUtils.serializeUnescaped(jsonStruct, false, false, 0);
		newObj.setJsonString(stringifiedLayoutData);
		return newObj;
	}
	return null;
};
