oFF.ProgramManifest.prototype._processMappedProperties = function(mappedProperties)
{
	let oldValueMappings = this.m_valueMappings;
	this.m_valueMappings = oFF.XList.create();
	if (oFF.notNull(mappedProperties))
	{
		oFF.XCollectionUtils.forEach(mappedProperties, (property) => {
			this.m_valueMappings.add(oFF.CoValueMapping.create(property.asStructure()));
		});
	}
	this.m_valueMappings.addAll(oldValueMappings);
	oldValueMappings.clear();
	oFF.XObjectExt.release(oldValueMappings);
};
oFF.ProgramManifest.prototype._setConfigurationMetadata = function(configurationMetadata)
{
	this.m_configurationMetadata = configurationMetadata;
	if (oFF.notNull(this.m_configurationMetadata))
	{
		oFF.CoConfigurationRegistry.registerConfigurationByProviderIfNeeded(this);
	}
};
oFF.ProgramManifest.prototype.checkJson = function()
{
	oFF.ResourceDef.prototype.checkJson.call( this );
	if (oFF.notNull(this.m_jsonString) && this.m_isJsonParsed === false)
	{
		this.m_isJsonParsed = true;
		let document = oFF.JsonParserFactory.createFromString(this.m_jsonString);
		if (oFF.notNull(document) && document.isStructure())
		{
			let jsonStructure = document.asStructure();
			let clazzName = jsonStructure.getStringByKey(oFF.ProgramManifestConstants.CLASS_KEY);
			if (oFF.notNull(clazzName))
			{
				this.setClazzName(clazzName);
			}
			this.m_ref = jsonStructure.getStringByKey(oFF.ProgramManifestConstants.REF_KEY);
			this.deployDefaults();
			let modules = jsonStructure.getListByKey(oFF.ProgramManifestConstants.MODULES_KEY);
			if (oFF.notNull(modules))
			{
				for (let i = 0; i < modules.size(); i++)
				{
					let moduleName = modules.getStringAt(i);
					let entity = oFF.ResourceDef.create(moduleName, oFF.ResourceType.MODULE, null, null, false, null, null, null, null);
					this.addDependency(entity);
				}
			}
			let containerType = jsonStructure.getStringByKey(oFF.ProgramManifestConstants.CONTAINER_KEY);
			if (oFF.notNull(containerType))
			{
				let programDevice = oFF.ProgramContainerType.lookup(containerType);
				if (oFF.notNull(programDevice))
				{
					this.setOutputContainerType(programDevice);
				}
			}
			let profiles = jsonStructure.getListByKey(oFF.ProgramManifestConstants.PROFILES_KEY);
			if (oFF.notNull(profiles))
			{
				for (let j = 0; j < profiles.size(); j++)
				{
					let profileName = profiles.getStringAt(j);
					this.addProfile(profileName);
				}
			}
			let type = jsonStructure.getStringByKey(oFF.ProgramManifestConstants.TYPE_KEY);
			if (oFF.notNull(type))
			{
				let processType = oFF.ProcessType.lookup(type);
				if (oFF.notNull(processType))
				{
					this.setProcessType(processType);
				}
			}
			let displayName = jsonStructure.getStringByKeyExt(oFF.ProgramManifestConstants.DISPLAY_NAME_KEY, this.getDisplayName());
			displayName = oFF.XStringUtils.isNullOrEmpty(displayName) ? this.getProgramName() : displayName;
			this.setDisplayName(displayName);
			let author = jsonStructure.getStringByKeyExt(oFF.ProgramManifestConstants.AUTHOR_KEY, this.getAuthor());
			this.setAuthor(author);
			let description = jsonStructure.getStringByKeyExt(oFF.ProgramManifestConstants.DESCRIPTION_KEY, this.getDescription());
			this.setDescription(description);
			let iconPath = jsonStructure.getStringByKeyExt(oFF.ProgramManifestConstants.ICON_KEY, this.getDefaultIconPath());
			this.setIconPath(iconPath);
			let categoryStr = jsonStructure.getStringByKeyExt(oFF.ProgramManifestConstants.CATEGORY_KEY, null);
			if (oFF.notNull(categoryStr))
			{
				let category = oFF.ProgramCategory.lookupwithDefault(categoryStr, this.getCategory());
				if (oFF.notNull(category))
				{
					this.setCategory(category);
				}
			}
			let isAvailablenAppStore = jsonStructure.getBooleanByKeyExt(oFF.ProgramManifestConstants.APP_STORE_KEY, this.isAvailableInAppStore());
			this.setIsAvailableInAppStore(isAvailablenAppStore);
			let isInitiallyVisibleOnLaunchpad = jsonStructure.getBooleanByKeyExt(oFF.ProgramManifestConstants.INITIALLY_ON_LAUNCHPAD_KEY, this.isInitiallyVisibleOnLaunchpad());
			this.setIsInitiallyVisibleOnLaunchpad(isInitiallyVisibleOnLaunchpad);
			let initialTitle = jsonStructure.getStringByKeyExt(oFF.ProgramManifestConstants.INITIAL_TITLE_KEY, this.getInitialTitle());
			initialTitle = oFF.XStringUtils.isNullOrEmpty(initialTitle) ? displayName : initialTitle;
			this.setInitialTitle(initialTitle);
			let initialContainerFrame = jsonStructure.getStructureByKey(oFF.ProgramManifestConstants.INITIAL_CONTAINER_FRAME_KEY);
			if (oFF.notNull(initialContainerFrame))
			{
				let winX = initialContainerFrame.getStringByKey(oFF.ProgramManifestConstants.INITIAL_CONTAINER_FRAME_X_KEY);
				let winY = initialContainerFrame.getStringByKey(oFF.ProgramManifestConstants.INITIAL_CONTAINER_FRAME_Y_KEY);
				let winWidth = initialContainerFrame.getStringByKey(oFF.ProgramManifestConstants.INITIAL_CONTAINER_FRAME_WIDTH_KEY);
				let winHeight = initialContainerFrame.getStringByKey(oFF.ProgramManifestConstants.INITIAL_CONTAINER_FRAME_HEIGHT_KEY);
				this.setInitialContainerCssPosX(winX);
				this.setInitialContainerCssPosY(winY);
				this.setInitialContainerCssWidth(winWidth);
				this.setInitialContainerCssHeight(winHeight);
				let isMaximized = initialContainerFrame.getBooleanByKeyExt(oFF.ProgramManifestConstants.INITIAL_CONTAINER_FRAME_MAXIMIZED_KEY, this.isInitiallyContainerMaximized());
				this.setIsInitiallyContainerMaximized(isMaximized);
			}
			let argumentMetadataStruct = jsonStructure.getStructureByKey(oFF.ProgramManifestConstants.ARGUMENTS_KEY);
			if (oFF.notNull(argumentMetadataStruct))
			{
				this.parseArgumentMetadata(argumentMetadataStruct);
			}
			let startArgsStructure = jsonStructure.getStructureByKey(oFF.ProgramManifestConstants.START_ARGS_STRUCTURE_KEY);
			oFF.PrUtils.mergeStructures(this.m_startArgsStructure, oFF.PrUtils.createDeepCopy(startArgsStructure));
			let subSystems = jsonStructure.getListByKey(oFF.ProgramManifestConstants.SUB_SYSTEMS_KEY);
			if (oFF.notNull(subSystems))
			{
				for (let k = 0; k < subSystems.size(); k++)
				{
					let subSysName = subSystems.getStringAt(k);
					this.m_subSystems.add(subSysName);
				}
			}
			let processEntities = jsonStructure.getListByKey(oFF.ProgramManifestConstants.INITIAL_PROCESS_ENTITIES);
			if (oFF.notNull(processEntities))
			{
				for (let k = 0; k < processEntities.size(); k++)
				{
					let entities = processEntities.getStringAt(k);
					this.m_initialProcessEntities.add(entities);
				}
			}
			let locationStr = jsonStructure.getStringByKey(oFF.ProgramManifestConstants.INITIAL_PROCESS_ENTITIES_LOCATION);
			if (oFF.notNull(locationStr))
			{
				let location = oFF.ProcessEntityLocation.lookup(locationStr);
				if (oFF.notNull(location))
				{
					this.m_initialProcessEntitiesLocation = location;
				}
			}
			this.m_startupTimeoutDuration = jsonStructure.getIntegerByKeyExt(oFF.ProgramManifestConstants.PROGRAM_START_TIMEOUT_DURATION, oFF.ProgramManifest.DEFAULT_PROGRAM_STARTUP_TIMEOUT);
			oFF.PrUtils.mergeStructuresExt(this.m_configurationMetadataElement, jsonStructure.getStructureByKey(oFF.ProgramManifestConstants.CONFIGURATION_KEY), true);
			this._setConfigurationMetadata(oFF.CoConfigurationMetadataUtils.processConfigurationMetadataSafe(this.getName(), oFF.CoConfigurationType.PROGRAM, this.getRawConfigurationMetadataElement()));
			this._processMappedProperties(jsonStructure.getListByKey(oFF.ProgramManifestConstants.MAPPED_PROPERTIES));
			this.m_componentMappingElement = jsonStructure.getStructureByKey(oFF.ProgramManifestConstants.COMPONENT_MAPPINGS);
		}
	}
	oFF.ResourceDef.prototype.checkJson.call( this );
};
oFF.ProgramManifest.prototype.deployDefaults = function()
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_ref))
	{
		this.m_refManifest = oFF.ProgramRegistry.getProgramManifest(this.m_ref);
		if (oFF.notNull(this.m_refManifest))
		{
			if (oFF.XStringUtils.isNullOrEmpty(this.getInitClazzNameOrigin()))
			{
				this.setClazzName(this.m_refManifest.getInitClazzNameOrigin());
			}
			this.addAllDependencies(this.m_refManifest.getAllDependencies());
			this.setOutputContainerType(this.m_refManifest.getOutputContainerType());
			this.setProcessType(this.m_refManifest.getProcessType());
			this.setDisplayName(this.m_refManifest.getDisplayName());
			this.setDescription(this.m_refManifest.getDescription());
			this.setAuthor(this.m_refManifest.getAuthor());
			this.setIconPath(this.m_refManifest.getIconPath());
			this.setInitialTitle(this.m_refManifest.getInitialTitle());
			this.setInitialContainerCssWidth(this.m_refManifest.getInitialContainerCssWidth());
			this.setInitialContainerCssHeight(this.m_refManifest.getInitialContainerCssHeight());
			this.setInitialContainerCssPosX(this.m_refManifest.getInitialContainerCssPosX());
			this.setInitialContainerCssPosY(this.m_refManifest.getInitialContainerCssPosY());
			this.setIsInitiallyContainerMaximized(this.m_refManifest.isInitiallyContainerMaximized());
			let parentStructure = this.m_refManifest.getStartArgumentsStructure();
			this.m_startArgsStructure = oFF.PrUtils.createDeepCopy(parentStructure);
			oFF.PrUtils.mergeStructuresExt(this.m_configurationMetadataElement, oFF.PrUtils.createDeepCopy(this.m_refManifest.getRawConfigurationMetadataElement()), true);
			this.m_valueMappings = this.m_refManifest.getMappedProperties().createListCopy();
			this._setConfigurationMetadata(oFF.CoConfigurationMetadataUtils.processConfigurationMetadataSafe(this.getName(), oFF.CoConfigurationType.PROGRAM, this.getRawConfigurationMetadataElement()));
			this.setSubSystems(this.m_refManifest.getSubSystems());
			this.setInitialProcessEntities(this.m_refManifest.getInitialProcessEntities());
			this.setInitialProcessEntitiesLocation(this.m_refManifest.getInitialProcessEntitiesLocation());
			this.setProgramStartupTimeoutDuration(this.m_refManifest.getProgramStartupTimeoutDuration());
		}
	}
};
