oFF.ProgramRunner.prototype.runProgram = function()
{
	let prgStartedPromise = oFF.XPromise.create((resolve, reject) => {
		if (oFF.notNull(this.m_startConfig))
		{
			if (this.m_startConfig.getProgramManifest() !== null)
			{
				this.m_timerId = oFF.XTimeout.timeout(this.m_startConfig.getProgramManifest().getProgramStartupTimeoutDuration(), () => {
					reject(oFF.XError.create(oFF.XStringUtils.concatenate3("Starting program ", this.m_startConfig.getName(), " timed out!")));
				});
			}
			this.m_startConfig.processExecution(this.m_parentProcess.getDefaultSyncType(), oFF.ProgramStartedLambdaListener.create((extResult, startedPrg) => {
				if (extResult.isValid())
				{
					resolve(startedPrg);
				}
				else
				{
					reject(oFF.XError.createWithMessage(extResult.getFirstError()));
				}
				if (oFF.notNull(this.m_timerId))
				{
					oFF.XTimeout.clear(this.m_timerId);
				}
			}), null);
		}
		else
		{
			reject(oFF.XError.create("Failed to start program! Unknown error!"));
		}
	});
	return prgStartedPromise;
};
