oFF.ProcessEntityManagerProgram.prototype.createEntity = function()
{
	let stdout = this.getStdout();
	let kernel = this.getProcess().getKernel();
	let targetProcess = kernel.getChildProcessById(this.m_processId);
	if (oFF.isNull(targetProcess))
	{
		this.m_exitCode = -1;
		let msg = oFF.XStringUtils.concatenate2("Could not find process with id: ", this.m_processId);
		stdout.println(msg);
		return oFF.XPromise.reject(oFF.XError.create(msg));
	}
	if (targetProcess.getEntity(this.m_entityTypeName) !== null)
	{
		this.m_exitCode = -1;
		let msg = "Entity already exists.";
		stdout.println(msg);
		return oFF.XPromise.reject(oFF.XError.create(msg));
	}
	return kernel.startProcessEntities(targetProcess, oFF.XCollectionUtils.singletonList(this.m_entityTypeName)).onThenExt((result) => {
		return oFF.XBooleanValue.create(true);
	}).onCatch((err) => {
		this.m_exitCode = -1;
		stdout.println(err.getText());
	});
};
