oFF.ProcessEntityManagerProgram.prototype.printAllCommands = function()
{
	let stdout = this.getStdout();
	stdout.println("Available commands:");
	stdout.println(oFF.XStringUtils.concatenate2(oFF.ProcessEntityManagerProgram.COMMAND_LIST, " - Show available process entities"));
	stdout.println(oFF.XStringUtils.concatenate2(oFF.ProcessEntityManagerProgram.COMMAND_CREATE, " - Create a process entity. Params: entity type name and process id to attach to"));
	stdout.println(oFF.XStringUtils.concatenate2(oFF.ProcessEntityManagerProgram.COMMAND_DESTROY, " - Destroy a process entity. Params: entity type name and process id to remove from"));
};
oFF.ProcessEntityManagerProgram.prototype.printAvailableEntities = function()
{
	this.getStdout().println("not implemented");
};
oFF.ProcessEntityManagerProgram.prototype.processArguments = function(args)
{
	this.m_command = args.getStringByKey(oFF.ProcessEntityManagerProgram.PARAM_COMMAND);
	this.m_entityTypeName = args.getStringByKey(oFF.ProcessEntityManagerProgram.PARAM_ENTITY);
	this.m_processId = args.getStringByKey(oFF.ProcessEntityManagerProgram.PARAM_PROCESS);
};
oFF.ProcessEntityManagerProgram.prototype.processConfiguration = function(configuration) {};
oFF.ProcessEntityManagerProgram.prototype.runProcess = function()
{
	if (this.m_exitCode !== 0)
	{
		this.exitNow(this.m_exitCode);
	}
	return false;
};
oFF.ProcessEntityManagerProgram.prototype.setupProcess = function()
{
	if (oFF.isNull(this.m_command))
	{
		this.printAllCommands();
		this.m_exitCode = -1;
		return null;
	}
	if (oFF.XString.isEqual(this.m_command, oFF.ProcessEntityManagerProgram.COMMAND_LIST))
	{
		this.printAvailableEntities();
		return null;
	}
	if (oFF.XString.isEqual(this.m_command, oFF.ProcessEntityManagerProgram.COMMAND_CREATE))
	{
		return this.createEntity();
	}
	if (oFF.XString.isEqual(this.m_command, oFF.ProcessEntityManagerProgram.COMMAND_DESTROY))
	{
		this.getStdout().println("not implemented");
		return null;
	}
	return null;
};

