oFF.Process.prototype._recursiveFindProcessById = function(process, processId)
{
	let foundProcess = null;
	if (oFF.isNull(process) || oFF.XStringUtils.isNullOrEmpty(processId))
	{
		return null;
	}
	let childProcessList = process.getChildProcesses();
	if (!oFF.XCollectionUtils.hasElements(childProcessList))
	{
		return null;
	}
	for (let i = 0; i < childProcessList.size(); i++)
	{
		let childProcess = childProcessList.get(i);
		if (oFF.XString.isEqual(childProcess.getProcessId(), processId))
		{
			foundProcess = childProcess;
		}
		else
		{
			foundProcess = this._recursiveFindProcessById(childProcess, processId);
		}
		if (oFF.notNull(foundProcess))
		{
			break;
		}
	}
	return foundProcess;
};
