oFF.Process.prototype.terminate = function()
{
	let childProcesses = this.getChildProcesses();
	let parentProcess = this.getParentProcess();
	if (oFF.isNull(parentProcess) && this.getProcessType() === oFF.ProcessType.ROOT)
	{
		throw oFF.XException.createIllegalStateException("A root process cannot be terminated!");
	}
	for (let i = 0; i < childProcesses.size(); i++)
	{
		let child = childProcesses.get(i);
		parentProcess.attachExistingChildProcess(child);
		this.removeChild(child);
	}
	parentProcess.removeChild(this);
	this.notifyProcessEvent(oFF.ProcessEventType.TERMINATED);
	this.m_processEventListeners.clear();
};
oFF.Process.prototype.toString = function()
{
	let buffer = oFF.XStringBuffer.create();
	let processType = this.getProcessType();
	buffer.append(processType.getName());
	let startConfiguration = this.getProgramCfg();
	if (oFF.notNull(startConfiguration))
	{
		buffer.append(" - ");
		buffer.append(startConfiguration.getName());
		let prgArgs = startConfiguration.getArguments();
		if (oFF.notNull(prgArgs) && oFF.XStringUtils.isNotNullAndNotEmpty(prgArgs.getArgumentString()))
		{
			let argumentString = prgArgs.getArgumentString();
			buffer.append(" ");
			buffer.append(argumentString);
		}
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.getDescription()))
	{
		buffer.append(" - ");
		buffer.append(this.getDescription());
	}
	return buffer.toString();
};
oFF.Process.prototype.unregisterOnEvent = function(listener)
{
	for (let i = 0; i < this.m_processEventListeners.size(); )
	{
		let currentListener = this.m_processEventListeners.get(i);
		if (currentListener === listener)
		{
			this.m_processEventListeners.removeAt(i);
		}
		else
		{
			i++;
		}
	}
};

