oFF.SigSelManager.prototype.getFactory = function(component)
{
	let theFactory = null;
	let componentType = component.getComponentType();
	while (oFF.notNull(componentType) && oFF.isNull(theFactory))
	{
		let name = componentType.getName();
		theFactory = oFF.SigSelManager.s_spaceFactories.getByKey(name);
		componentType = componentType.getParent();
	}
	return theFactory;
};
oFF.SigSelManager.prototype.getRegisteredDomain = function()
{
	let domains = oFF.XList.create();
	let iterator = this.m_selectProviders.getKeysAsIterator();
	while (iterator.hasNext())
	{
		let domain = oFF.SigSelDomain.lookup(iterator.next());
		domains.add(domain);
	}
	return domains;
};
