oFF.UserProfile.prototype.hasPrivilegeOnType = function(authGroup, privilege)
{
	if (this.arePrivilegesAvailable())
	{
		let foundAuthType = oFF.XCollectionUtils.findFirst(this.m_authTypes.getValuesAsReadOnlyList(), (authType) => {
			if (authType.isStructure())
			{
				let tmpAuthType = authType.asStructure();
				let tmpAuthGroupName = tmpAuthType.getStringByKey("name");
				return oFF.XString.isEqual(tmpAuthGroupName, authGroup);
			}
			return false;
		});
		if (oFF.notNull(foundAuthType) && foundAuthType.isStructure())
		{
			let foundTmpAuthType = foundAuthType.asStructure();
			let tmpAuths = foundTmpAuthType.getStructureByKey("auth");
			return tmpAuths.getBooleanByKeyExt(privilege, false);
		}
		return false;
	}
	return true;
};
