oFF.CoConfiguration.create = function(configurationMetadata, rawConfigStructure, process)
{
	let newInstance = new oFF.CoConfiguration();
	newInstance.setupWithConfigMetadata(configurationMetadata, rawConfigStructure, process);
	return newInstance;
};
oFF.CoConfiguration.prototype.m_componentsConfigStructure = null;
oFF.CoConfiguration.prototype.m_configStructure = null;
oFF.CoConfiguration.prototype.m_configurationMetadata = null;
oFF.CoConfiguration.prototype._applyDefaultValueOrRemove = function(property, parentStruct)
{
	if (oFF.notNull(property) && oFF.notNull(parentStruct))
	{
		let propKey = property.getName();
		if (property.getDefaultValue() !== null)
		{
			parentStruct.put(propKey, property.getDefaultValue());
		}
		else
		{
			parentStruct.remove(propKey);
		}
	}
};
oFF.CoConfiguration.prototype._checkPropertyDirty = function(propertyName)
{
	let propMetadata = this.getPropertyMetadataByName(propertyName);
	if (oFF.notNull(propMetadata))
	{
		let currentValue = this.m_configStructure.getByKey(propertyName);
		let defaultPropValue = propMetadata.getDefaultValue();
		if (oFF.notNull(currentValue))
		{
			return !currentValue.isEqualTo(defaultPropValue);
		}
		return currentValue !== defaultPropValue;
	}
	return false;
};
oFF.CoConfiguration.prototype._getArrayDefaultValue = function(propMetadata)
{
	let defaultVal = null;
	if (oFF.notNull(propMetadata) && propMetadata.getDefaultValue() !== null && propMetadata.getDefaultValue().isList())
	{
		try
		{
			defaultVal = propMetadata.getDefaultValue().asList();
		}
		catch (error)
		{
			defaultVal = oFF.PrFactory.createList();
		}
	}
	return defaultVal;
};
oFF.CoConfiguration.prototype._getBooleanDefaultValue = function(propMetadata)
{
	let defaultVal = false;
	if (oFF.notNull(propMetadata) && propMetadata.getDefaultValue() !== null && propMetadata.getDefaultValue().isBoolean())
	{
		defaultVal = propMetadata.getDefaultValue().asBoolean().getBoolean();
	}
	return defaultVal;
};
oFF.CoConfiguration.prototype._getIntegerDefaultValue = function(propMetadata)
{
	let defaultVal = 0;
	if (oFF.notNull(propMetadata) && propMetadata.getDefaultValue() !== null && propMetadata.getDefaultValue().isInteger())
	{
		defaultVal = propMetadata.getDefaultValue().asInteger().getInteger();
	}
	return defaultVal;
};
oFF.CoConfiguration.prototype._getNumberDefaultValue = function(propMetadata)
{
	let defaultVal = 0;
	if (oFF.notNull(propMetadata) && propMetadata.getDefaultValue() !== null && propMetadata.getDefaultValue().isNumeric())
	{
		defaultVal = propMetadata.getDefaultValue().asNumber().getDouble();
	}
	return defaultVal;
};
oFF.CoConfiguration.prototype._getStringDefaultValue = function(propMetadata)
{
	let defaultVal = null;
	if (oFF.notNull(propMetadata) && propMetadata.getDefaultValue() !== null && propMetadata.getDefaultValue().isString())
	{
		defaultVal = propMetadata.getDefaultValue().asString().getString();
	}
	return defaultVal;
};
oFF.CoConfiguration.prototype._getStructureDefaultValue = function(propMetadata)
{
	let defaultVal = null;
	if (oFF.notNull(propMetadata) && propMetadata.getDefaultValue() !== null && propMetadata.getDefaultValue().isStructure())
	{
		try
		{
			defaultVal = propMetadata.getDefaultValue().asStructure();
		}
		catch (error)
		{
			defaultVal = oFF.PrFactory.createStructure();
		}
	}
	return defaultVal;
};
oFF.CoConfiguration.prototype._processProperty = function(property, parentConfigStruct)
{
	if (oFF.notNull(property) && oFF.notNull(parentConfigStruct))
	{
		let propKey = property.getName();
		let propDataType = property.getType();
		let propElement = parentConfigStruct.getByKey(propKey);
		let doesExist = parentConfigStruct.containsKey(propKey);
		let isValid = true;
		if (doesExist)
		{
			isValid = this._validateProperty(property, propElement);
		}
		if (!doesExist || !isValid)
		{
			this._applyDefaultValueOrRemove(property, parentConfigStruct);
		}
		if (propDataType === oFF.CoDataType.OBJECT)
		{
			let objectStruct = parentConfigStruct.getStructureByKey(propKey);
			if (oFF.isNull(objectStruct))
			{
				objectStruct = parentConfigStruct.putNewStructure(propKey);
			}
			let tmpObjectStruct = objectStruct;
			let objectProp = property;
			oFF.XCollectionUtils.forEach(objectProp.getAllProperties(), (tmpObjectProp) => {
				this._processProperty(tmpObjectProp, tmpObjectStruct);
			});
		}
	}
	else
	{
		oFF.XLogger.printError("[Configuration] Error processing property. Missing property metadata or config structure!");
	}
};
oFF.CoConfiguration.prototype._processRawConfigurationStructure = function(rawConfigStructure)
{
	if (oFF.XCollectionUtils.hasElements(rawConfigStructure))
	{
		let configurationElement = rawConfigStructure.getByKey(oFF.CoConfigurationConstants.CONFIGURATION);
		if (oFF.notNull(configurationElement) && configurationElement.isStructure())
		{
			oFF.PrUtils.mergeStructures(this.m_configStructure, configurationElement.asStructure());
			let componentsConfigStructureRaw = rawConfigStructure.getStructureByKey(oFF.CoConfigurationConstants.COMPONENTS);
			if (oFF.notNull(componentsConfigStructureRaw))
			{
				oFF.PrUtils.mergeStructures(this.m_componentsConfigStructure, componentsConfigStructureRaw);
			}
		}
		else
		{
			oFF.PrUtils.mergeStructures(this.m_configStructure, rawConfigStructure);
		}
	}
	if (this.hasConfigurationMetadata())
	{
		oFF.XCollectionUtils.forEach(this.getAllProperties(), (tmpProp) => {
			this._processProperty(tmpProp, this.m_configStructure);
		});
	}
};
oFF.CoConfiguration.prototype._validateProperty = function(propMetadata, propElement)
{
	if (oFF.notNull(propMetadata))
	{
		let propKey = propMetadata.getName();
		let propDataType = propMetadata.getType();
		if (oFF.isNull(propElement))
		{
			oFF.XLogger.println(oFF.XStringUtils.concatenate3("[Configuration] Error processing property ", propKey, "! 'null' is not a valid value for this property!"));
			return false;
		}
		let configElementType = propElement.getType();
		if (!propDataType.isOfElementType(configElementType) && !propDataType.isNumeric())
		{
			oFF.XLogger.println(oFF.XStringUtils.concatenate4("[Configuration] Error processing property ", propKey, "! Invalid data type! Expected: ", propDataType.getName()));
			return false;
		}
		if (propDataType === oFF.CoDataType.ARRAY && propElement.isList())
		{
			let arrayProp = propMetadata;
			let arrayType = arrayProp.getItemsType();
			if (oFF.notNull(arrayType))
			{
				let tmpList = propElement.asList();
				let foundInvalid = oFF.XCollectionUtils.contains(tmpList.getValuesAsReadOnlyList(), (listItem) => {
					return !arrayType.isOfElementType(listItem.getType());
				});
				if (foundInvalid)
				{
					oFF.XLogger.println(oFF.XStringUtils.concatenate4("[Configuration] Error processing property ", propKey, "! Invalid item data type! Expected: ", arrayType.getName()));
					return false;
				}
			}
		}
	}
	return true;
};
