oFF.FpaOpenIdTokenLoadAction.prototype.m_authCode = null;
oFF.FpaOpenIdTokenLoadAction.prototype.m_clientId = null;
oFF.FpaOpenIdTokenLoadAction.prototype.m_isPopupEnabled = false;
oFF.FpaOpenIdTokenLoadAction.prototype.m_redirectUri = null;
oFF.FpaOpenIdTokenLoadAction.prototype.m_systemName = null;
oFF.FpaOpenIdTokenLoadAction.prototype.callListener = function(extResult, listener, data, customIdentifier)
{
	if (extResult.hasErrors())
	{
		listener.onBearerTokenSeverError(extResult, customIdentifier);
	}
	else
	{
		let accessToken = data.getByKey(oFF.FpaOpenIdTokenLoadAction.ACCESS_TOKEN);
		let expiresIn = data.getByKey(oFF.FpaOpenIdTokenLoadAction.EXPIRES_IN);
		let expiresAt = null;
		if (oFF.notNull(expiresIn))
		{
			let expiresAtMs = oFF.XDateTime.createCurrentLocalDateTime().getMilliseconds() + (oFF.XLong.convertFromString(expiresIn) * 1000) - oFF.FpaOpenIdTokenLoadAction.TOKEN_FETCH_BUFFER;
			expiresAt = oFF.XDateTime.createWithMilliseconds(expiresAtMs);
		}
		listener.onBearerTokenLoaded(extResult, oFF.XAuthenticationToken.create(accessToken), expiresAt, customIdentifier);
	}
};
oFF.FpaOpenIdTokenLoadAction.prototype.extractData = function(msgData)
{
	let data = oFF.XJson.extractJsonContent(msgData).asStructure();
	let params = data.getStructureByKey("queryParams");
	this.m_authCode = params.getStringByKey("code");
};
oFF.FpaOpenIdTokenLoadAction.prototype.getQuery = function(customIdentifier)
{
	let query = oFF.PrFactory.createStructure();
	query.putStringNotNullAndNotEmpty("connectionName", this.m_systemName);
	if (customIdentifier === oFF.FpaOpenIdWorkflowType.TOKEN)
	{
		query.putStringNotNullAndNotEmpty("userName", this.m_clientId);
		query.putStringNotNullAndNotEmpty("redirectURI", this.m_redirectUri);
		query.putStringNotNullAndNotEmpty("openIdAuthCode", this.m_authCode);
	}
	return query;
};
oFF.FpaOpenIdTokenLoadAction.prototype.getUri = function(customIdentifier)
{
	if (customIdentifier === oFF.FpaOpenIdWorkflowType.CLIENT_ID)
	{
		return oFF.XUri.createFromUrl(oFF.XStringUtils.concatenate2(oFF.FpaOpenIdTokenLoadAction.LIVE_INTEGRATION_CONN_MANAGER_URL, "?action=getClientId"));
	}
	else if (customIdentifier === oFF.FpaOpenIdWorkflowType.TOKEN)
	{
		return oFF.XUri.createFromUrl(oFF.XStringUtils.concatenate2(oFF.FpaOpenIdTokenLoadAction.LIVE_INTEGRATION_CONN_MANAGER_URL, "?action=getToken"));
	}
	return oFF.XUri.createFromUrl(oFF.FpaOpenIdTokenLoadAction.LIVE_INTEGRATION_CONN_MANAGER_URL);
};
oFF.FpaOpenIdTokenLoadAction.prototype.getUrl = function()
{
	let env = this.getSession().getEnvironment();
	let idpUrl = env.getStringByKeyExt(oFF.XEnvironmentConstants.FIREFLY_FPA_SAML_IDP_METADATA_ENTITYID, "");
	let isSchedulingEnabled = env.getBooleanByKeyExt(oFF.XEnvironmentConstants.FIREFLY_FPA_ENABLE_SCHEDULING_FOR_OEM, false);
	let scope = isSchedulingEnabled ? "&scope=offline_access" : "&scope=openid";
	let buffer = oFF.XStringBuffer.create().append(idpUrl).append(oFF.FpaOpenIdTokenLoadAction.OPENID_AUTH_URI_ENDPOINT).append("?response_type=code").append(scope).append("&client_id=").append(this.m_clientId).append("&redirect_uri=").append(this.m_redirectUri);
	return buffer.toString();
};
oFF.FpaOpenIdTokenLoadAction.prototype.onFunctionExecuted = function(extResult, response, customIdentifier)
{
	this.addAllMessages(extResult);
	if (extResult.isValid())
	{
		let responseJson = response.getRootElement();
		if (oFF.isNull(responseJson))
		{
			let systemNotFoundError = oFF.XStringUtils.concatenate2("System not found ", this.m_systemName);
			this.addError(0, systemNotFoundError);
			this.log(systemNotFoundError);
			this.endSync();
		}
		else
		{
			if (customIdentifier === oFF.FpaOpenIdWorkflowType.CLIENT_ID)
			{
				this.m_clientId = responseJson.getStringByKey(oFF.FpaOpenIdTokenLoadAction.CLIENT_ID);
				let url = this.getUrl();
				let listener = oFF.LambdaEventMessageListenerCloseableWindow.createNew((data) => {
					this.extractData(data);
					this.processWorkflow(oFF.SyncType.NON_BLOCKING, oFF.FpaOpenIdWorkflowType.TOKEN);
				}, () => {
					this.addError(oFF.HttpErrorCode.HTTP_SAML_TIMEOUT, oFF.HttpErrorMessage.AUTHENTICATION_TIMEOUT);
					this.log(oFF.HttpErrorMessage.AUTHENTICATION_TIMEOUT);
					this.endSync();
				}, () => {
					this.addError(oFF.HttpErrorCode.HTTP_NOT_AUTHENTICATED, oFF.HttpErrorMessage.AUTHENTICATION_CANCELLED);
					this.log(oFF.HttpErrorMessage.AUTHENTICATION_CANCELLED);
					this.endSync();
				});
				if (this.m_isPopupEnabled)
				{
					let state = oFF.PopupHandler.getNewStateValue();
					let authWindow = oFF.PopupHandler.createPopup(url, listener, state, this.getSession());
					let windowOpened = authWindow.isOpen();
					if (!windowOpened)
					{
						this.addError(oFF.HttpErrorCode.HTTP_SAML_POPUP_BLOCKED, "SAML_POPUP_BLOCKED");
						this.endSync();
					}
				}
				else
				{
					oFF.IframeHandler.createMessageIframe(url, listener, oFF.MessageIframeOption.OPEN_ID);
				}
			}
			if (customIdentifier === oFF.FpaOpenIdWorkflowType.TOKEN)
			{
				let bearerToken = responseJson.getStringByKey(oFF.FpaOpenIdTokenLoadAction.ACCESS_TOKEN);
				let expiresIn = responseJson.getIntegerByKeyExt(oFF.FpaOpenIdTokenLoadAction.EXPIRES_IN, -1);
				let tokenType = responseJson.getStringByKey(oFF.FpaOpenIdTokenLoadAction.TOKEN_TYPE);
				if (oFF.notNull(bearerToken))
				{
					let tokenDetailsMap = oFF.FpaOpenIdTokenLoadAction.getTokenDetailsMap(bearerToken, expiresIn, tokenType);
					this.setData(tokenDetailsMap);
					this.endSync();
				}
				else
				{
					let noBearerTokenError = "No bearer token returned.";
					this.addError(0, noBearerTokenError);
					this.log(noBearerTokenError);
					this.endSync();
				}
			}
		}
	}
	else
	{
		this.endSync();
	}
};
oFF.FpaOpenIdTokenLoadAction.prototype.processSynchronization = function(syncType)
{
	this.processWorkflow(syncType, oFF.FpaOpenIdWorkflowType.CLIENT_ID);
	return true;
};
oFF.FpaOpenIdTokenLoadAction.prototype.processWorkflow = function(syncType, workflowIdentifier)
{
	let uri = this.getUri(workflowIdentifier);
	let connection = this.getActionContext();
	let ocpFunction = connection.newRpcFunctionByUri(uri);
	ocpFunction.setServiceName(oFF.SystemServices.SAC_SERVICE);
	let request = ocpFunction.getRpcRequest();
	request.setRequestStructure(this.getQuery(workflowIdentifier));
	ocpFunction.processFunctionExecution(syncType, this, workflowIdentifier);
};
oFF.FpaOpenIdTokenLoadAction.prototype.releaseObjectInternal = function() {};

