oFF.OAuthTokenLoadAction.prototype.m_codeVerifier = null;
oFF.OAuthTokenLoadAction.prototype.m_saml2idpParam = null;
oFF.OAuthTokenLoadAction.prototype.m_systemUrl = null;
oFF.OAuthTokenLoadAction.prototype.buildHttpRequest = function()
{
	let url = oFF.XStringUtils.concatenate2(this.m_systemUrl, oFF.OAuthTokenLoadAction.MOBILE_TOKEN_URI_ENDPOINT);
	let tokenParams = this.getTokenParams();
	let serviceRequest = oFF.HttpRequest.createByUrl(url);
	serviceRequest.setString(tokenParams);
	serviceRequest.setContentType(oFF.ContentType.APPLICATION_FORM);
	serviceRequest.setMethod(oFF.HttpRequestMethod.HTTP_POST);
	serviceRequest.setProxyType(oFF.ProxyType.NONE);
	serviceRequest.setCorsSecured(false);
	return serviceRequest;
};
