oFF.OAuthTokenLoadAction.prototype.extractData = function(msgData)
{
	let data = oFF.XJson.extractJsonContent(msgData).asStructure();
	this.m_authCode = data.getStringByKey("code");
};
oFF.OAuthTokenLoadAction.prototype.getAuthCode = function(syncType)
{
	let oAuthUtils = oFF.OAuthUtils.getInstance();
	this.m_codeVerifier = oAuthUtils.generateCodeVerifier();
	let codeChallengePromise = oAuthUtils.generateCodeChallenge(this.m_codeVerifier);
	if (oFF.notNull(codeChallengePromise))
	{
		codeChallengePromise.onThen((codeChallenge) => {
			this.m_codeChallenge = codeChallenge;
			this.m_saml2idpParam = this.getSaml2IdpParam();
			let url = this.getAuthCodeUrl();
			let listener = oFF.LambdaEventMessageListenerCloseableWindow.createNew((data) => {
				this.extractData(data);
				this.processWorkflow(syncType);
			}, () => {
				this.addError(oFF.HttpErrorCode.HTTP_OAUTH_TIMEOUT, oFF.HttpErrorMessage.AUTHENTICATION_TIMEOUT);
				this.log(oFF.HttpErrorMessage.AUTHENTICATION_TIMEOUT);
				this.endSync();
			}, () => {
				this.addError(oFF.HttpErrorCode.HTTP_NOT_AUTHENTICATED, oFF.HttpErrorMessage.AUTHENTICATION_CANCELLED);
				this.log(oFF.HttpErrorMessage.AUTHENTICATION_CANCELLED);
				this.endSync();
			});
			let state = oFF.PopupHandler.getNewStateValue();
			let popup = oFF.PopupHandler.createPopup(url, listener, state, this.getSession());
			if (!popup.isOpen())
			{
				this.addError(oFF.HttpErrorCode.HTTP_SAML_POPUP_BLOCKED, "SAML_POPUP_BLOCKED");
				this.endSync();
			}
			let pool = this.getActionContext().getConnectionPool();
			pool.registerOAuthAccessCodeConsumer(state, (data) => {
				popup.closePopup();
				listener.onMessageReceived(data);
			});
		}).onCatch((error) => {
			this.addError(0, error.getText());
			this.endSync();
		});
	}
	else
	{
		let error = "Code generation failed";
		this.addError(0, error);
		this.log(error);
		this.endSync();
	}
};
oFF.OAuthTokenLoadAction.prototype.getAuthCodeUrl = function()
{
	let buffer = oFF.XStringBuffer.create().append(this.m_systemUrl).append(oFF.OAuthTokenLoadAction.MOBILE_AUTH_URI_ENDPOINT).append("response_type=code").append(this.m_saml2idpParam).append("&code_challenge_method=S256").append("&client_id=").append(oFF.OAuthTokenLoadAction.OAUTH_CLIENT_ID).append("&redirect_uri=").append(oFF.OAuthTokenLoadAction.OAUTH_CLIENT_REDIRECT_URI).append("&code_challenge=").append(this.m_codeChallenge);
	return buffer.toString();
};
oFF.OAuthTokenLoadAction.prototype.getSaml2IdpParam = function()
{
	let isDWCConnection = this.getActionContext().getSystemDescription().isDWCConnection();
	if (isDWCConnection)
	{
		let location = oFF.NetworkEnv.getLocation();
		let saml2Idp = location.getQueryMap().getByKey("saml2idp");
		if (oFF.notNull(saml2Idp))
		{
			oFF.XUriUtils.validateUri(saml2Idp);
			return oFF.XStringUtils.concatenate2("&saml2idp=", saml2Idp);
		}
	}
	return "";
};
oFF.OAuthTokenLoadAction.prototype.getToken = function()
{
	let serviceRequest = this.buildHttpRequest();
	oFF.XFetch.requestStructure(this.getActionContext().getSession(), serviceRequest).onThen((responseJson) => {
		if (oFF.isNull(responseJson))
		{
			let systemNotFoundError = "System not found";
			this.addError(0, systemNotFoundError);
			this.log(systemNotFoundError);
			this.endSync();
		}
		else
		{
			let bearerToken = responseJson.getStringByKey(oFF.OAuthTokenLoadAction.ACCESS_TOKEN);
			let expiresIn = responseJson.getIntegerByKeyExt(oFF.OAuthTokenLoadAction.EXPIRES_IN, -1);
			let tokenType = responseJson.getStringByKey(oFF.OAuthTokenLoadAction.TOKEN_TYPE);
			if (oFF.notNull(bearerToken))
			{
				let tokenDetailsMap = oFF.OAuthTokenLoadAction.getTokenDetailsMap(bearerToken, expiresIn, tokenType);
				this.setData(tokenDetailsMap);
				this.endSync();
			}
			else
			{
				let noBearerTokenError = "No bearer token returned.";
				this.addError(0, noBearerTokenError);
				this.log(noBearerTokenError);
				this.endSync();
			}
		}
	}).onCatch((error) => {
		this.addError(0, error.getText());
		this.endSync();
	});
};
oFF.OAuthTokenLoadAction.prototype.getTokenParams = function()
{
	let buffer = oFF.XStringBuffer.create().append("grant_type=authorization_code").append("&code=").append(this.m_authCode).append("&redirect_uri=").append(oFF.OAuthTokenLoadAction.OAUTH_CLIENT_REDIRECT_URI).append("&client_id=").append(oFF.OAuthTokenLoadAction.OAUTH_CLIENT_ID).append("&code_verifier=").append(this.m_codeVerifier);
	return buffer.toString();
};
oFF.OAuthTokenLoadAction.prototype.processSynchronization = function(syncType)
{
	this.processWorkflow(syncType);
	return true;
};
oFF.OAuthTokenLoadAction.prototype.processWorkflow = function(syncType)
{
	if (oFF.isNull(this.m_authCode))
	{
		this.getAuthCode(syncType);
	}
	else
	{
		this.getToken();
	}
};
oFF.OAuthTokenLoadAction.prototype.releaseObjectInternal = function() {};

