oFF.XEncoderSecretsFetchAction = function() {};
oFF.XEncoderSecretsFetchAction.prototype = new oFF.SyncAction();
oFF.XEncoderSecretsFetchAction.prototype._ff_c = "XEncoderSecretsFetchAction";

oFF.XEncoderSecretsFetchAction.ERROR_EMPTY_RESPONSE = 1000;
oFF.XEncoderSecretsFetchAction.ERROR_IMPORT_TOKEN = 1001;
oFF.XEncoderSecretsFetchAction.ERROR_INVALID_RESPONSE = 1002;
oFF.XEncoderSecretsFetchAction.ERROR_WRONG_SYSTEM_NAME = 1003;
oFF.XEncoderSecretsFetchAction.URL_ENCRYPTION_TOKEN_SAC = "/sap/fpa/services/rest/epm/session";
oFF.XEncoderSecretsFetchAction.createAndRun = function(syncType, listener, customIdentifier, context)
{
	let newAction = new oFF.XEncoderSecretsFetchAction();
	newAction.m_customIdentifier = customIdentifier;
	newAction.setupActionAndRun(syncType, listener, customIdentifier, context);
	return newAction;
};
oFF.XEncoderSecretsFetchAction.getRequestPayload = function()
{
	let requestPayload = oFF.PrFactory.createStructure();
	requestPayload.putString("action", "fetchCacheKey");
	requestPayload.putNewStructure("data").putString("id", oFF.DfEncoderAES.ENCRYPTION_MODE);
	return requestPayload;
};
oFF.XEncoderSecretsFetchAction.prototype.m_customIdentifier = null;
oFF.XEncoderSecretsFetchAction.prototype.callListener = function(extResult, listener, data, customIdentifier)
{
	if (extResult.hasErrors())
	{
		listener.onEncoderSecretsFetchError(extResult, customIdentifier);
	}
	else
	{
		listener.onEncoderSecretsFetched(data);
	}
};
oFF.XEncoderSecretsFetchAction.prototype.endSyncWithError = function(errorCode, errorMessage)
{
	this.addError(errorCode, errorMessage);
	this.log(errorMessage);
	this.endSync();
};
oFF.XEncoderSecretsFetchAction.prototype.onFunctionExecuted = function(extResult, response, customIdentifier)
{
	this.addAllMessages(extResult);
	if (!extResult.isValid())
	{
		this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_INVALID_RESPONSE, "Invalid response!");
		return;
	}
	let jsonRoot = response.getRootElement();
	this.processSecrets(jsonRoot);
};
oFF.XEncoderSecretsFetchAction.prototype.processSecrets = function(jsonRoot)
{
	if (oFF.isNull(jsonRoot))
	{
		this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_EMPTY_RESPONSE, "Invalid response: empty or not json!");
		return;
	}
	let jsonCurrentKey = jsonRoot.getStructureByKey("key");
	if (oFF.isNull(jsonCurrentKey))
	{
		this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_IMPORT_TOKEN, "Invalid response: key attribute missing!");
		return;
	}
	let jsonCurrentKeyContent = jsonCurrentKey.getStructureByKey("content");
	if (oFF.isNull(jsonCurrentKeyContent))
	{
		this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_IMPORT_TOKEN, "Invalid response: content attribute missing!");
		return;
	}
	oFF.XEncoderSecretFactory.getInstance().createAESSecretFromJsonString(jsonCurrentKeyContent.toString()).onThen((currentSecret) => {
		let currentSecrets = oFF.XEncoderSecrets.create(currentSecret, null);
		let jsonExpiredKey = jsonRoot.getStructureByKey("expiredKey");
		if (oFF.notNull(jsonExpiredKey))
		{
			let jsonExpiredKeyContent = jsonExpiredKey.getStructureByKey("content");
			if (oFF.notNull(jsonExpiredKeyContent))
			{
				oFF.XEncoderSecretFactory.getInstance().createAESSecretFromJsonString(jsonExpiredKeyContent.toString()).onThen((expiredSecret) => {
					currentSecrets.setExpiredSecret(expiredSecret);
					this.setData(currentSecrets);
					this.endSync();
				}).onCatch((error) => {
					this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_IMPORT_TOKEN, "Cannot import expired token!");
				});
				return;
			}
		}
		this.setData(currentSecrets);
		this.endSync();
	}).onCatch((error) => {
		this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_IMPORT_TOKEN, "Cannot import current token!");
	});
};
oFF.XEncoderSecretsFetchAction.prototype.processSynchronization = function(syncType)
{
	let process = this.getActionContext();
	let encryptionTokenUrl = process.getEnvironment().getStringByKey(oFF.XEnvironmentConstants.FIREFLY_ENCRYPTION_TOKEN_URL);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(encryptionTokenUrl))
	{
		oFF.XFetch.fetchStructure(process.getSession(), encryptionTokenUrl).onThen(this.processSecrets.bind(this)).onCatch((fetchError) => {
			this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_INVALID_RESPONSE, "Invalid api data response!");
		});
		return true;
	}
	let systemName = process.getEnvironment().getStringByKey(oFF.XEnvironmentConstants.FIREFLY_MAIN_CLIB_SYS);
	if (oFF.isNull(systemName))
	{
		this.endSyncWithError(oFF.XEncoderSecretsFetchAction.ERROR_WRONG_SYSTEM_NAME, "Wrong system name!");
		return false;
	}
	let connectionPool = process.getConnectionPool();
	if (oFF.isNull(connectionPool))
	{
		connectionPool = oFF.ConnectionPool.create(process);
		process.setEntity(oFF.ProcessEntity.CONNECTION_POOL, connectionPool);
	}
	let connection = connectionPool.getConnection(systemName);
	let uri = oFF.XUri.createFromUrl(oFF.XEncoderSecretsFetchAction.URL_ENCRYPTION_TOKEN_SAC);
	let rpcFunction = connection.newRpcFunctionByUri(uri);
	rpcFunction.setServiceName(oFF.SystemServices.SAC_SERVICE);
	let rpcRequest = rpcFunction.getRpcRequest();
	rpcRequest.setMethod(oFF.HttpRequestMethod.HTTP_POST);
	rpcRequest.setRequestStructure(oFF.XEncoderSecretsFetchAction.getRequestPayload());
	rpcFunction.processFunctionExecution(syncType, this, this.m_customIdentifier);
	return true;
};
oFF.XEncoderSecretsFetchAction.prototype.releaseObjectInternal = function() {};

