oFF.XRemoteHttpFile.prototype.processProviderDelete = function(syncType, listener, customIdentifier)
{
	let listenerAdapter = oFF.XRemoteHttpFileRequestAdapter.create((fileRequestAction) => {
		let data = fileRequestAction.getData();
		if (oFF.notNull(listener))
		{
			listener.onFileProviderDeleted(fileRequestAction, data, customIdentifier);
		}
	});
	let requestAction = oFF.XRemoteHttpFileRequestAction.create(syncType, this, listenerAdapter, oFF.XRemoteHttpFileRequestAction.DELETE);
	requestAction.process();
	return requestAction;
};
oFF.XRemoteHttpFile.prototype.processProviderFetchChildren = function(syncType, listener, customIdentifier, config)
{
	let sync = this.processInternalLoad(syncType, oFF.XRemoteHttpFileRequestAdapter.create((fileRequestAction) => {
		let data = fileRequestAction.getData();
		if (oFF.notNull(listener))
		{
			if (!this.getProviderIsExisting() && data.getProviderChildFiles() === null)
			{
				data.setChildMetadata(oFF.XList.create(), 0);
			}
			listener.onFileProviderChildrenFetched(fileRequestAction, data, data.getProviderChildFiles(), data.getProviderChildrenResultset(), customIdentifier);
		}
	}));
	return sync;
};
