oFF.XFileSystemManager.prototype.setWorkingDirectoryUri = function(directory)
{
	this.validateFs();
	if (oFF.notNull(directory))
	{
		let protocolType = directory.getProtocolType();
		let activeFileSystem = this.getActiveFileSystem();
		let fsProtocolType = activeFileSystem.getProtocolType();
		if (protocolType === fsProtocolType)
		{
			this.m_workingDirectory = directory;
			if (oFF.notNull(this.m_workingDirectoryChangedConsumers))
			{
				this.m_workingDirectoryChangedConsumers.accept(directory);
			}
		}
		else
		{
			this.log2("New working directory uri is not matching fs: ", directory.toString());
		}
	}
};
