oFF.XFileProviderClassic.prototype.getFileAttributes = function(metadata)
{
	let isExisting = this.isExisting();
	metadata.putBoolean(oFF.XFileAttribute.IS_EXISTING, isExisting);
	if (isExisting === true)
	{
		let attributes = this.getProviderAttributes();
		if (oFF.notNull(attributes))
		{
			metadata.putAll(attributes);
		}
		if (metadata.containsKey(oFF.XFileAttribute.DISPLAY_NAME) === false)
		{
			metadata.putStringNotNull(oFF.XFileAttribute.DISPLAY_NAME, this.getDisplayName());
		}
		if (metadata.containsKey(oFF.XFileAttribute.DESCRIPTION) === false)
		{
			metadata.putStringNotNull(oFF.XFileAttribute.DESCRIPTION, this.getDescription());
		}
		if (metadata.containsKey(oFF.XFileAttribute.IS_DIRECTORY) === false)
		{
			metadata.putBoolean(oFF.XFileAttribute.IS_DIRECTORY, this.isDirectory());
		}
		if (metadata.containsKey(oFF.XFileAttribute.IS_FILE) === false)
		{
			metadata.putBoolean(oFF.XFileAttribute.IS_FILE, this.isFile());
		}
		if (metadata.containsKey(oFF.XFileAttribute.IS_HIDDEN) === false)
		{
			metadata.putBoolean(oFF.XFileAttribute.IS_HIDDEN, this.isHidden());
		}
		if (metadata.containsKey(oFF.XFileAttribute.IS_EXECUTABLE) === false)
		{
			metadata.putBoolean(oFF.XFileAttribute.IS_EXECUTABLE, this.isExecutable());
		}
		if (metadata.containsKey(oFF.XFileAttribute.IS_READABLE) === false)
		{
			metadata.putBoolean(oFF.XFileAttribute.IS_READABLE, this.isReadable());
		}
		if (metadata.containsKey(oFF.XFileAttribute.IS_WRITEABLE) === false)
		{
			metadata.putBoolean(oFF.XFileAttribute.IS_WRITEABLE, this.isWriteable());
		}
		if (metadata.containsKey(oFF.XFileAttribute.SIZE) === false)
		{
			metadata.putLong(oFF.XFileAttribute.SIZE, this.getSize());
		}
		if (metadata.containsKey(oFF.XFileAttribute.CHANGED_AT) === false)
		{
			metadata.putLong(oFF.XFileAttribute.CHANGED_AT, this.getLastModifiedTimestamp());
		}
	}
};
