oFF.ModuleLoadAction.prototype.callListener = function(extResult, listener, data, customIdentifier)
{
	listener.onModuleLoadedMulti(extResult, data, customIdentifier);
};
oFF.ModuleLoadAction.prototype.collectRecursive = function(name, allRemainingModules, modulesToBeLoaded)
{
	let isModuleLoaded = false;
	let module = oFF.ModuleManager.getModuleDef(name);
	if (oFF.isNull(module))
	{
		this.addErrorExt(oFF.OriginLayer.KERNEL, 2, oFF.XStringUtils.concatenate2("Cannot find module: ", name), null);
	}
	else
	{
		let loadStatus = module.getLoadStatus();
		if (loadStatus === oFF.ResourceStatus.FAILED)
		{
			this.addErrorExt(oFF.OriginLayer.KERNEL, 2, oFF.XStringUtils.concatenate2("Module could not be loaded: ", name), null);
		}
		else if (loadStatus === oFF.ResourceStatus.SUCCESS)
		{
			isModuleLoaded = true;
		}
		else
		{
			if (allRemainingModules.contains(module) === false)
			{
				let dependencies = module.getDependencies();
				let areAllChildrenLoaded = false;
				if (dependencies.size() > 0)
				{
					areAllChildrenLoaded = true;
					for (let i = 0; i < dependencies.size(); i++)
					{
						let subModuleName = dependencies.get(i);
						let isChildLoaded = this.collectRecursive(subModuleName, allRemainingModules, modulesToBeLoaded);
						if (isChildLoaded === false)
						{
							areAllChildrenLoaded = false;
						}
					}
				}
				else
				{
					areAllChildrenLoaded = true;
				}
				if (module.getInitClazzNameCompatible() !== null)
				{
					allRemainingModules.add(module);
					if (loadStatus === oFF.ResourceStatus.INITIAL)
					{
						if (areAllChildrenLoaded)
						{
							modulesToBeLoaded.add(module);
						}
					}
				}
				if (module.getType() === oFF.ResourceType.JAVASCRIPT && loadStatus === oFF.ResourceStatus.INITIAL)
				{
					allRemainingModules.add(module);
					modulesToBeLoaded.add(module);
				}
			}
		}
	}
	return isModuleLoaded;
};
oFF.ModuleLoadAction.prototype.detectCombinedModule = function(allRemainingModules, modulesToBeLoaded)
{
	let hasCombinedModule = false;
	let allContainerModules = oFF.ModuleManager.getAllContainerModules();
	for (let k = 0; k < allContainerModules.size(); k++)
	{
		let resourceDef = allContainerModules.get(k);
		let currentContainerResources = resourceDef.getAllContainerResources();
		let combo1 = oFF.XHashSetOfString.create();
		for (let m = 0; m < currentContainerResources.size(); m++)
		{
			let resource = currentContainerResources.get(m);
			let resName = resource.getName();
			combo1.add(resName);
		}
		for (let i = 0; i < allRemainingModules.size(); i++)
		{
			let currentModule = allRemainingModules.get(i);
			let name = currentModule.getName();
			combo1.removeElement(name);
			if (combo1.size() === 0)
			{
				hasCombinedModule = true;
				this.log4("Found combination: ", resourceDef.getName(), " having: ", resourceDef.getAllContainerResources().toString());
				this.manipulate(modulesToBeLoaded, resourceDef);
				break;
			}
		}
	}
	return hasCombinedModule;
};
oFF.ModuleLoadAction.prototype.enlistModules = function(list)
{
	let buffer = oFF.XStringBuffer.create();
	for (let i = 0; i < list.size(); i++)
	{
		if (i > 0)
		{
			buffer.append(",");
		}
		let ref = list.get(i);
		buffer.append(ref.toString());
		if (ref.getType() === oFF.ResourceType.CONTAINER)
		{
			buffer.append(" *{");
			buffer.append(ref.getAllContainerResources().toString());
			buffer.append("}");
		}
	}
	return buffer.toString();
};
oFF.ModuleLoadAction.prototype.findModule = function(name)
{
	let currentModule = oFF.DfModule.getFirstModule();
	while (oFF.notNull(currentModule))
	{
		if (oFF.XString.isEqual(currentModule.getName(), name))
		{
			break;
		}
		currentModule = currentModule.getNextModule();
	}
	return currentModule;
};
oFF.ModuleLoadAction.prototype.getLogLayer = function()
{
	return oFF.OriginLayer.KERNEL;
};
oFF.ModuleLoadAction.prototype.getProcess = function()
{
	return this.getSession();
};
oFF.ModuleLoadAction.prototype.manipulate = function(modulesToBeLoaded, resourceDef)
{
	let currentContainerResources = resourceDef.getAllContainerResources();
	for (let g = 0; g < currentContainerResources.size(); g++)
	{
		let resource2 = currentContainerResources.get(g);
		let resName2 = resource2.getName();
		for (let r = 0; r < modulesToBeLoaded.size(); r++)
		{
			let element = modulesToBeLoaded.get(r);
			if (oFF.XString.isEqual(element.getName(), resName2))
			{
				modulesToBeLoaded.removeAt(r);
				break;
			}
		}
	}
	modulesToBeLoaded.insert(0, resourceDef);
};
oFF.ModuleLoadAction.prototype.onModuleInitialized = function(module, isValid, message, duration)
{
	let moduleName = module.getName();
	let moduleDef = oFF.ModuleManager.getModuleDef(moduleName);
	if (isValid)
	{
		moduleDef.setLoadStatus(oFF.ResourceStatus.SUCCESS);
	}
	else
	{
		moduleDef.setLoadStatus(oFF.ResourceStatus.FAILED);
		this.addErrorWithMessage(message);
	}
	this.processSynchronization(this.getActiveSyncType());
};
oFF.ModuleLoadAction.prototype.onModuleLoaded = function(messages, moduleName, hasBeenLoaded, customIdentifier)
{
	let doContinue = true;
	if (oFF.notNull(messages))
	{
		this.addAllMessages(messages);
	}
	let moduleDef = oFF.ModuleManager.getModuleDef(moduleName);
	if (hasBeenLoaded === true)
	{
		this.log2("Module was loaded: ", moduleName);
		let module = this.findModule(moduleName);
		if (module.hasDynamicInit())
		{
			doContinue = false;
			moduleDef.setLoadStatus(oFF.ResourceStatus.DYNAMIC_INITIALIZING);
			let moduleManager = this.getActionContext();
			let kernel = moduleManager.getKernel();
			module.processDynamicInit(kernel, this);
		}
		else
		{
			moduleDef.setLoadStatus(oFF.ResourceStatus.SUCCESS);
		}
	}
	else
	{
		this.log2("Error loading module: ", moduleName);
		moduleDef.setLoadStatus(oFF.ResourceStatus.FAILED);
	}
	if (doContinue)
	{
		this.processSynchronization(this.getActiveSyncType());
	}
};
oFF.ModuleLoadAction.prototype.prepareDefinitions = function(allRemainingModules, modulesToBeLoaded)
{
	for (let i = 0; i < this.m_rootModuleNames.size(); i++)
	{
		let moduleName = this.m_rootModuleNames.get(i);
		this.collectRecursive(moduleName, allRemainingModules, modulesToBeLoaded);
	}
};
oFF.ModuleLoadAction.prototype.processSynchronization = function(syncType)
{
	let continueWork = false;
	let moduleManager = this.getActionContext();
	let session = moduleManager.getSession();
	let environment = session.getEnvironment();
	let parallelLoad = environment.getBooleanByKeyExt(oFF.XEnvironmentConstants.FIREFLY_PARALLEL_MODULE_LOAD, true);
	let allRemainingModules = oFF.XList.create();
	let modulesToBeLoaded = oFF.XListOfNameObject.create();
	this.prepareDefinitions(allRemainingModules, modulesToBeLoaded);
	if (oFF.isNull(this.m_loader))
	{
		this.addErrorExt(oFF.OriginLayer.KERNEL, 0, "No module loader available", null);
	}
	else if (this.isValid() && allRemainingModules.size() > 0)
	{
		continueWork = true;
		if (this.m_hasLogInfo === false)
		{
			if (allRemainingModules.size() > 0)
			{
				this.log2("Start: All modules to be loaded: ", allRemainingModules.toString());
			}
			this.m_hasLogInfo = true;
		}
		if (modulesToBeLoaded.size() > 0)
		{
			this.detectCombinedModule(allRemainingModules, modulesToBeLoaded);
			let output = this.enlistModules(modulesToBeLoaded);
			let loadingCount = modulesToBeLoaded.size();
			if (parallelLoad === false && loadingCount > 1)
			{
				loadingCount = 1;
			}
			if (loadingCount > 1)
			{
				this.log2("Loading modules in parallel: ", output);
			}
			else
			{
				this.log2("Loading single module: ", output);
			}
			for (let i = 0; i < loadingCount; i++)
			{
				let moduleDef = modulesToBeLoaded.get(i);
				moduleDef.setLoadStatus(oFF.ResourceStatus.LOADING);
				this.m_loader.processModuleLoad(syncType, this, null, this.getProcess(), moduleDef, oFF.XApiVersion.GIT_COMMIT_ID);
			}
		}
	}
	if (continueWork === false)
	{
		this.endSync();
	}
	return continueWork;
};
