oFF.ConnectionPool.prototype.createDirectDWCConnection = function(systemDescription)
{
	let alternateDirectConnectionName = this.buildDWCDirectConnectionName(systemDescription);
	let properties = oFF.XProperties.create();
	let keysIterator = systemDescription.getProperties().getKeysAsIterator();
	let isOriginalHostPresent = false;
	while (keysIterator.hasNext())
	{
		let key = keysIterator.next();
		let propertyValue = systemDescription.getProperties().getByKey(key);
		if (oFF.XString.isEqual(key, "ORIGINAL_HOST") && oFF.notNull(propertyValue))
		{
			isOriginalHostPresent = true;
		}
		properties.put(key, propertyValue);
	}
	let alternateSystemDesc = oFF.SystemDescription.create(this.getSystemLandscape(), alternateDirectConnectionName, properties);
	alternateSystemDesc.setProperty("FPA_CONNECTION_TYPE", oFF.ConnectionParameters.DWC_CONNECTION_DIRECT_TYPE_NAME);
	alternateSystemDesc.setProperty("DISPLAY_NAME", alternateDirectConnectionName);
	alternateSystemDesc.setProperty(oFF.ConnectionParameters.DWC_CONNECTION_METADATA_ORIGINAL_DISPLAY_NAME, systemDescription.getSystemName());
	alternateSystemDesc.setProperty("PORT", "443");
	alternateSystemDesc.setProperty("FPA_USE_FIREFLY_AUTHENTICATION", "true");
	alternateSystemDesc.setProperty("FPA_IS_LIVE_INTEGRATION", "true");
	alternateSystemDesc.setProperty("AUTHENTICATION_TYPE", "OAUTH_WITH_PKCE");
	alternateSystemDesc.setProperty("FPA_AUTHENTICATION_METHOD", "OAUTH");
	alternateSystemDesc.setProperty("PREFIX", "");
	if (isOriginalHostPresent)
	{
		alternateSystemDesc.setProperty("HOST", systemDescription.getProperties().getByKey("ORIGINAL_HOST"));
	}
	alternateSystemDesc.setProperty("WEBDISPATCHER_URI", "$protocol$://$host$:$port$/dwaas-core$path$");
	alternateSystemDesc.setProperty("CONTEXT_PATH", "/dwaas-core");
	this.getSystemLandscape().setSystemByDescription(alternateSystemDesc);
	let directSystemConnect = oFF.SystemConnect.create(this, alternateDirectConnectionName, alternateSystemDesc);
	this.m_systemConnectSet.add(directSystemConnect);
	return directSystemConnect;
};
