oFF.ConnectionPool.prototype.getSystemConnectExt = function(systemName, createIfNotExist)
{
	let sysName = this.resolveSystemName(systemName);
	let systemConnectToReturn = this.m_systemConnectSet.getByKey(sysName);
	let systemDescription = this.getSystemLandscape().getSystemDescription(sysName);
	oFF.XObjectExt.assertNotNullExt(systemDescription, oFF.XStringUtils.concatenate3("System cannot be resolved: '", systemName, "'"));
	if (oFF.isNull(systemConnectToReturn) && createIfNotExist === true)
	{
		systemConnectToReturn = oFF.SystemConnect.create(this, sysName, systemDescription);
		this.m_systemConnectSet.add(systemConnectToReturn);
		if (this.isDwcTunnelConnection(systemDescription) && this.isDaProgram())
		{
			systemConnectToReturn = this.createDirectDWCConnection(systemDescription);
		}
	}
	else
	{
		if (this.isDwcTunnelConnection(systemDescription) && this.isDaProgram())
		{
			systemConnectToReturn = this.m_systemConnectSet.getByKey(this.buildDWCDirectConnectionName(systemDescription));
		}
	}
	return systemConnectToReturn;
};
