oFF.ConnectionPool.prototype.getTraceInfo = function(systemName)
{
	let systemConnect = this.getSystemConnectBase(systemName);
	let traceInfo = systemConnect.getTraceInfo();
	let process = this.getProcess();
	let env = process.getEnvironment();
	let enableTracing = env.getBooleanByKeyExt(oFF.XEnvironmentConstants.ENABLE_HTTP_FILE_TRACING, false);
	if (enableTracing)
	{
		if (oFF.isNull(traceInfo) || traceInfo.getTraceType() !== oFF.TraceType.FILE)
		{
			let tracingFolder = env.getVariable(oFF.XEnvironmentConstants.HTTP_FILE_TRACING_FOLDER);
			if (oFF.notNull(tracingFolder))
			{
				let tracingFolderFile = oFF.XFile.createByNativePath(process, tracingFolder);
				if (tracingFolderFile.isExisting() && tracingFolderFile.isDirectory())
				{
					let urlString = tracingFolderFile.getUrl();
					traceInfo = oFF.TraceInfo.create();
					traceInfo.setTraceFolderPath(urlString);
					traceInfo.setTraceType(oFF.TraceType.FILE);
					traceInfo.setTraceName(this.getProcess().getApplicationName());
					systemConnect.setTraceInfo(traceInfo);
					this.log2("Enabling file tracing: ", tracingFolder);
				}
			}
		}
	}
	if (oFF.isNull(traceInfo))
	{
		return this.getTraceInfoGlobal();
	}
	return traceInfo;
};
oFF.ConnectionPool.prototype.getTraceInfoGlobal = function()
{
	if (oFF.isNull(this.m_traceInfoGlobal))
	{
		let traceName = oFF.XEnvironment.getInstance().getStringByKey(oFF.XEnvironmentConstants.FIREFLY_TRACE_NAME);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(traceName))
		{
			let traceInfo = oFF.TraceInfo.create();
			traceInfo.setTraceType(oFF.TraceType.URL);
			traceInfo.setTraceName(traceName);
			let recordingKeyMode = oFF.XEnvironment.getInstance().getStringByKey(oFF.XEnvironmentConstants.FIREFLY_WEBDISPATCHER_RECORDING_KEY_MODE);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(recordingKeyMode))
			{
				traceInfo.addAdditionalInformation(oFF.RpcRequestConstants.REQUEST_PARAM_TRACE_REQ_KEY_MODE, recordingKeyMode);
			}
			this.m_traceInfoGlobal = traceInfo;
		}
	}
	return this.m_traceInfoGlobal;
};
