oFF.ConnectionPool.prototype.isDaProgram = function()
{
	let isDaProgram = false;
	let process = this.getProcess();
	let programName = null;
	if (oFF.notNull(process))
	{
		let programCfg = process.getProgramCfg();
		if (oFF.notNull(programCfg))
		{
			let program = programCfg.getProgram();
			if (oFF.notNull(program))
			{
				programName = program.getName();
				isDaProgram = oFF.XString.isEqual(programName, "@SubSys.FileSystem.fsdwc") || oFF.XString.isEqual(programName, "Horizon") || oFF.XString.isEqual(programName, "GalaxyDataStudio");
			}
		}
	}
	return isDaProgram;
};
oFF.ConnectionPool.prototype.isDwcTunnelConnection = function(systemDescription)
{
	let systemType = systemDescription.getFPAConnectionType();
	let isDWC = systemDescription.isDWCConnection();
	return oFF.XString.isEqual(oFF.ConnectionParameters.DWC_CONNECTION_TUNNEL_TYPE_NAME, systemType) && isDWC;
};
oFF.ConnectionPool.prototype.isInAMergeProcessingEnabled = function(systemName)
{
	let isInAMergeProcessing = false;
	let systemConnect = this.getSystemConnectBase(systemName);
	let sysConnections = systemConnect.getSharedConnections();
	if (!sysConnections.isEmpty())
	{
		for (let i = 0; i < sysConnections.size(); i++)
		{
			let connectionContainer = sysConnections.get(i);
			if (connectionContainer.isInAMergeProcessingEnabled())
			{
				isInAMergeProcessing = true;
			}
		}
	}
	return isInAMergeProcessing;
};
