oFF.ConnectionPool.prototype.setBatchMode = function(syncType, systemName, isBatchEnabled, listener, customIdentifier)
{
	let systemConnect = this.getSystemConnectBase(systemName);
	let sysConnections = systemConnect.getSharedConnections();
	if (isBatchEnabled && sysConnections.isEmpty())
	{
		let connection = systemConnect.getConnectionExt(false, systemName);
		connection.getServerMetadata();
	}
	systemConnect.setIsBatchEnabled(isBatchEnabled);
	if (this.isInAMergeProcessingEnabled(systemName))
	{
		this.setBatchModeForInAQueryMerge(syncType, sysConnections, systemName, isBatchEnabled);
	}
	else
	{
		for (let i = 0; i < sysConnections.size(); i++)
		{
			if (!isBatchEnabled && this.m_batchRsStreamingEnabled)
			{
				sysConnections.get(i).disableBatchModeWithRsStreaming(syncType, listener, customIdentifier);
			}
			sysConnections.get(i).setBatchModeEnabled(syncType, isBatchEnabled, listener, customIdentifier);
		}
	}
};
oFF.ConnectionPool.prototype.setBatchModeForInAQueryMerge = function(syncType, sysConnections, systemName, isBatchEnabled)
{
	if (!isBatchEnabled && oFF.notNull(this.m_inaMergeProcessor) && !this.m_inaMergeProcessor.isRequestsProcessed())
	{
		this.m_inaMergeProcessor.processInAMerge(syncType, systemName);
	}
	for (let i = 0; i < sysConnections.size(); i++)
	{
		sysConnections.get(i).setBatchModeEnabled(syncType, isBatchEnabled, null, null);
	}
};
