oFF.SubSysSystemLandscapePrg.prototype.prepareVfsSys = function()
{
	let fileSystemManager = this.getProcess().getFileSystemManager();
	let vfs = fileSystemManager.getFileSystem(oFF.ProtocolType.VFS);
	if (oFF.notNull(vfs))
	{
		let attributesSysFolder = oFF.PrFactory.createStructure();
		attributesSysFolder.putString(oFF.XFileAttribute.SEMANTIC_TYPE, "folder.systems");
		attributesSysFolder.putString(oFF.XFileAttribute.DESCRIPTION, "System Folder");
		vfs.addDirectory("/sys", attributesSysFolder);
		let process = this.getProcess();
		let systemLandscape = process.getSystemLandscape();
		let systemNames = systemLandscape.getSystemNames();
		for (let i = 0; i < systemNames.size(); i++)
		{
			let sysName = systemNames.get(i);
			let systemDescription = systemLandscape.getSystemDescription(sysName);
			let systemType = systemDescription.getSystemType();
			let isDwc = false;
			let contextPath = systemDescription.getProperties().getByKey("CONTEXT_PATH");
			if (oFF.XString.containsString(contextPath, "dwaas-core") || oFF.XString.containsString(contextPath, "dwc"))
			{
				isDwc = true;
			}
			let sysPath = oFF.XStringUtils.concatenate2("/sys/", sysName);
			let attributesSys = oFF.PrFactory.createStructure();
			attributesSys.putString(oFF.XFileAttribute.DESCRIPTION, systemDescription.getText());
			attributesSys.putString(oFF.XFileAttribute.DISPLAY_NAME, systemDescription.getName());
			attributesSys.putString(oFF.XFileAttribute.SEMANTIC_TYPE, "system");
			attributesSys.putString(oFF.XFileAttribute.OLAP_DATASOURCE_SYSTEM, sysName);
			vfs.addDirectory(sysPath, attributesSys);
			if (systemType.isTypeOf(oFF.SystemType.BW) || systemType.isTypeOf(oFF.SystemType.HANA))
			{
				let olapCatalogPath = oFF.XStringUtils.concatenate2(sysPath, "/olap");
				let olapMountUrl = oFF.XUri.createFromUrl(oFF.XStringUtils.concatenate3("fsolapcatalog://", sysName, "/"));
				vfs.addMountPointByUri(olapCatalogPath, olapMountUrl);
			}
			if (systemType.isTypeOf(oFF.SystemType.HANA))
			{
				if (systemDescription.getProperties().containsKey("FPA_IS_LIVE_INTEGRATION"))
				{
					attributesSys.putBoolean(oFF.XFileAttribute.OLAP_IS_LIVE_INTEGRATION, systemDescription.getProperties().getBooleanByKey("FPA_IS_LIVE_INTEGRATION"));
				}
				if (systemDescription.getProperties().containsKey("FPA_IS_EXTENDED_HANA_LIVE"))
				{
					attributesSys.putBoolean(oFF.XFileAttribute.OLAP_IS_EXTENDED_HANA_LIVE, systemDescription.getProperties().getBooleanByKey("FPA_IS_EXTENDED_HANA_LIVE"));
				}
			}
			let isOrca = systemType.isTypeOf(oFF.SystemType.ORCA);
			if (isOrca)
			{
				let clibPath = oFF.XStringUtils.concatenate2(sysPath, "/clib");
				let contentlibMountUrl = oFF.XUri.createFromUrl(oFF.XStringUtils.concatenate3("fscontentlib://", sysName, "/"));
				vfs.addMountPointByUri(clibPath, contentlibMountUrl);
				let sacUsersPath = oFF.XStringUtils.concatenate2(sysPath, "/sacusers");
				let sacUsersMountUrl = oFF.XUri.createFromUrl(oFF.XStringUtils.concatenate3("fssacusers://", sysName, "/"));
				vfs.addMountPointByUri(sacUsersPath, sacUsersMountUrl);
				let shortcutsPath = oFF.XStringUtils.concatenate2(sysPath, "/shortcuts");
				let shortcutsMountUrl = oFF.XUri.createFromUrl(oFF.XStringUtils.concatenate3("fsshortcuts://", sysName, "/"));
				vfs.addMountPointByUri(shortcutsPath, shortcutsMountUrl);
			}
			if (isDwc)
			{
				let dwcpath = oFF.XStringUtils.concatenate2(sysPath, "/dwc");
				let dwcMountUrl = oFF.XUri.createFromUrl(oFF.XStringUtils.concatenate3("fsdwc://", sysName, "/"));
				vfs.addMountPointByUri(dwcpath, dwcMountUrl);
			}
			let sysType = systemType.getName();
			attributesSys.putString(oFF.XFileAttribute.SYSTEM_TYPE, sysType);
		}
	}
};
oFF.SubSysSystemLandscapePrg.prototype.runProcess = function()
{
	let environment = this.getProcess().getEnvironment();
	let systemLandscapeUrl = environment.getVariable(oFF.XEnvironmentConstants.SYSTEM_LANDSCAPE_URI);
	let doCont;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(systemLandscapeUrl))
	{
		let uri = oFF.XUri.createFromFilePath(this.getProcess(), systemLandscapeUrl, oFF.PathFormat.AUTO_DETECT, oFF.VarResolveMode.DOLLAR, null);
		this.m_landscapeLoadAction = oFF.SystemLandscapeLoadAction.createAndRun(null, this, null, this, this.m_systemLandscape, uri);
		doCont = true;
	}
	else
	{
		this.onLandscapeNodeLoaded(oFF.SyncActionExtRes.createSyncAction(this.m_systemLandscape, null), this.m_systemLandscape, null);
		doCont = false;
	}
	return doCont;
};
oFF.SubSysSystemLandscapePrg.prototype.setup = function()
{
	oFF.DfProgramSubSys.prototype.setup.call( this );
	this.m_systemLandscape = oFF.StandaloneSystemLandscape.create(this);
};

