oFF.SystemDescription.prototype.setProperty = function(name, value)
{
	if (oFF.isNull(value))
	{
		this.m_connectionProperties.remove(name);
	}
	else
	{
		let actualValue = value;
		if (oFF.XString.isEqual(name, oFF.ConnectionParameters.LANGUAGE))
		{
			actualValue = oFF.XString.toUpperCase(value);
		}
		this.m_connectionProperties.put(name, actualValue);
	}
	if (oFF.XString.isEqual(name, oFF.ConnectionParameters.INA_CONTEXT_PATH))
	{
		if (oFF.isNull(value))
		{
			this.getServiceProperties(oFF.SystemServices.INA_SERVICE).remove(oFF.ConnectionParameters.PATH);
		}
		else
		{
			this.getServiceProperties(oFF.SystemServices.INA_SERVICE).put(oFF.ConnectionParameters.PATH, value);
		}
	}
	if (oFF.XString.isEqual(name, oFF.ConnectionParameters.DWC_CONTEXT_PATH))
	{
		if (oFF.isNull(value))
		{
			this.getServiceProperties(oFF.SystemServices.DWAASCORE_SERVICE).remove(oFF.ConnectionParameters.PATH);
		}
		else
		{
			this.getServiceProperties(oFF.SystemServices.DWAASCORE_SERVICE).put(oFF.ConnectionParameters.PATH, value);
		}
	}
	if (oFF.XString.isEqual(name, oFF.ConnectionParameters.SUPPORT_INFO))
	{
		this.setSupportsInASupportTool(oFF.XString.isEqual(value, "true"));
	}
};
