oFF.SystemDescription.prototype.setupExt = function(systemLandscape, name, properties, uri)
{
	if (oFF.notNull(systemLandscape))
	{
		this.m_landscape = oFF.XWeakReferenceUtil.getWeakRef(systemLandscape);
	}
	this.m_servicesProperties = oFF.XHashMapByString.create();
	this.m_connectionProperties = oFF.XProperties.create();
	this.m_systemMappings = oFF.XHashMapByString.create();
	let theUri = uri;
	if (oFF.notNull(properties))
	{
		let urlParameter = oFF.ConnectionParameters.URL;
		if (oFF.notNull(systemLandscape))
		{
			if (systemLandscape.enforceUseSecure())
			{
				urlParameter = oFF.ConnectionParameters.SECURE;
			}
		}
		let url = properties.getStringByKeyExt(urlParameter, null);
		if (oFF.notNull(url))
		{
			oFF.XObjectExt.assertNull(theUri);
			theUri = oFF.XUri.createFromUrl(url);
		}
	}
	if (oFF.notNull(theUri))
	{
		this.setUri(theUri);
	}
	if (oFF.notNull(properties))
	{
		let propertyIterator = properties.getKeysAsIterator();
		while (propertyIterator.hasNext())
		{
			let propertyKey = propertyIterator.next();
			let propertyValue = properties.getByKey(propertyKey);
			if (oFF.XString.startsWith(propertyKey, oFF.ConnectionParameters.MAPPING_SYSTEM_NAME))
			{
				let mappingId = oFF.XString.replace(propertyKey, oFF.ConnectionParameters.MAPPING_SYSTEM_NAME, "");
				let serializeTable = properties.getByKey(oFF.XStringUtils.concatenate2(oFF.ConnectionParameters.MAPPING_SERIALIZATION_TABLE, mappingId));
				let serializeSchema = properties.getByKey(oFF.XStringUtils.concatenate2(oFF.ConnectionParameters.MAPPING_SERIALIZATION_SCHEMA, mappingId));
				let deserializeTable = properties.getByKey(oFF.XStringUtils.concatenate2(oFF.ConnectionParameters.MAPPING_DESERIALIZATION_TABLE, mappingId));
				let deserializeSchema = properties.getByKey(oFF.XStringUtils.concatenate2(oFF.ConnectionParameters.MAPPING_DESERIALIZATION_SCHEMA, mappingId));
				this.m_systemMappings.put(propertyValue, oFF.SystemMapping.create(serializeTable, serializeSchema, deserializeTable, deserializeSchema));
			}
			this.setProperty(propertyKey, propertyValue);
		}
	}
	if (oFF.notNull(name))
	{
		this.setSystemName(name);
	}
	this.m_capabilitiesIncludelist = oFF.XHashMapByString.create();
	this.m_capabilitiesExcludelist = oFF.XHashMapByString.create();
	this.m_nativeConnection = null;
};
