oFF.SystemDescription.prototype.toString = function()
{
	let sb = oFF.XStringBuffer.create();
	sb.append("System:");
	let name = this.getSystemName();
	if (oFF.notNull(name))
	{
		sb.append(" ").append(name);
	}
	let text = this.getSystemText();
	if (oFF.notNull(text))
	{
		sb.append(" - ").append(text);
	}
	sb.appendNewLine();
	let properties = this.getProperties();
	if (oFF.XCollectionUtils.hasElements(properties))
	{
		let propertyNames = oFF.XList.createWithList(properties.getKeysAsReadOnlyList());
		propertyNames.sortByDirection(oFF.XSortDirection.ASCENDING);
		for (let i = 0; i < propertyNames.size(); i++)
		{
			let propertyName = propertyNames.get(i);
			if (oFF.isNull(propertyName))
			{
				continue;
			}
			sb.append(propertyName).append("=");
			if (oFF.XString.isEqual(propertyName, oFF.ConnectionParameters.PASSWORD))
			{
				sb.append("**********");
			}
			else
			{
				let propertyValue = properties.getByKey(propertyName);
				if (oFF.notNull(propertyValue))
				{
					sb.append(propertyValue);
				}
			}
			sb.appendNewLine();
		}
	}
	return sb.toString();
};
