oFF.ProgramStartAction.prototype._handlePrgStartError = function(process, prgName, error)
{
	if (oFF.notNull(error))
	{
		this.addXErrorWithText(error, oFF.XStringUtils.concatenate4("Failed to start ", prgName, " program! \n Reason: ", error.getText()));
		if (error.getThrowable() !== null)
		{
			oFF.XLogger.println(oFF.XException.getStackTrace(error.getThrowable(), 0));
		}
	}
	else
	{
		this.addError(0, oFF.XStringUtils.concatenate3("Failed to start ", prgName, " program! \n Unknown error! "));
	}
	if (oFF.notNull(process) && process.isReleased() === false)
	{
		process.notifyProcessEventWithData(oFF.ProcessEventType.PROGRAM_STARTUP_ERROR, error);
	}
};
oFF.ProgramStartAction.prototype.bigCinema = function()
{
	if (!this.isValid())
	{
		this.endSync();
		return;
	}
	let startCfg = this.getActionContext();
	let manifest = startCfg.getProgramManifest();
	this.log2("Starting program: ", manifest.getName());
	let factory = manifest.getFactory();
	if (oFF.isNull(factory))
	{
		this.addError(0, oFF.XStringUtils.concatenate2("Cannot create factory for program ", manifest.getName()));
		this.endSync();
		return;
	}
	let newProgram = factory.newProgram();
	this.setData(newProgram);
	let startCfgClone = oFF.XObjectExt.cloneIfNotNull(startCfg);
	startCfgClone.setProgram(newProgram);
	let process = this.newProcess(startCfgClone);
	newProgram.setProcess(process);
	this.loadInitialProcessEntities(process).onFinally(() => {
		let programContainer = this.newProgramContainer(startCfgClone, newProgram, process);
		let kernel = process.getKernel();
		process.registerOnEvent(kernel);
		process.notifyProcessEvent(oFF.ProcessEventType.CREATED);
		try
		{
			programContainer.runFull().onThen((result) => {
				this.endSync();
			}).onCatch((err) => {
				this._handlePrgStartError(process, manifest.getName(), err);
				this.endSync();
			});
			if (process.isReleased() === false)
			{
				process.notifyProcessEvent(oFF.ProcessEventType.PROGRAM_STARTED);
			}
		}
		catch (e)
		{
			this._handlePrgStartError(process, manifest.getName(), oFF.XError.createWithThrowable(e));
			this.endSync();
		}
	});
};
oFF.ProgramStartAction.prototype.callListener = function(extResult, listener, data, customIdentifier)
{
	listener.onProgramStarted(extResult, data, customIdentifier);
};
oFF.ProgramStartAction.prototype.getLogLayer = function()
{
	return oFF.OriginLayer.KERNEL;
};
oFF.ProgramStartAction.prototype.getProcessIdToRunBelow = function(startCfg)
{
	let argumentList = startCfg.getArguments().getArgumentList();
	let first = oFF.XCollectionUtils.findFirst(argumentList, (arg) => {
		return oFF.XString.containsString(arg, oFF.DfProgram.PARAM_RUN_BELOW_PROCESS);
	});
	let split = oFF.XStringTokenizer.splitString(first, ":");
	return oFF.notNull(split) && split.size() >= 2 ? split.get(1) : null;
};
oFF.ProgramStartAction.prototype.loadInitialProcessEntities = function(process)
{
	let kernel = process.getKernel();
	let startCfg = this.getActionContext();
	let manifest = startCfg.getProgramManifest();
	let processEntities = manifest.getInitialProcessEntities();
	let location = manifest.getInitialProcessEntitiesLocation();
	let entityProcess = oFF.ProcessEntityLocation.getProcessForLocation(process, location);
	process.setEntity(oFF.ProcessEntity.CONFIGURATION_MAPPING, oFF.CoConfigurationMappingEntity.create(manifest));
	return kernel.startProcessEntities(entityProcess, processEntities);
};
oFF.ProgramStartAction.prototype.newProcess = function(startCfg)
{
	let process = startCfg.getProgramProcess();
	if (oFF.isNull(process))
	{
		let parentProcess = startCfg.getParentProcess();
		let targetProcessId = this.getProcessIdToRunBelow(startCfg);
		let targetProcess;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(targetProcessId))
		{
			targetProcess = parentProcess.getKernel().getChildProcessById(targetProcessId);
		}
		else if (startCfg.isCreatingChildProcess())
		{
			targetProcess = parentProcess;
		}
		else
		{
			let kernel = parentProcess.getKernel();
			targetProcess = kernel.getKernelProcess();
		}
		let programManifest = startCfg.getProgramManifest();
		let type = programManifest.getProcessType();
		process = targetProcess.newChildProcess(type);
		if (startCfg.isUsingParentEnvironment())
		{
			process.setEnvironment(parentProcess.getEnvironment());
		}
		process.setStartConfiguration(startCfg);
		process.setNativeAnchorId(startCfg.getNativeAnchorId());
		process.setNativeAnchorObject(startCfg.getNativeAnchorObject());
		let outputContainerType = startCfg.getResolvedContainerType();
		if (outputContainerType === oFF.ProgramContainerType.CONSOLE)
		{
			let capabilities = oFF.XHashSetOfString.create();
			capabilities.add("terminal");
			process.setCapabilities(capabilities);
		}
		let listeners = startCfg.getAllProcessEventListeners();
		for (let i = 0; i < listeners.size(); i++)
		{
			let currentListener = listeners.get(i);
			process.registerOnEvent(currentListener);
		}
	}
	return process;
};
oFF.ProgramStartAction.prototype.newProgramContainer = function(startCfg, program, process)
{
	let programContainer = startCfg.getProgramContainer();
	if (oFF.isNull(programContainer))
	{
		let outputContainerType = program.getResolvedProgramContainerType();
		if (oFF.notNull(outputContainerType))
		{
			if (outputContainerType !== oFF.ProgramContainerType.CONSOLE || startCfg.isNewConsoleNeeded())
			{
				programContainer = oFF.ProgramContainerFactory.create(outputContainerType);
			}
		}
	}
	if (oFF.isNull(programContainer))
	{
		programContainer = oFF.ProgramContainer.createProgramContainer(startCfg, program);
	}
	programContainer.setStartCfg(startCfg);
	programContainer.setProgram(program);
	programContainer.setProcess(process);
	startCfg.setProgramContainer(programContainer);
	return programContainer;
};
oFF.ProgramStartAction.prototype.onModuleLoadedMulti = function(extResult, rootModuleNames, customIdentifier)
{
	this.addAllMessages(extResult);
	if (extResult.isValid())
	{
		let startCfg = this.getActionContext();
		let manifest = startCfg.getProgramManifest();
		let parentProcess = startCfg.getParentProcess();
		let kernel = parentProcess.getKernel();
		let subSystems = manifest.getSubSystems();
		let subSystemType;
		let container;
		for (let k = 0; k < subSystems.size(); k++)
		{
			let name = subSystems.get(k);
			subSystemType = oFF.SubSystemType.lookup(name);
			if (oFF.isNull(subSystemType))
			{
				this.addError(0, oFF.XStringUtils.concatenate2("Unknown subsystem type: ", name));
			}
			else
			{
				this.m_subSystems.add(subSystemType);
			}
		}
		if (this.isValid())
		{
			let outputContainerType = manifest.getOutputContainerType();
			if (oFF.notNull(outputContainerType) && outputContainerType.isUiContainer())
			{
				if (subSystems.contains(oFF.SubSystemType.GUI.getName()) === false)
				{
					this.m_subSystems.insert(0, oFF.SubSystemType.GUI);
				}
			}
			for (let m = 0; m < this.m_subSystems.size(); )
			{
				subSystemType = this.m_subSystems.get(m);
				container = kernel.getSubSystemContainer(subSystemType);
				if (container.getStatus() === oFF.SubSystemStatus.ACTIVE || container.getStatus() === oFF.SubSystemStatus.INACTIVE)
				{
					this.m_subSystems.removeAt(m);
				}
				else
				{
					m++;
				}
			}
			if (this.m_subSystems.size() > 0)
			{
				this.m_subSystemsRemaining.addAll(this.m_subSystems);
				this.log2("Initializing inactive subsystems: ", this.m_subSystems.toString());
				for (let o = 0; o < this.m_subSystems.size(); o++)
				{
					subSystemType = this.m_subSystems.get(o);
					container = kernel.getSubSystemContainer(subSystemType);
					container.processSubSystemLoad(this.getActiveSyncType(), this, subSystemType);
				}
			}
			else
			{
				this.bigCinema();
			}
		}
		else
		{
			this.endSync();
		}
	}
	else
	{
		this.endSync();
	}
};
oFF.ProgramStartAction.prototype.onSubSystemLoaded = function(extResult, subSystem, customIdentifier)
{
	this.addAllMessages(extResult);
	let type = customIdentifier;
	this.m_subSystemsRemaining.removeElement(type);
	if (extResult.isValid())
	{
		this.log2("Subsystems loaded: ", type.toString());
	}
	else
	{
		this.logError4("Error loading subsystems: ", type.toString(), " - ", extResult.getSummary());
	}
	if (this.m_subSystemsRemaining.isEmpty())
	{
		this.bigCinema();
	}
	else
	{
		this.log2("Remaining subsystems in loading...: ", this.m_subSystemsRemaining.toString());
	}
};
oFF.ProgramStartAction.prototype.processSynchronization = function(syncType)
{
	let startCfg = this.getActionContext();
	let startCfgName = startCfg.getName();
	let manifest = startCfg.getProgramManifest();
	let kernel = startCfg.getParentProcess().getKernel();
	let toBeContinued = true;
	if (oFF.notNull(manifest))
	{
		if (kernel.isExecutable(manifest) === false)
		{
			this.addError(0, oFF.XStringUtils.concatenate3("Cannot run program '", manifest.getName(), "'"));
			toBeContinued = false;
		}
		if (toBeContinued === true)
		{
			let parentProcess = startCfg.getParentProcess();
			if (oFF.notNull(parentProcess))
			{
				let dependencies = manifest.getDependencies();
				let resolvedDependencies = oFF.XList.create();
				resolvedDependencies.addAll(dependencies);
				for (let k = 0; k < resolvedDependencies.size(); )
				{
					let moduleName = resolvedDependencies.get(k);
					if (kernel.isModuleLoaded(moduleName) === true)
					{
						resolvedDependencies.removeAt(k);
					}
					else
					{
						k++;
					}
				}
				if (resolvedDependencies.size() > 0)
				{
					kernel.processMultiModulesLoad(this.getActiveSyncType(), this, startCfg, resolvedDependencies);
				}
				else
				{
					let messageMgr = oFF.MessageManagerSimple.createMessageManager();
					let extResult = oFF.ExtResult.create(null, messageMgr);
					this.onModuleLoadedMulti(extResult, null, startCfg);
				}
			}
			else
			{
				this.addError(0, oFF.XStringUtils.concatenate2("Cannot start program: No parent process given for : ", startCfgName));
				toBeContinued = false;
			}
		}
	}
	else
	{
		let programModule = oFF.XProgramModuleMapping.getModuleNameForProgram(startCfgName);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(programModule))
		{
			this.addInfo(0, oFF.XStringUtils.concatenate4("Program ", startCfgName, " found in module ", programModule));
			let dependencyToLoad = oFF.XList.create();
			dependencyToLoad.add(programModule);
			kernel.processMultiModulesLoad(this.getActiveSyncType(), this, startCfg, dependencyToLoad);
		}
		else
		{
			this.addError(0, oFF.XStringUtils.concatenate2("Cannot start program: Program manifest cannot be found: ", startCfgName));
			toBeContinued = false;
		}
	}
	return toBeContinued;
};
