{
	return oFF.OriginLayer.KERNEL;
};
oFF.SubSystemLoadAction.prototype.onProcessEvent = function(process, event)
{
	let eventType = event.getEventType();
	let subSystemName = this.getActionContext().getSubSystemFullName();
	let eventName = eventType.getName();
	this.log4("Subsystem onProcessEvent: ", subSystemName, " event: ", eventName);
	if (eventType === oFF.ProcessEventType.ACTIVE)
	{
		let subSystem = process.getEntity(oFF.ProcessEntity.SUB_SYSTEM);
		process.unregisterOnEvent(this);
		this.setData(subSystem);
		this.endSync();
	}
};
oFF.SubSystemLoadAction.prototype.onProgramStarted = function(extResult, program, customIdentifier)
{
	let actionContext = this.getActionContext();
	let subSystemName = actionContext.getSubSystemFullName();
	this.addAllMessages(extResult);
	if (extResult.hasErrors())
	{
		this.log2("Subsystem started with errors: ", subSystemName);
		this.endSync();
	}
	else
	{
		this.log2("Subsystem started: ", subSystemName);
	}
};
oFF.SubSystemLoadAction.prototype.processSynchronization = function(syncType)
{
	let subSystemContainer = this.getActionContext();
	let doCont = false;
	let subSystem;
	let status = subSystemContainer.getStatus();
	if (status === oFF.SubSystemStatus.INITIAL || status === oFF.SubSystemStatus.BOOTSTRAP)
	{
		let type = subSystemContainer.getSubSystemType();
		let typeName = type.getName();
		let programName = oFF.XStringUtils.concatenate2(oFF.ProgramRegistry.SUBSYS_PREFIX, typeName);
		let selectorName = subSystemContainer.getSubSystemSelector();
		if (oFF.notNull(selectorName))
		{
			programName = oFF.XStringUtils.concatenate3(programName, ".", selectorName);
		}
		let kernel = subSystemContainer.getKernel();
		let programmExist = kernel.getProgramManifest(programName) !== null;
		if (!programmExist)
		{
			programmExist = oFF.XProgramModuleMapping.getModuleNameForProgram(programName) !== null;
		}
		if (programmExist)
		{
			let kernelProcess = kernel.getKernelProcess();
			let programArgs = oFF.ProgramArgs.create();
			let programStartCfg = oFF.ProgramStartCfg.create(kernelProcess, programName, null, programArgs);
			programStartCfg.registerOnEvent(this);
			programStartCfg.processExecution(syncType, this, null);
			doCont = true;
		}
		else
		{
			subSystem = subSystemContainer.open();
			if (oFF.notNull(subSystem))
			{
				this.setData(subSystem);
			}
			else
			{
				this.addError(0, oFF.XStringUtils.concatenate2("Cannot open subsystem from container: ", subSystemContainer.getSubSystemFullName()));
			}
		}
	}
	else
	{
		subSystem = subSystemContainer.getSubSystem();
		this.setData(subSystem);
	}
	return doCont;
};
oFF.SubSystemLoadAction.prototype.releaseObjectInternal = function() {};

