oFF.UserProfileLoadAction.prototype.releaseObjectInternal = function() {};
oFF.UserProfileLoadAction.prototype.setUserProfileFromContent = function(fileContent)
{
	let userProfile = oFF.UserProfile.create();
	userProfile.setServiceApiLevel(this.m_serviceApiLevel);
	userProfile.setDocumentUri(this.m_file.getUri());
	userProfile.setParent(this.m_parent);
	let document = fileContent.getJsonContent();
	userProfile.setDocument(document);
	if (oFF.notNull(document))
	{
		if (!oFF.UserProfileDefaultAdapter.deserialize(userProfile, document))
		{
			oFF.UserProfileAdapterOrca.deserialize(userProfile, document);
		}
	}
	this.setData(userProfile);
};

