oFF.LiteCredentialsProviderAction.prototype.handleError = function()
{
	this.addError(oFF.ErrorCodes.INVALID_SYSTEM, "Authentication failed.");
	this.endSync();
};
oFF.LiteCredentialsProviderAction.prototype.handleTokenAuth = function()
{
	let orcaName = this.getProcess().getEnvironment().getStringByKey(oFF.XEnvironmentConstants.FIREFLY_MAIN_CLIB_SYS);
	if (oFF.notNull(orcaName))
	{
		if (this.getProcess().getConnectionPool() === null)
		{
			this.getProcess().setEntity(oFF.ProcessEntity.CONNECTION_POOL, oFF.ConnectionPool.create(this.getProcess()));
		}
		let orcaConnection = this.getProcess().getConnectionPool().getConnection(orcaName);
		let systemDescription = this.m_connection.getSystemDescription();
		if (oFF.XString.isEqual(systemDescription.getFPAAuthenticationMethod(), oFF.AuthenticationType.OPENID.getName()))
		{
			let redirectUrl = oFF.XUri.createFromConnection(orcaConnection.getSystemDescription()).getUrl();
			let isPopupEnabled = systemDescription.isFireflyOauthVisiblePopupEnabled();
			oFF.FpaOpenIdTokenLoadAction.createAndRun(this.getActiveSyncType(), this, null, orcaConnection, systemDescription.getSystemName(), redirectUrl, isPopupEnabled);
		}
		else if (oFF.XString.isEqual(systemDescription.getFPAAuthenticationMethod(), oFF.AuthenticationType.OAUTH.getName()))
		{
			let systemUrl = oFF.XUri.createFromConnection(systemDescription).getUrl();
			oFF.OAuthTokenLoadAction.createAndRun(this.getActiveSyncType(), this, null, this.m_connection, systemUrl);
		}
	}
	else
	{
		this.handleError();
	}
};
oFF.LiteCredentialsProviderAction.prototype.onBearerTokenLoaded = function(extResult, token, expiresAt, customIdentifier)
{
	if (oFF.notNull(token))
	{
		let systemDescription = this.m_connection.getSystemDescription();
		let newPersonalization = this.getProcess().getUserManager().newMergedPersonalizationExtended(systemDescription);
		if (oFF.notNull(newPersonalization))
		{
			newPersonalization.setAuthenticationType(oFF.AuthenticationType.BEARER);
			newPersonalization.setAuthenticationToken(token);
		}
		systemDescription.setAuthenticationType(oFF.AuthenticationType.BEARER);
		systemDescription.setAuthenticationToken(token);
		if (oFF.notNull(expiresAt))
		{
			systemDescription.setAuthenticationTokenExpiresAt(expiresAt);
		}
		this.setData(newPersonalization);
		this.endSync();
	}
	else
	{
		this.handleError();
	}
};
oFF.LiteCredentialsProviderAction.prototype.onBearerTokenSeverError = function(extResult, customIdentifier)
{
	this.handleError();
};
oFF.LiteCredentialsProviderAction.prototype.processSynchronization = function(syncType)
{
	if (oFF.isNull(this.m_rpcMessages))
	{
		let systemDescription = this.m_connection.getSystemDescription();
		let useDedicatedOAuthClient = this.getSession().hasFeature(oFF.FeatureToggleSAC.FF_SAC_FIREFLY_AUTHENTICATION_OAUTH_PKCE_CLIENT);
		let tokenUtils = oFF.TokenUtils.create(systemDescription);
		if (tokenUtils.isOAuthTokenExpired() && useDedicatedOAuthClient)
		{
			systemDescription.setAuthenticationType(oFF.AuthenticationType.OAUTH_WITH_PKCE);
		}
		let personalization = this.getProcess().getUserManager().newMergedPersonalizationExtended(systemDescription);
		if (oFF.notNull(this.m_authType))
		{
			personalization.setAuthenticationType(this.m_authType);
		}
		if ((systemDescription.getAuthenticationType() === oFF.AuthenticationType.OAUTH_WITH_PKCE && !useDedicatedOAuthClient) || tokenUtils.isTokenNeeded(false))
		{
			this.handleTokenAuth();
			return true;
		}
		else
		{
			this.setData(personalization);
			if (tokenUtils.isOAuthTokenExpired() && useDedicatedOAuthClient)
			{
				this.endSync();
			}
		}
	}
	else
	{
		this.addAllMessages(this.m_rpcMessages);
	}
	return false;
};
oFF.LiteCredentialsProviderAction.prototype.releaseObjectInternal = function()
{
	this.m_connection = null;
	this.m_rpcMessages = null;
};

