{
	listener.onFileProviderChildrenFetched(extResult, data, data.getProviderChildFiles(), data.getProviderChildrenResultset(), customIdentifier);
};
oFF.XHttpFileDirAction.prototype.normalizeForDir = function(uri)
{
	let result = uri;
	let path = uri.getPath();
	if (oFF.XString.endsWith(path, "/") === false)
	{
		let targetUri = oFF.XUri.createFromOther(uri);
		if (oFF.XString.endsWith(path, "/") === false)
		{
			path = oFF.XStringUtils.concatenate2(path, "/");
		}
		targetUri.setPath(path);
		result = targetUri;
	}
	return result;
};
oFF.XHttpFileDirAction.prototype.onHttpResponse = function(extResult, response, customIdentifier)
{
	this.addAllMessages(extResult);
	if (extResult.isValid())
	{
		if (oFF.HttpStatusCode.isOk(response.getStatusCode()))
		{
			let jsonContent = response.getJsonContent();
			if (oFF.notNull(jsonContent) && jsonContent.isStructure())
			{
				let dirInfo = jsonContent;
				let file = this.getActionContext();
				let fileSystem = file.getProviderFileSystem();
				let process = this.getProcess();
				let children = oFF.XList.create();
				let fileList = dirInfo.getListByKey("Files");
				if (oFF.notNull(fileList))
				{
					for (let i = 0; i < fileList.size(); i++)
					{
						let fileStructure = fileList.getStructureAt(i);
						let type = fileStructure.getStringByKey("Type");
						let isDirectory = oFF.XString.isEqual(type, "Dir");
						let isExecutable = fileStructure.getBooleanByKeyExt("IsExecutable", false);
						let name = fileStructure.getStringByKey("Name");
						let targetName = name;
						if (isDirectory)
						{
							targetName = oFF.XStringUtils.concatenate2(name, "/");
						}
						let targetChildUri = oFF.XUri.createFromParentUriAndRelativeUrl(this.m_parentTargetUri, targetName, false);
						let childFile = oFF.XHttpFile._create(process, fileSystem, targetChildUri);
						childFile.setIsDirectory(isDirectory);
						childFile.setIsExecutable(isExecutable);
						children.add(childFile);
					}
				}
				file.setProviderChildFiles(children, -1);
			}
			else
			{
				this.addErrorExt(oFF.OriginLayer.IOLAYER, oFF.ErrorCodes.SYSTEM_IO, "Missing json content", null);
			}
		}
		else
		{
			this.addErrorExt(oFF.OriginLayer.IOLAYER, oFF.ErrorCodes.SYSTEM_IO_HTTP, response.getStatusCodeDetails(), null);
		}
	}
	this.endSync();
};
oFF.XHttpFileDirAction.prototype.processSynchronization = function(syncType)
{
	this.setData(this.getActionContext());
	let httpFile = this.getActionContext();
	this.m_parentTargetUri = this.normalizeForDir(httpFile.getUri());
	this.m_targetDirUri = oFF.XUri.createChildFile(this.m_parentTargetUri, ".index.json");
	let request = oFF.HttpRequest.createByUri(this.m_targetDirUri);
	let httpClient = request.newHttpClient(this.getSession());
	httpClient.processHttpRequest(syncType, this, null);
	return true;
};

