oFF.XRemoteHttpFileRequestAction.prototype.importMessages = function(file, fileStructure)
{
	let messages = fileStructure.getListByKey("Messages");
	if (oFF.notNull(messages))
	{
		oFF.XCollectionUtils.forEach(messages, (m) => {
			let message = m.asStructure();
			file.addMessage(oFF.XMessage.createMessage(oFF.OriginLayer.IOLAYER, oFF.Severity.fromName(message.getStringByKey("Type")), message.getIntegerByKeyExt("Code", oFF.ErrorCodes.SYSTEM_IO_WRITE_ACCESS), message.getStringByKey("Text"), null, false, null));
		});
	}
};
oFF.XRemoteHttpFileRequestAction.prototype.normalizeForDir = function(uri)
{
	let result = uri;
	let path = uri.getPath();
	if (oFF.XString.endsWith(path, "/") === false)
	{
		let targetUri = oFF.XUri.createFromOther(uri);
		if (oFF.XString.endsWith(path, "/") === false)
		{
			path = oFF.XStringUtils.concatenate2(path, "/");
		}
		targetUri.setPath(path);
		result = targetUri;
	}
	return result;
};
oFF.XRemoteHttpFileRequestAction.prototype.onHttpResponse = function(extResult, response, customIdentifier)
{
	this.addAllMessages(extResult);
	if (extResult.isValid())
	{
		if (oFF.HttpStatusCode.isOk(response.getStatusCode()))
		{
			let jsonContent = response.getJsonContent();
			if (oFF.notNull(jsonContent) && jsonContent.isStructure())
			{
				let fileInfo = jsonContent;
				let file = this.getActionContext();
				this.updateFileFromResponse(file, fileInfo);
			}
			else
			{
				this.addErrorExt(oFF.OriginLayer.IOLAYER, oFF.ErrorCodes.SYSTEM_IO, "Missing json content", null);
			}
		}
		else
		{
			this.addErrorExt(oFF.OriginLayer.IOLAYER, oFF.ErrorCodes.SYSTEM_IO_HTTP, response.getStatusCodeDetails(), null);
		}
	}
	this.endSync();
};
oFF.XRemoteHttpFileRequestAction.prototype.processSynchronization = function(syncType)
{
	this.setData(this.getActionContext());
	let httpFile = this.getActionContext();
	this.m_parentTargetUri = httpFile.getTranslatedTargetUri();
	this.m_parentVfsUri = httpFile.getUri();
	let request = oFF.HttpRequest.createByUri(this.m_parentTargetUri);
	if (oFF.XString.isEqual(this.m_action, oFF.XRemoteHttpFileRequestAction.LOAD))
	{
		request.setMethod(oFF.HttpRequestMethod.HTTP_GET);
	}
	else if (oFF.XString.isEqual(this.m_action, oFF.XRemoteHttpFileRequestAction.UPDATE))
	{
		request.setMethod(oFF.HttpRequestMethod.HTTP_POST);
		let fileUpdateRequest = oFF.PrFactory.createStructure();
		let directory = httpFile.isDirectory();
		fileUpdateRequest.putString(oFF.XRemoteHttpFileConstants.FILE_TYPE, directory ? oFF.XRemoteHttpFileConstants.FILE_TYPE_DIR : oFF.XRemoteHttpFileConstants.FILE_TYPE_FILE);
		if (!directory)
		{
			let fileContent = httpFile.getProviderContent();
			if (oFF.notNull(fileContent))
			{
				let contentType = fileContent.getContentType();
				fileUpdateRequest.putString(oFF.XRemoteHttpFileConstants.CONTENT_TYPE, contentType.getName());
				let contentString = contentType.isTypeOf(oFF.ContentType.BINARY) ? oFF.XByteArray.convertToString(fileContent.getByteArray()) : fileContent.getString();
				fileUpdateRequest.putString(oFF.XRemoteHttpFileConstants.CONTENT, contentString);
				fileUpdateRequest.putLong(oFF.XRemoteHttpFileConstants.LAST_MODIFIED_TIMESTAMP, httpFile.getLastModifiedTimestamp());
				fileUpdateRequest.putLong(oFF.XRemoteHttpFileConstants.SIZE, httpFile.getSize());
				fileUpdateRequest.putString(oFF.XRemoteHttpFileConstants.PERMISSIONS, httpFile.generatePermissionsString());
			}
		}
		if (oFF.notNull(this.m_destName))
		{
			fileUpdateRequest.putString(oFF.XRemoteHttpFileConstants.NEW_FILE_NAME, this.m_destName);
		}
		request.setJsonObject(fileUpdateRequest);
	}
	else if (oFF.XString.isEqual(this.m_action, oFF.XRemoteHttpFileRequestAction.DELETE))
	{
		request.setMethod(oFF.HttpRequestMethod.HTTP_DELETE);
	}
	request.setAcceptContentType(oFF.ContentType.APPLICATION_JSON);
	let httpClient = request.newHttpClient(this.getSession());
	httpClient.processHttpRequest(syncType, this, null);
	return true;
};
oFF.XRemoteHttpFileRequestAction.prototype.releaseObjectInternal = function() {};
oFF.XRemoteHttpFileRequestAction.prototype.setDestinationFile = function(destName)
{
	this.m_destName = destName;
};
oFF.XRemoteHttpFileRequestAction.prototype.updateFileFromResponse = function(file, fileStructure)
{
	file.setMetadataLoaded(true);
	let exists = fileStructure.getBooleanByKey(oFF.XRemoteHttpFileConstants.EXISTS);
	this.importMessages(file, fileStructure);
	file.setProviderIsExisting(exists);
	if (exists)
	{
		let fileType = fileStructure.getStringByKey(oFF.XRemoteHttpFileConstants.FILE_TYPE);
		let dir = oFF.XString.isEqual(fileType, oFF.XRemoteHttpFileConstants.FILE_TYPE_DIR);
		file.setIsDirectory(dir);
		let fileName = fileStructure.getStringByKey(oFF.XRemoteHttpFileConstants.FILE_NAME);
		if (oFF.notNull(fileName))
		{
			file.updateName(fileName);
		}
		file.setHidden(fileStructure.getBooleanByKeyExt(oFF.XRemoteHttpFileConstants.HIDDEN, false));
		file.setLastModifiedTimestamp(fileStructure.getLongByKeyExt(oFF.XRemoteHttpFileConstants.LAST_MODIFIED_TIMESTAMP, 0));
		file.setSize(fileStructure.getLongByKeyExt(oFF.XRemoteHttpFileConstants.SIZE, 0));
		let permissionsStr = fileStructure.getStringByKey(oFF.XRemoteHttpFileConstants.PERMISSIONS);
		file.setIsReadable(oFF.XFileUtils.hasReadPermission(permissionsStr));
		file.setIsWritable(oFF.XFileUtils.hasWritePermission(permissionsStr));
		file.setIsExecutable(oFF.XFileUtils.hasExecutePermission(permissionsStr));
		if (dir)
		{
			this.m_parentVfsUri = this.normalizeForDir(this.m_parentVfsUri);
			this.m_parentTargetUri = this.normalizeForDir(this.m_parentTargetUri);
			let childrenElements = fileStructure.getListByKey(oFF.XRemoteHttpFileConstants.CHILDREN);
			if (oFF.notNull(childrenElements))
			{
				let process = this.getProcess();
				let fileSystem = file.getProviderFileSystem();
				let children = oFF.XList.create();
				for (let i = 0; i < childrenElements.size(); i++)
				{
					let childFileStructure = childrenElements.getStructureAt(i);
					let type = childFileStructure.getStringByKey(oFF.XRemoteHttpFileConstants.FILE_TYPE);
					let isDirectory = oFF.XString.isEqual(type, oFF.XRemoteHttpFileConstants.FILE_TYPE_DIR);
					let name = childFileStructure.getStringByKey(oFF.XRemoteHttpFileConstants.FILE_NAME);
					let targetName = isDirectory ? oFF.XStringUtils.concatenate2(name, "/") : name;
					let targetChildUri = oFF.XUri.createFromParentUriAndRelativeUrl(this.m_parentTargetUri, targetName, false);
					let childFile = oFF.XRemoteHttpFile._create(process, fileSystem, targetChildUri);
					this.updateFileFromResponse(childFile, childFileStructure);
					children.add(childFile);
				}
				file.setProviderChildFiles(children, -1);
			}
			file.setMetadataLoaded(true);
		}
		else
		{
			let contentString = fileStructure.getStringByKey(oFF.XRemoteHttpFileConstants.CONTENT);
			if (oFF.notNull(contentString))
			{
				let contentTypeString = fileStructure.getStringByKey(oFF.XRemoteHttpFileConstants.CONTENT_TYPE);
				let semicolon = ";";
				if (oFF.XString.containsString(contentTypeString, semicolon))
				{
					let end = oFF.XString.indexOf(contentTypeString, semicolon);
					contentTypeString = oFF.XString.substring(contentTypeString, 0, end);
				}
				let contentType = oFF.ContentType.lookup(contentTypeString);
				let fileContent;
				if (oFF.isNull(contentType))
				{
					contentType = oFF.ContentType.TEXT;
				}
				if (contentType.isTypeOf(oFF.ContentType.BINARY))
				{
					fileContent = oFF.XContent.createByteArrayContent(contentType, oFF.XByteArray.convertFromString(contentString));
				}
				else
				{
					fileContent = oFF.XContent.createStringContent(contentType, contentString);
				}
				file.setProviderFileContent(fileContent);
				file.setMetadataLoaded(true);
			}
		}
	}
};

