oFF.VfsFetchFileAction.prototype.processSynchronization = function(syncType)
{
	let fileProvider = null;
	let vfsFileSystem = this.getActionContext();
	let path = this.m_vfsUri.getPath();
	let pathInfo = vfsFileSystem.getPathInfo(path);
	if (pathInfo.isOnMountPoint())
	{
		fileProvider = oFF.VfsFileProvider.createExt(this.m_process, vfsFileSystem, this.m_vfsUri, pathInfo, null, null);
		this.setData(fileProvider);
		return false;
	}
	else if (pathInfo.isInMountingArea())
	{
		let mountPoint = pathInfo.getMountPoint();
		if (oFF.notNull(mountPoint))
		{
			let targetUri = mountPoint.calculateTargetUri(this.m_vfsUri);
			let fileSystemManager = this.m_process.getFileSystemManager();
			fileSystemManager.processFetchFileProvider(syncType, this, null, this.m_process, targetUri);
			return true;
		}
		else
		{
			this.addError(0, "No mounting point is given");
			return false;
		}
	}
	else
	{
		fileProvider = oFF.VfsFileProvider.createExt(this.m_process, vfsFileSystem, this.m_vfsUri, pathInfo, null, null);
		this.setData(fileProvider);
		return false;
	}
};
