oFF.VfsFileSystem.prototype.m_root = null;
oFF.VfsFileSystem.prototype._validatePath = function(path)
{
	if (oFF.XString.startsWith(path, "/") === false)
	{
		throw oFF.XException.createIllegalArgumentException(oFF.XStringUtils.concatenate2("Path is relative to root hence it must start with slash: ", path));
	}
};
oFF.VfsFileSystem.prototype.addDirectory = function(path, attributes)
{
	this._validatePath(path);
	let pathElements = oFF.XStringTokenizer.splitString(path, "/");
	let size = pathElements.size();
	if (oFF.notNull(attributes))
	{
		attributes.putBoolean(oFF.XFileAttribute.IS_DIRECTORY, true);
		attributes.putBoolean(oFF.XFileAttribute.IS_FILE, false);
	}
	let parentDir = this.navigateToParent(path, pathElements);
	if (oFF.notNull(parentDir))
	{
		let name = pathElements.get(size - 1);
		let child = oFF.VfsElementDir.createDir(this, name, attributes);
		parentDir.setChild(child);
		return child;
	}
	else
	{
		this.log("Failed to find parent directory! Cannot add directory!");
	}
	return null;
};
oFF.VfsFileSystem.prototype.addFile = function(path, content, attributes)
{
	this._validatePath(path);
	let pathElements = oFF.XStringTokenizer.splitString(path, "/");
	let size = pathElements.size();
	if (oFF.notNull(attributes))
	{
		attributes.putBoolean(oFF.XFileAttribute.IS_DIRECTORY, false);
		attributes.putBoolean(oFF.XFileAttribute.IS_FILE, true);
	}
	let parentDir = this.navigateToParent(path, pathElements);
	if (oFF.notNull(parentDir))
	{
		let name = pathElements.get(size - 1);
		let newFile = oFF.VfsElementFile.createFile(this, name, content, attributes);
		parentDir.setChild(newFile);
		return newFile;
	}
	else
	{
		this.log("Failed to find parent directory! Cannot add file!");
	}
	return null;
};
oFF.VfsFileSystem.prototype.addMountPoint = function(path, mountPoint)
{
	this._validatePath(path);
	let pathElements = oFF.XStringTokenizer.splitString(path, "/");
	let size = pathElements.size();
	let existingDir = this.getDirectoryByPath(path);
	if (oFF.notNull(existingDir))
	{
		mountPoint.mountUnderDirectory(existingDir);
	}
	else
	{
		let parentDir = this.navigateToParent(path, pathElements);
		if (oFF.notNull(parentDir))
		{
			let name = pathElements.get(size - 1);
			mountPoint.setName(name);
			mountPoint.setVfs(this);
			parentDir.setChild(mountPoint);
		}
	}
};
oFF.VfsFileSystem.prototype.addMountPointByUri = function(path, mountPointUri)
{
	let mountPoint = oFF.VfsElementMountPoint.createWithUri(mountPointUri);
	this.addMountPoint(path, mountPoint);
	return mountPoint;
};
