{
	return this;
};
oFF.VfsFileSystem.prototype.getDirectoryByPath = function(path)
{
	let existingElement = this.getElementByPath(path);
	if (oFF.notNull(existingElement) && existingElement.getComponentType() === oFF.VfsElementType.DIR)
	{
		return existingElement;
	}
	return null;
};
oFF.VfsFileSystem.prototype.getElementByPath = function(path)
{
	let pathElements = oFF.XStringTokenizer.splitString(path, "/");
	let element = this.navigateTo(pathElements, 0, false);
	return element;
};
oFF.VfsFileSystem.prototype.getMainApi = function()
{
	return this;
};
oFF.VfsFileSystem.prototype.getPathInfo = function(path)
{
	let thePath = path;
	if (oFF.isNull(thePath))
	{
		thePath = "/";
	}
	if (oFF.XString.startsWith(thePath, "/") === false)
	{
		throw oFF.XException.createIllegalArgumentException(oFF.XStringUtils.concatenate2("File path must start with slash: ", thePath));
	}
	let pathElements = oFF.XStringTokenizer.splitString(thePath, "/");
	let size = pathElements.size();
	if (size > 1 && oFF.XStringUtils.isNullOrEmpty(pathElements.get(size - 1)))
	{
		pathElements.removeAt(size - 1);
		size = size - 1;
	}
	let name = pathElements.get(size - 1);
	if (oFF.XStringUtils.isNullOrEmpty(name))
	{
		name = null;
	}
	let element = this.m_root;
	let parentNode = null;
	let lastSeenParentNode = null;
	let lastSeenParentNodeIndex = -1;
	let matchResultType = oFF.VfsMatchResultType.EXACT;
	for (let i = 1; i < size; i++)
	{
		if (oFF.isNull(element))
		{
			parentNode = null;
			break;
		}
		else
		{
			if (element.getComponentType().isTypeOf(oFF.VfsElementType.NODE))
			{
				parentNode = element;
				lastSeenParentNode = parentNode;
				lastSeenParentNodeIndex = i - 1;
			}
			else
			{
				matchResultType = oFF.VfsMatchResultType.ERROR;
				break;
			}
		}
		let childName = pathElements.get(i);
		element = parentNode.getChild(childName);
		if (oFF.isNull(element))
		{
			matchResultType = oFF.VfsMatchResultType.NOT_EXISTENT;
		}
	}
	let info = oFF.VfsPathInfo.create(name, thePath, pathElements, lastSeenParentNode, lastSeenParentNodeIndex, parentNode, element, matchResultType);
	return info;
};
oFF.VfsFileSystem.prototype.getProtocolType = function()
{
	return oFF.ProtocolType.VFS;
};
