oFF.VfsFileSystem.prototype.navigateTo = function(pathElements, offset, createDir)
{
	let current = this.m_root;
	let size = pathElements.size();
	if (size > 1 && oFF.XString.isEqual(pathElements.get(size - 1), ""))
	{
		size = size - 1;
	}
	for (let i = 1; i < size - offset; i++)
	{
		if (oFF.isNull(current) || current.isLeaf())
		{
			current = null;
			break;
		}
		else
		{
			let dir = current;
			let folderName = pathElements.get(i);
			let child = dir.getChild(folderName);
			if (createDir === true)
			{
				if (oFF.isNull(child))
				{
					child = oFF.VfsElementDir.createDir(this, folderName, null);
					dir.setChild(child);
				}
			}
			current = child;
		}
	}
	return current;
};
oFF.VfsFileSystem.prototype.navigateToParent = function(path, pathElements)
{
	let element = this.navigateTo(pathElements, 1, true);
	if (element.getComponentType() !== oFF.VfsElementType.DIR)
	{
		this.logError2("Cannot attach mounting/directory point at ", path);
		return null;
	}
	else
	{
		return element;
	}
};
