oFF.XFileSystemManagerRoot.prototype.getAllAvailableFileSystems = function()
{
	let all = oFF.XListOfNameObject.create();
	let keys = oFF.XFileSystemFactory.getAllFactories().getKeysAsReadOnlyList();
	for (let i = 0; i < keys.size(); i++)
	{
		let theKey = keys.get(i);
		let theType = oFF.ProtocolType.lookup(theKey);
		all.add(theType);
	}
	let kernel = this.getProcess().getKernel();
	let allFsSubSys = kernel.getAllSubSystemSelectors(oFF.SubSystemType.FILE_SYSTEM);
	for (let k = 0; k < allFsSubSys.size(); k++)
	{
		let fsSubSysName = allFsSubSys.get(k);
		let fsSubSysType = oFF.ProtocolType.lookup(fsSubSysName);
		if (oFF.notNull(fsSubSysType))
		{
			all.add(fsSubSysType);
		}
	}
	return all;
};
