oFF.HttpOAuthClient.prototype.OAUTH_CLIENT_ID = "744dd465-cd69-4794-9952-25967da3f5de";
oFF.HttpOAuthClient.prototype.OAUTH_CLIENT_REDIRECT_URI = "https://assets.sapanalytics.cloud/production/oauth/pkce-redirect.html";
