oFF.HttpOAuthClient.prototype.extractData = function(msgData)
{
	let data = oFF.XJson.extractJsonContent(msgData).asStructure();
	this.m_authCode = data.getStringByKey("code");
};
oFF.HttpOAuthClient.prototype.getAuthCode = function(syncType)
{
	this.m_systemUrl = this.getSystemUrl();
	let oAuthUtils = oFF.OAuthUtils.getInstance();
	this.m_codeVerifier = oAuthUtils.generateCodeVerifier();
	let codeChallengePromise = oAuthUtils.generateCodeChallenge(this.m_codeVerifier);
	if (oFF.notNull(codeChallengePromise))
	{
		codeChallengePromise.onThen((codeChallenge) => {
			this.m_codeChallenge = codeChallenge;
			this.m_saml2idpParam = this.getSaml2IdpParam();
			let url = this.getAuthCodeUrl();
			let listener = oFF.LambdaEventMessageListenerCloseableWindow.createNew((data) => {
				this.extractData(data);
				this.processOAuthWorkflow(syncType);
			}, () => {
				this.addError(oFF.HttpErrorCode.HTTP_OAUTH_TIMEOUT, oFF.HttpErrorMessage.AUTHENTICATION_TIMEOUT);
				this.log(oFF.HttpErrorMessage.AUTHENTICATION_TIMEOUT);
				this.endSync();
			}, () => {
				this.addError(oFF.HttpErrorCode.HTTP_NOT_AUTHENTICATED, oFF.HttpErrorMessage.AUTHENTICATION_CANCELLED);
				this.log(oFF.HttpErrorMessage.AUTHENTICATION_CANCELLED);
				this.endSync();
			});
			let state = oFF.PopupHandler.getNewStateValue();
			let popup = oFF.PopupHandler.createPopup(url, listener, state, this.getSession());
			if (!popup.isOpen())
			{
				this.addError(oFF.HttpErrorCode.HTTP_OAUTH_POPUP_BLOCKED, oFF.HttpErrorMessage.OAUTH_POPUP_BLOCKED);
				this.endSync();
			}
			let pool = this.getProcess().getConnectionPool();
			pool.registerOAuthAccessCodeConsumer(state, (data) => {
				popup.closePopup();
				listener.onMessageReceived(data);
			});
		}).onCatch((error) => {
			this.addError(0, error.getText());
			this.endSync();
		});
	}
	else
	{
		this.addError(0, oFF.HttpErrorMessage.CODE_GENERATION_FAILED);
		this.log(oFF.HttpErrorMessage.CODE_GENERATION_FAILED);
		this.endSync();
	}
};
oFF.HttpOAuthClient.prototype.getAuthCodeUrl = function()
{
	let buffer = oFF.XStringBuffer.create().append(this.m_systemUrl).append(this.MOBILE_AUTH_URI_ENDPOINT).append("response_type=code").append(this.m_saml2idpParam).append("&code_challenge_method=S256").append("&client_id=").append(this.OAUTH_CLIENT_ID).append("&redirect_uri=").append(this.OAUTH_CLIENT_REDIRECT_URI).append("&code_challenge=").append(this.m_codeChallenge);
	return buffer.toString();
};
oFF.HttpOAuthClient.prototype.getProcess = function()
{
	return this.getSession();
};
oFF.HttpOAuthClient.prototype.getSaml2IdpParam = function()
{
	let isDWCConnection = this.getRequest().isDWCConnection();
	if (isDWCConnection)
	{
		let location = oFF.NetworkEnv.getLocation();
		let saml2Idp = location.getQueryMap().getByKey("saml2idp");
		if (oFF.notNull(saml2Idp))
		{
			oFF.XUriUtils.validateUri(saml2Idp);
			return oFF.XStringUtils.concatenate2("&saml2idp=", saml2Idp);
		}
	}
	return "";
};
oFF.HttpOAuthClient.prototype.getSystemUrl = function()
{
	let systemName = this.getRequest().getSystemName();
	let systemDescription = this.getProcess().getSystemLandscape().getSystemDescription(systemName);
	let systemUrl = oFF.XUri.createFromConnection(systemDescription).getUrl();
	let mobileLocalProxy = this.getSession().getEnvironment().getByKey(oFF.XEnvironmentConstants.FIREFLY_MOBILE_PROXY_PREFIX);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(mobileLocalProxy))
	{
		oFF.XUriUtils.isSecureUrl(oFF.XString.replace(systemUrl, mobileLocalProxy, ""));
	}
	else
	{
		oFF.XUriUtils.isSecureUrl(systemUrl);
	}
	return systemUrl;
};
oFF.HttpOAuthClient.prototype.getTokenParams = function()
{
	let buffer = oFF.XStringBuffer.create().append("grant_type=authorization_code").append("&code=").append(this.m_authCode).append("&redirect_uri=").append(this.OAUTH_CLIENT_REDIRECT_URI).append("&client_id=").append(this.OAUTH_CLIENT_ID).append("&code_verifier=").append(this.m_codeVerifier);
	return buffer.toString();
};
oFF.HttpOAuthClient.prototype.onHttpResponse = function(extResult, response, customIdentifier)
{
	let statusCode = response.getStatusCode();
	let httpContentType = response.getContentType();
	if (statusCode === oFF.HttpStatusCode.SC_OK && httpContentType === oFF.ContentType.APPLICATION_JSON)
	{
		this.setData(response);
		this.endSync();
	}
	else
	{
		this.addError(oFF.HttpErrorCode.HTTP_WRONG_CONTENT_TYPE, "Invalid response.");
		this.endSync();
	}
};
oFF.HttpOAuthClient.prototype.processOAuthWorkflow = function(syncType)
{
	if (oFF.isNull(this.m_authCode))
	{
		this.getAuthCode(syncType);
	}
	else
	{
		this.sendGetTokenRequest(syncType);
	}
};
oFF.HttpOAuthClient.prototype.processSynchronization = function(syncType)
{
	this.processOAuthWorkflow(syncType);
	return true;
};
oFF.HttpOAuthClient.prototype.sendGetTokenRequest = function(syncType)
{
	let url = oFF.XStringUtils.concatenate2(this.m_systemUrl, this.MOBILE_TOKEN_URI_ENDPOINT);
	let tokenParams = this.getTokenParams();
	let serviceRequest = oFF.HttpRequest.createByUrl(url);
	serviceRequest.setString(tokenParams);
	serviceRequest.setContentType(oFF.ContentType.APPLICATION_FORM);
	serviceRequest.setMethod(oFF.HttpRequestMethod.HTTP_POST);
	serviceRequest.setProxyType(oFF.ProxyType.NONE);
	serviceRequest.setCorsSecured(false);
	serviceRequest.setAuthenticationType(oFF.AuthenticationType.NONE);
	serviceRequest.setAcceptContentType(oFF.ContentType.WILDCARD);
	serviceRequest.setUser(null);
	serviceRequest.setPassword(null);
	let serviceRequestClient = serviceRequest.newHttpClient(this.getSession());
	serviceRequestClient.processHttpRequest(syncType, this, null);
};
