oFF.StandaloneSystemLandscape.prototype.replaceOriginsWithMirror = function()
{
	let systems = this.m_systemMap.getValuesAsReadOnlyList();
	let mirrors = oFF.XList.create();
	for (let i = 0; i < systems.size(); i++)
	{
		let system = systems.get(i);
		let origin = system.getProperties().getStringByKey(oFF.ConnectionParameters.ORIGIN);
		if (oFF.notNull(origin))
		{
			mirrors.add(system.getSystemName());
		}
	}
	for (let k = 0; k < mirrors.size(); k++)
	{
		let mirrorName = mirrors.get(k);
		let mirrorSystem = this.m_systemMap.getByKey(mirrorName);
		let originName = mirrorSystem.getProperties().getStringByKey(oFF.ConnectionParameters.ORIGIN);
		let originSystem = this.m_systemMap.getByKey(originName);
		if (oFF.notNull(originSystem))
		{
			this.m_systemMap.remove(mirrorName);
			this.m_systemMap.remove(originName);
			let mirrorBase = mirrorSystem;
			mirrorBase.setName(originName);
			this.m_systemMap.put(originName, mirrorBase);
		}
	}
};
