oFF.XFileSystemOSWrapper.prototype.getChildrenExt = function(file)
{
	let nativePath = file.getNativePath();
	let absoluteNativePathList = this.m_fsOS.getChildren(nativePath);
	let childNameList = oFF.XList.create();
	let nativeSlash = this.m_fsOS.getNativeSlash();
	let currentName;
	for (let i = 0; i < absoluteNativePathList.size(); i++)
	{
		let currentPath = absoluteNativePathList.get(i);
		let index = oFF.XString.lastIndexOf(currentPath, nativeSlash);
		if (index === oFF.XString.size(currentPath) - 1)
		{
			let noEndSlash = oFF.XString.substring(currentPath, 0, index);
			currentName = oFF.XStringUtils.concatenate2(noEndSlash, "/");
		}
		else
		{
			currentName = oFF.XString.substring(currentPath, index + 1, -1);
		}
		childNameList.add(currentName);
	}
	return childNameList;
};
oFF.XFileSystemOSWrapper.prototype.getChildrenMetadata = function(file)
{
	let children = oFF.XList.create();
	let nativePath = file.getNativePath();
	let absoluteNativePathList = this.m_fsOS.getChildren(nativePath);
	let nativeSlash = this.m_fsOS.getNativeSlash();
	let currentName;
	let parentUri = file.getUri();
	for (let i = 0; i < absoluteNativePathList.size(); i++)
	{
		let currentPath = absoluteNativePathList.get(i);
		let index = oFF.XString.lastIndexOf(currentPath, nativeSlash);
		if (index === oFF.XString.size(currentPath) - 1)
		{
			let noEndSlash = oFF.XString.substring(currentPath, 0, index);
			currentName = oFF.XStringUtils.concatenate2(noEndSlash, "/");
		}
		else
		{
			currentName = oFF.XString.substring(currentPath, index + 1, -1);
		}
		let metadata = oFF.PrFactory.createStructure();
		metadata.putString(oFF.XFileAttribute.NAME, currentName);
		metadata.putString(oFF.XFileAttribute.DISPLAY_NAME, currentName);
		metadata.putString(oFF.XFileAttribute.DESCRIPTION, currentName);
		metadata.putBoolean(oFF.XFileAttribute.IS_EXISTING, true);
		let isDir = this.m_fsOS.isDirectory(currentPath);
		metadata.putBoolean(oFF.XFileAttribute.IS_DIRECTORY, isDir);
		metadata.putBoolean(oFF.XFileAttribute.IS_FILE, !isDir);
		let fileType;
		if (isDir)
		{
			fileType = oFF.XFileType.DIR;
		}
		else
		{
			fileType = oFF.XFileType.FILE;
		}
		metadata.putString(oFF.XFileAttribute.FILE_TYPE, fileType.getName());
		let isHidden = this.m_fsOS.isHidden(currentPath);
		metadata.putBoolean(oFF.XFileAttribute.IS_HIDDEN, isHidden);
		let isExecutable = this.m_fsOS.isExecutable(currentPath);
		metadata.putBoolean(oFF.XFileAttribute.IS_EXECUTABLE, isExecutable);
		let isWriteable = this.m_fsOS.isWriteable(currentPath);
		metadata.putBoolean(oFF.XFileAttribute.IS_WRITEABLE, isWriteable);
		let isReadable = this.m_fsOS.isReadable(currentPath);
		metadata.putBoolean(oFF.XFileAttribute.IS_READABLE, isReadable);
		let changedAt = this.m_fsOS.getLastModifiedTimestamp(currentPath);
		metadata.putLong(oFF.XFileAttribute.CHANGED_AT, changedAt);
		let size = this.m_fsOS.getSize(currentPath);
		metadata.putLong(oFF.XFileAttribute.SIZE, size);
		let targetUri;
		if (isDir)
		{
			targetUri = oFF.XUri.createChildDir(parentUri, currentName);
		}
		else
		{
			targetUri = oFF.XUri.createChildFile(parentUri, currentName);
		}
		if (oFF.notNull(targetUri) && targetUri.isUriResolved())
		{
			metadata.putString(oFF.XFileAttribute.TARGET_URL, targetUri.getUrl());
		}
		children.add(metadata);
	}
	return children;
};
