{
	listener.onFileProviderChildrenFetched(extResult, data, data.getProviderChildFiles(), data.getProviderChildrenResultset(), customIdentifier);
};
oFF.VfsActionFetchChildren.prototype.onFileProviderChildrenFetched = function(extResult, file, children, resultset, customIdentifier)
{
	this.addAllMessages(extResult);
	if (extResult.isValid())
	{
		let myFile = this.getFile();
		let targets = oFF.XList.create();
		for (let i = 0; i < children.size(); i++)
		{
			targets.add(children.get(i));
		}
		myFile.setProviderChildFiles(targets, targets.size());
	}
	this.endSync();
};
oFF.VfsActionFetchChildren.prototype.onFileProviderFetched = function(extResult, file, customIdentifier)
{
	this.addAllMessages(extResult);
	if (extResult.isValid())
	{
		let targetFile = file;
		let myFile = this.getFile();
		myFile.setTargetMountFile(targetFile);
		targetFile.processProviderFetchChildren(this.getActiveSyncType(), this, null, this.m_fileQuery);
	}
	else
	{
		this.endSync();
	}
};
oFF.VfsActionFetchChildren.prototype.processSynchronization = function(syncType)
{
	let file = this.getFile();
	let process = file.getProcess();
	let fileSystem = file.getProviderFileSystem();
	let element = this.m_pathInfo.getElement();
	let type = element.getComponentType();
	let uri = file.getUri();
	if (type === oFF.VfsElementType.DIR)
	{
		let dir = element;
		let childElementList = dir.getChildElements();
		let fileList = oFF.XList.create();
		let childFile;
		let childName;
		let childUri;
		let childPathInfo;
		let size = childElementList.size();
		let childElement;
		for (let i = 0; i < size; i++)
		{
			childElement = childElementList.get(i);
			childName = childElement.getName();
			childUri = oFF.XUri.createChildFile(uri, childName);
			childPathInfo = fileSystem.getPathInfo(childUri.getPath());
			childFile = oFF.VfsFileProvider.createExt(process, fileSystem, childUri, childPathInfo, null, childElement);
			fileList.add(childFile);
		}
		file.setProviderChildFiles(fileList, size);
	}
	else if (type === oFF.VfsElementType.MOUNT_POINT)
	{
		let mountPoint = this.m_pathInfo.getMountPoint();
		if (oFF.notNull(mountPoint))
		{
			let targetUri = mountPoint.calculateTargetUri(uri);
			let fileSystemManager = process.getFileSystemManager();
			fileSystemManager.processFetchFileProvider(syncType, this, null, process, targetUri);
			return true;
		}
	}
	else
	{
		let childMetadata = this.m_pathInfo.getChildMetadata();
		file.setChildMetadata(childMetadata, -1);
	}
	this.addAllMessages(file);
	return false;
};
