{
	let newObj = new oFF.XFileActionFetchChildren();
	newObj.m_config = config;
	newObj.setupActionAndRun(syncType, listener, customIdentifier, fileHandle);
	return newObj;
};
oFF.XFileActionFetchChildren.prototype.m_config = null;
oFF.XFileActionFetchChildren.prototype.m_proxyFiles = null;
oFF.XFileActionFetchChildren.prototype.callListener = function(extResult, listener, data, customIdentifier)
{
	listener.onChildrenFetched(extResult, data, this.m_proxyFiles, null, customIdentifier);
};
oFF.XFileActionFetchChildren.prototype.onFileProviderChildrenFetched = function(extResult, file, children, resultset, customIdentifier)
{
	this.addAllMessages(extResult);
	if (this.isValid())
	{
		let originFile = this.getActionContext();
		if (originFile.isHandleValid())
		{
			originFile.setTargetFile(extResult.getData());
		}
		else
		{
			this.addError(0, "File handle no longer valid");
		}
	}
	this.m_proxyFiles = oFF.XList.create();
	let parentHandle = this.getActionContext();
	if (parentHandle.isHandleValid())
	{
		if (extResult.isValid() && oFF.notNull(children))
		{
			let process = parentHandle.getProcess();
			if (oFF.notNull(process))
			{
				let parentVfs = parentHandle.getUri();
				for (let i = 0; i < children.size(); i++)
				{
					let targetFile = children.get(i);
					let targetUri = oFF.XUri.createChildFile(parentVfs, targetFile.getName());
					let theProxyFile = oFF.XFileHandle.createByTarget(process, targetUri, targetFile, parentHandle.isBlockingMetadataCallFallback());
					this.m_proxyFiles.add(theProxyFile);
				}
			}
		}
		let totalItemCount = oFF.notNull(resultset) ? resultset.getTotalItemCount() : -1;
		let fileHandle = this.getActionContext();
		fileHandle.setChildFiles(this.m_proxyFiles, totalItemCount);
	}
	else
	{
		this.addError(0, "File handle no longer valid");
	}
	this.onMainActionFinished(null, true);
};
oFF.XFileActionFetchChildren.prototype.runMainAction = function(syncType, file)
{
	if (this.checkSupport("Fetch children", file.supportsProviderFetchChildren()))
	{
		file.processProviderFetchChildren(syncType, this, null, this.m_config);
	}
};

