oFF.XFileProviderClassicActionSave.prototype._ff_c = "XFileProviderClassicActionSave";

oFF.XFileProviderClassicActionSave.createAndRun = function(syncType, listener, customIdentifier, fileSystem, file, content, compression)
{
	let object = new oFF.XFileProviderClassicActionSave();
	object.m_content = content;
	object.m_compression = compression;
	object.setData(file);
	object.setupActionAndRun(syncType, listener, customIdentifier, fileSystem);
	return object;
};
oFF.XFileProviderClassicActionSave.prototype.m_compression = null;
oFF.XFileProviderClassicActionSave.prototype.m_content = null;
oFF.XFileProviderClassicActionSave.prototype.callListener = function(extResult, listener, data, customIdentifier)
{
	listener.onFileProviderSaved(extResult, data, this.m_content, customIdentifier);
};
oFF.XFileProviderClassicActionSave.prototype.processSynchronization = function(syncType)
{
	let file = this.getFile();
	if (this.m_compression === oFF.CompressionType.GZIP)
	{
		file.saveByteArrayGzipped(this.m_content.getByteArray());
	}
	else
	{
		let isBinaryContent = this.m_content.getContentType() !== null && this.m_content.getContentType().isBinary();
		if (isBinaryContent && this.m_content.isBinaryContentSet())
		{
			file.saveByteArray(this.m_content.getByteArray());
		}
		else
		{
			let fileContentBinary = oFF.XByteArray.convertFromString(this.m_content.getString());
			file.saveByteArray(fileContentBinary);
		}
	}
	this.addAllMessages(file);
	return false;
};

